INSERT INTO `assignment` VALUES (1,9,76,'Test Your Knowledge',5,'https://canvas-lms.ga/courses/4/assignments/9',4,'<p><img src=\"https://canvas-lms.ga/courses/4/files/247/preview?verifier=ShvOpiDkpVLKsKkgPrRrI9dc6ghHMwL5KwZy85ps\" alt=\"Page_Header.JPG\" width=\"2010\" height=\"214\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/4/files/247\" data-api-returntype=\"File\"></p>\n<table style=\"width: 100%; border-collapse: collapse;\">\n<tbody>\n<tr>\n<td style=\"width: 50%; text-align: center;\">\n<p><span style=\"font-size: 14pt;\">Congratulations!!  You\'ve successfully reviewed the AWS Educate program features and benefits. </span></p>\n<p><span style=\"font-size: 14pt;\"> Think you know the benefits of AWS Educate? Take this five-question quiz to find out.</span></p>\n</td>\n<td style=\"width: 50%;\"><img src=\"https://canvas-lms.ga/courses/4/files/255/preview?verifier=zv2EPSHdczwJSnMUg4HHEqbJx1t9xZghpucZzWrF\" alt=\"Thinking Graphic.JPG\" width=\"300\" height=\"223\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/4/files/255\" data-api-returntype=\"File\"></td>\n</tr>\n</tbody>\n</table>\n<p><span style=\"font-size: 14pt;\">Read each question carefully, and click the answer choice next to your response. Each correct or incorrect response will result in appropriate feedback immediately at the bottom of the screen.</span></p>\n<p><span style=\"font-size: 14pt;\">Good luck!</span></p>',NULL,'2020-10-13 12:05:47','2020-12-18 18:57:09',NULL,'https://canvas-lms.ga/courses/4/quizzes/2/submissions?zip=1',2,NULL),(2,479,76,'HHMI genetics and chi square: sickle cell',38,'https://canvas-lms.ga/courses/10/assignments/479',10,'<p>WE will begin this in class:</p>\n<p>You can work in pairs, but each student must upload a completed worksheet to Canvas for credit. </p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"hhmi probability and chi square.pdf\" href=\"https://canvas-lms.ga/courses/10/files/489/download?verifier=IsA0FC41kQkmAm8SPyiMJZgvRAqtcQTfcQCBoblB&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/489\" data-api-returntype=\"File\">hhmi probability and chi square.pdf</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:21',NULL,'https://canvas-lms.ga/courses/10/assignments/479/submissions?zip=1',0,NULL),(3,495,76,'Work for 1/25 Wednesday (sub plans)',38,'https://canvas-lms.ga/courses/10/assignments/495',10,'<p>Please compete the following case study:</p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Case Study- Trip to the Genetic Counselor.pdf\" href=\"https://canvas-lms.ga/courses/10/files/454/download?verifier=Rpw7cw7bC4U1Ypz9AanipdQtjOCd8nVUlUKHhF9V&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/454\" data-api-returntype=\"File\">Case Study- Trip to the Genetic Counselor.pdf</a></p>\n<p>ANSWER KEY: <a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Answer Key for “In Sickness and in Health” - Case Study Collection - National Center for Case Study .pdf\" href=\"https://canvas-lms.ga/courses/10/files/404/download?verifier=bT1ieTuIgtTUujR971Ox1IDlFFceSSocMzD2Cbqr&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/404\" data-api-returntype=\"File\">Answer Key for “In Sickness and in Health” - Case Study Collection - National Center for Case Study .pdf</a></p>\n<p>Each student needs to turn in a <span style=\"text-decoration: underline;\"><strong>pedigre</strong></span>e and <span style=\"text-decoration: underline;\"><strong>answers to questions up through Part V.  DUE AT THE END OF CLASS!!!</strong></span></p>\n<p><span>Once done with the case study, please complete the following worksheet as a review for the exam next week. The worksheet is not due for credit, but it is a great practice (hint...hint) for the exam. The more of it you complete, the better you will do! </span></p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Non-Mendelian Genetics Practice[1].pdf\" href=\"https://canvas-lms.ga/courses/10/files/439/download?verifier=wgPJlFzQjgoBoPhKGUbP56clg0j0vnlFkwY1e7EP&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/439\" data-api-returntype=\"File\">Non-Mendelian Genetics Practice[1].pdf</a></p>\n<p>  </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:22','2020-10-13 12:32:28',NULL,'https://canvas-lms.ga/courses/10/assignments/495/submissions?zip=1',0,NULL),(4,468,76,'Darwin\'s Finches',38,'https://canvas-lms.ga/courses/10/assignments/468',10,'<p>We will be working on this assignment in class. </p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Natural Selection and Darwin\'s Finches.pdf\" href=\"https://canvas-lms.ga/courses/10/files/437/download?verifier=TftP3yB1AYKNZMpIqiHuVkIYU5YsJAGHZVukIbSj&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/437\" data-api-returntype=\"File\">Natural Selection and Darwin\'s Finches.pdf</a></p>\n<p>Video needed to complete: <a id=\"\" class=\"\" title=\"\" href=\"https://www.playposit.com/delivery/29967/549169/genetics-of-finch-beaks\" target=\"\">https://www.playposit.com/delivery/29967/549169/genetics-of-finch-beaks</a></p>\n<p>Each student must upload a picture of their groups work (classification and graphs) throughout the lab and answers to the questions. </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:19','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/468/submissions?zip=1',0,NULL),(5,491,76,'Phylogenetics video',38,'https://canvas-lms.ga/courses/10/assignments/491',10,'<p>Watch the following video, answer the embedded questions and take notes. I will grade the questions on correctness (10 points) and the notes on completion and submission to canvas. (5 pts.)</p>\n<p><a href=\"https://www.playposit.com/play/553014/new-bulb-20170216-172217\"><span>https://www.playposit.com/play/553014/new-bulb-20170216-172217</span></a></p>\n<p><a href=\"https://www.playposit.com/play/553014/new-bulb-20170216-172217\"><span></span></a></p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:22','2020-10-13 12:32:22',NULL,'https://canvas-lms.ga/courses/10/assignments/491/submissions?zip=1',0,NULL),(6,467,76,'Cladogram worksheet',38,'https://canvas-lms.ga/courses/10/assignments/467',10,'<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"cladogram activity.pdf\" href=\"https://canvas-lms.ga/courses/10/files/472/download?verifier=fZNlw8krGqEOgTAesAT4N8VC2QVIAKABTwr3qSKV&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/472\" data-api-returntype=\"File\">cladogram activity.pdf</a></p>\n<p>We will work on this periodically in class. I will post the answer key before the exam for studying. </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:19','2020-10-13 12:32:19',NULL,'https://canvas-lms.ga/courses/10/assignments/467/submissions?zip=1',0,NULL),(7,483,76,'Lizard Evolution Lab',38,'https://canvas-lms.ga/courses/10/assignments/483',10,'<p>In order to get full credit, I need to see the following;</p>\n<p>1. A screenshot of the \"progress\" page indicating all sections are completed.</p>\n<p>2. A screenshot of your results graph from the measurement section (it says optional, but its not!)</p>\n<p>3. A completed packet: <a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Lizard-Evolution-Virtual-Lab-Student-Worksheet.pdf\" href=\"https://canvas-lms.ga/courses/10/files/441/download?verifier=kVDSgERufTyQ8aUYKq4XSc0mqEitV5eOPS3lnxA8&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/441\" data-api-returntype=\"File\">Lizard-Evolution-Virtual-Lab-Student-Worksheet.pdf</a></p>\n<p>Upload all components for full credit.</p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:21',NULL,'https://canvas-lms.ga/courses/10/assignments/483/submissions?zip=1',0,NULL),(8,493,76,'Selection worksheet',38,'https://canvas-lms.ga/courses/10/assignments/493',10,'<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"selection type.pdf\" href=\"https://canvas-lms.ga/courses/10/files/491/download?verifier=ulPbiwtAXYd3v8Hwx2mOSWROoU81NxyMiot7JUHI&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/491\" data-api-returntype=\"File\">selection type.pdf</a></p>\n<p>We will work on this in class, and I will post an answer key on Friday.</p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:22','2020-10-13 12:32:22',NULL,'https://canvas-lms.ga/courses/10/assignments/493/submissions?zip=1',0,NULL),(9,481,76,'HW practice',38,'https://canvas-lms.ga/courses/10/assignments/481',10,'<p>We will work on this in class! </p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"hardy-weinberg_worksheet.pdf\" href=\"https://canvas-lms.ga/courses/10/files/421/download?verifier=4eCF23AX7oGVyy5hsVFCq01ujgF7NTqkqTBwclFg&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/421\" data-api-returntype=\"File\">hardy-weinberg_worksheet.pdf</a></p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"HW and chi square.pdf\" href=\"https://canvas-lms.ga/courses/10/files/428/download?verifier=w1PurvfbwGmCfOfZZPvNSrC7bghqkhw16QLN2bl9&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/428\" data-api-returntype=\"File\">HW and chi square.pdf</a></p>\n<p><span>Evolution is one of the unifying themes of biology. Evolution involves change in the frequencies of alleles in a population. For a particular genetic locus in a population, the frequency of the recessive allele (a) is 0.4 and the frequency of the dominant allele <i>(A) </i>is 0.6.</span></p>\n<p><span>(a) What is the frequency of each genotype <i>(AA, Aa, aa) </i>in this population? What is the frequency of </span><span>the </span><span>dominant phenotype?</span></p>\n<p><span>(b) How can the Hardy-Weinberg principle of genetic equilibrium be used to determine whether this population is evolving?</span></p>\n<p><span>(c) Identify a particular environmental change and describe how it might alter allelic frequencies in this population. Explain which condition of the Hardy-Weinberg principle would not be met.</span></p>\n<p><span> </span></p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:21',NULL,'https://canvas-lms.ga/courses/10/assignments/481/submissions?zip=1',0,NULL),(10,482,76,'In class practice for Chapter 40',38,'https://canvas-lms.ga/courses/10/assignments/482',10,'<p>We will practice this in class. </p>\n<p>both worksheets need to be uploaded to canvas for credit. </p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"ECOLOGY logistic and exponential growth worksheet.pdf\" href=\"https://canvas-lms.ga/courses/10/files/412/download?verifier=G55kvbgWW2qYknpOeprIZN0DMwO8zxgS749hIoJE&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/412\" data-api-returntype=\"File\">ECOLOGY logistic and exponential growth worksheet.pdf</a></p>\n<p>Once you have completed the first worksheet, come ask me for your supplies for the second worksheet. </p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Estimating Population Size.pdf\" href=\"https://canvas-lms.ga/courses/10/files/449/download?verifier=c4RF7nkCNbXsH7oSpqOB7NHVYryrxeXS5aimJBgN&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/449\" data-api-returntype=\"File\">Estimating Population Size.pdf</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/482/submissions?zip=1',0,NULL),(11,478,76,'Genetic Variation Vid and GN',37,'https://canvas-lms.ga/courses/10/assignments/478',10,'<p>Watch the following video, or use Khan Academy to answer the following questions. </p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Variation in Genetics VGN.pdf\" href=\"https://canvas-lms.ga/courses/10/files/453/download?verifier=4r5yTo2MTqZW5vunnKga256w2QYKvNlyH1Zx5C68&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/453\" data-api-returntype=\"File\">Variation in Genetics VGN.pdf</a> Upload a completed worksheet for credit. </p>\n<p>Quiz on this material next class. </p>\n<p>Khan Academy reading: <a href=\"https://www.khanacademy.org/science/biology/bacteria-archaea/prokaryote-structure/a/genetic-variation-in-prokaryotes\">https://www.khanacademy.org/science/biology/bacteria-archaea/prokaryote-structure/a/genetic-variation-in-prokaryotes</a></p>\n<p>Bozeman Video: <a class=\"\" href=\"https://www.youtube.com/watch?v=FbERJobgsGQ\">https://www.youtube.com/watch?v=FbERJobgsGQ</a></p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:21',NULL,'https://canvas-lms.ga/courses/10/assignments/478/submissions?zip=1',0,NULL),(12,323,76,'September- 2',25,'https://canvas-lms.ga/courses/8/assignments/323',8,'<p class=\"p2\"><span class=\"s1\"></span> <span class=\"s1\"><strong>1.   A </strong><a href=\"http://www2.ucdsb.on.ca/tiss/stretton/Basic_skills/Dimensional_Analysis_Level_3.htm\"><span class=\"s2\"><strong>molecule</strong></span></a><strong> of hydrogen moves at a speed of 115 cm/s.  How long will it take to travel the length of a football field (100 yd long)? ( This is an application problem)</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"><span class=\"s1\"><strong>2.   The speed of light is 3.0 X 10^10 cm/s.  Express this in mi/hr.</strong></span></p>\n<p class=\"p3\"> </p>\n<p class=\"p2\"> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:27','2020-10-13 09:20:27',NULL,'https://canvas-lms.ga/courses/8/assignments/323/submissions?zip=1',NULL,NULL),(13,331,76,'September 6th',25,'https://canvas-lms.ga/courses/8/assignments/331',8,'<p>In a complete paragraph, on this page, tell me about your long weekend. Did you enjoy yourself?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:28',NULL,'https://canvas-lms.ga/courses/8/assignments/331/submissions?zip=1',NULL,NULL),(14,332,76,'September 7th',25,'https://canvas-lms.ga/courses/8/assignments/332',8,'<p>In preparation for your test, draw a smiley face in your science notebook and label it Chapter 2 test day smile. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:28',NULL,'https://canvas-lms.ga/courses/8/assignments/332/submissions?zip=1',NULL,NULL),(15,333,76,'September 8',25,'https://canvas-lms.ga/courses/8/assignments/333',8,'<p>Tell me in a complete paragraph how might the math that we have been doing be useful as we go further into Chemistry. (DO NOT BE FLIPPANT)</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:54',NULL,'https://canvas-lms.ga/courses/8/assignments/333/submissions?zip=1',NULL,NULL),(16,334,76,'September 9th',25,'https://canvas-lms.ga/courses/8/assignments/334',8,'<p>Google the terms <span style=\"text-decoration: underline;\"><span style=\"color: #ff0000; text-decoration: underline;\">Intensive Properties and Extensive properties</span></span> and write a paragraph explaining them in your own words. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:54',NULL,'https://canvas-lms.ga/courses/8/assignments/334/submissions?zip=1',NULL,NULL),(17,318,76,'September 12th',25,'https://canvas-lms.ga/courses/8/assignments/318',8,'<p><span>Why might you need to identify an unknown object or substance in the Chemistry lab? Give me an example of how you might be able to find the unknown\'s identity?</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:27','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/318/submissions?zip=1',NULL,NULL),(18,319,76,'September 13th',25,'https://canvas-lms.ga/courses/8/assignments/319',8,'<p>Explain what a chemical compound is and give an example. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:27','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/319/submissions?zip=1',NULL,NULL),(19,320,76,'September 14',25,'https://canvas-lms.ga/courses/8/assignments/320',8,'<p>Explain the difference between an element and a compound. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:27','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/320/submissions?zip=1',NULL,NULL),(20,321,76,'September 16th',25,'https://canvas-lms.ga/courses/8/assignments/321',8,'<p>Explain in a detailed paragraph why it is important to not only know but understand the vocabulary used in Chemistry.</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:27','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/321/submissions?zip=1',NULL,NULL),(21,322,76,'September 19',25,'https://canvas-lms.ga/courses/8/assignments/322',8,'<p><span>READ ALL DIRECTIONS SILENTLY BEFORE </span><span>STARTING ASSIGNMENT! </span><span>Tell me what you know about </span><span style=\"color: #ff0000;\">atomic mass, atomic number, electrons, and electron shells</span><span><span style=\"color: #ff0000;\">.</span>  ( If I hear the words \"but what if I don\'t know nothing/ anything\" I will take points of your daily grade. THINK OF SOMETHING or tell me </span><span style=\"color: #ff0000;\">intelligently</span><span> that you are unaware of any details on this subject matter)</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:27','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/322/submissions?zip=1',NULL,NULL),(22,499,76,'Update Student Profile and Bio',43,'https://canvas-lms.ga/courses/11/assignments/499',11,'<p>Now that you have read and watched a video which explains how to update your student profile, you must demonstrate your abilities to follow instructions. </p>\n<p>Your task is as follows:</p>\n<p>1) Update your profile picture with your favorite selfie. This must be school friendly. </p>\n<p>2) Edit your bio by answering the following questions be sure to use proper grammar:</p>\n<ul>\n<li>What would people you know find surprising about you as a teen?</li>\n<li>If you could have ONE wish what would it be and why?</li>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-13 09:38:43','2020-10-13 09:38:43',NULL,'https://canvas-lms.ga/courses/11/assignments/499/submissions?zip=1',NULL,NULL),(23,500,76,'What do you want to learn?',44,'https://canvas-lms.ga/courses/11/assignments/500',11,'<p>What would you like to learn while participating in this course? Please type in your response. </p>\n<ul></ul>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-13 09:38:44','2020-10-13 09:38:44',NULL,'https://canvas-lms.ga/courses/11/assignments/500/submissions?zip=1',NULL,NULL),(24,498,76,'Send an Email with Your School Account',44,'https://canvas-lms.ga/courses/11/assignments/498',11,'<p>For this assignment, you will need to complete the following steps:</p>\n<ol>\n<li>Log into your SCS Student Account.</li>\n<li>Send me an email with the following information to <a href=\"mailto:bondk1@scsk12.org\">bondk1@scsk12.org</a> and <a href=\"mailto:mrskbondenglish@gmail.com\">mrskbondenglish@gmail.com</a> :</li>\n<ol>\n<li>In the <strong>Subject line</strong>, Put your FIRST and LAST NAME</li>\n<li>In the Body, write the following sentence: \"I will check my email everyday.\"</li>\n<li>Send your email.</li>\n</ol>\n<li>In the Text Entry box for this assignment, write \"I have sent my email.\"</li>\n<li>Click the Submit button to submit this assignment.</li>\n</ol>\n<p>Once I have both the email and the assignment submission, your points will be added.</p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:38:43','2020-10-13 09:38:43',NULL,'https://canvas-lms.ga/courses/11/assignments/498/submissions?zip=1',NULL,NULL),(25,497,76,'Introduce Yourself',44,'https://canvas-lms.ga/courses/11/assignments/497',11,'<p><strong>Choose 2</strong> of the questions below to respond to in a complete sentence. Once you\'ve posted your response, <strong>read those left by other students and reply to three of their posts</strong>. </p>\n<ol>\n<li>What as the last movie you watched?</li>\n<li>What is your favorite TV show?</li>\n<li>What do you usually have for breakfast?</li>\n<li>What is your favorite sandwich?</li>\n<li>How do you like to celebrate your birthday?</li>\n<li>What upcoming event are you looking forward to?</li>\n<li>What is the last book you read?</li>\n<li>What is your favorite restaurant?</li>\n<li>What is something that no one here knows about you?</li>\n<li>What\'s your idea of the perfect day?</li>\n</ol>\n<p> </p>',NULL,'2020-10-13 09:38:42','2020-10-13 09:38:43',NULL,'https://canvas-lms.ga/courses/11/assignments/497/submissions?zip=1',NULL,NULL),(26,496,76,'Digital Etiquette',44,'https://canvas-lms.ga/courses/11/assignments/496',11,'<p>Select the best answer to the following questions.</p>',NULL,'2020-10-13 09:38:41','2020-10-13 09:38:42',NULL,'https://canvas-lms.ga/courses/11/quizzes/50/submissions?zip=1',NULL,NULL),(27,39,76,'Introductions',8,'https://canvas-lms.ga/courses/6/assignments/39',6,'<p>Please introduce yourself with a short video (about 5 minutes) that tells us about you, and why you are in this class.</p>\n<p>Topics <em><span style=\"text-decoration: underline;\">can</span></em> include things such as:</p>\n<ul>\n<li>Name?</li>\n<li>Age?</li>\n<li>Where you are from or where you are now?</li>\n<li>Siblings/Children - with fur and without =]</li>\n<li>Hobbies?</li>\n<li>Why you are interested in the DA field?</li>\n<li>What are your career goals for the future?</li>\n<li>Are you nervous about this class at all?</li>\n<li>Do you have any experience with any of the systems we will be using?</li>\n<li>Does Pavlov think about feeding his dog when he hears the bell as well? </li>\n</ul>\n<p>Have fun with it. We are here to learn and grow together in this field, and as this is an online class, we want to get as much of a feeling of comradery as we can. </p>\n<p><img src=\"https://canvas.instructure.com/users/28391643/files/111991674/preview?verifier=HPBj1FRdY4dsoRWVkYWEGVmCGXlHXvY5dFuQrTV6\" alt=\"qLSEdKU.gif\" width=\"430\" height=\"299\"></p>\n<p>*Please respond to at least 2 peers by the end of the week, and focus on the people who don\'t have any comments on them first.  Generally/Statistically, the first few people end up with all the comments, and the bottom ones as left untouched, lets change this. =]</p>',NULL,'2020-10-13 09:10:37','2020-10-13 09:10:37',NULL,'https://canvas-lms.ga/courses/6/assignments/39/submissions?zip=1',NULL,NULL),(28,73,76,'Read Syllabus',8,'https://canvas-lms.ga/courses/6/assignments/73',6,'<hr>\n<p><img src=\"https://canvas-lms.ga/courses/6/files/292/preview?verifier=EFLcajWGN1M51H9IyQ2sKen0EWxAWQRLyraZRI4H\" alt=\"Assignmentbanner.png\" width=\"800\" height=\"116\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/6/files/292\" data-api-returntype=\"File\"></p>\n<hr>\n<p>Read the syllabus over so that you understand the expectations of the course. </p>\n<hr>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:10:42','2020-10-13 09:10:42',NULL,'https://canvas-lms.ga/courses/6/assignments/73/submissions?zip=1',NULL,NULL),(29,28,76,'Syllabus Quiz',8,'https://canvas-lms.ga/courses/6/assignments/28',6,'<hr>\n<p><img src=\"https://canvas-lms.ga/courses/6/files/293/preview?verifier=1I4JNGVQt5TvRUj8VP6nXKFRNdIKppTMtuKpPCVG\" alt=\"quizbanner.png\" width=\"100%\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/6/files/293\" data-api-returntype=\"File\"></p>\n<hr>\n<p><span style=\"font-size: 24px;\"><strong>Read over the Syllabus and answer the questions:</strong></span></p>\n<hr>\n<p> </p>',NULL,'2020-10-13 09:10:34','2020-10-13 09:10:34',NULL,'https://canvas-lms.ga/courses/6/quizzes/20/submissions?zip=1',NULL,NULL),(30,58,76,'Reading 1',8,'https://canvas-lms.ga/courses/6/assignments/58',6,'<p><span style=\"text-decoration: underline;\">(1) Read the following article:</span></p>\n<ul>\n<li>\n<span>50 Years of Data Science - By David Donoho @</span> <a href=\"https://www.tandfonline.com/doi/full/10.1080/10618600.2017.1384734\">https://www.tandfonline.com/doi/full/10.1080/10618600.2017.1384734</a>\n</li>\n</ul>\n<p> </p>\n<p><span style=\"text-decoration: underline;\">(2) Select 2 of the following articles to read: </span></p>\n<ul>\n<li>\n<span style=\"font-size: 12pt;\">What’s the difference between data, analytics and insights experts? - Moran Phillips Group @ </span> <a href=\"https://www.morganphilips.com/en/insights/whats-the-difference-between-data-analytics-and-insights-experts\">https://www.morganphilips.com/en/insights/whats-the-difference-between-data-analytics-and-insights-experts</a>\n</li>\n<li>\n<span style=\"font-size: 12pt;\">Data vs. Information vs. Insight - <strong>Benedictine University @ </strong></span> <a href=\"https://online.ben.edu/programs/mba/resources/data-vs-information-vs-insight\">https://online.ben.edu/programs/mba/resources/data-vs-information-vs-insight</a>\n</li>\n<li>\n<span style=\"font-size: 12pt;\">THE DIFFERENCE BETWEEN DATA, ANALYTICS AND INSIGHTS - By Elisa Choy @ </span> <a href=\"https://www.strategicdatacentral.com.au/the-difference-between-data-analytics-and-insights/\">https://www.strategicdatacentral.com.au/the-difference-between-data-analytics-and-insights/</a>\n</li>\n<li>\n<span style=\"font-size: 12pt;\">What’s the Difference Between Data, Analytics, and Insights? - By Erin Acheson @ </span><span style=\"font-size: 12pt;\"> <a href=\"https://www.demandsphere.com/blog/whats-the-difference-between-data-analytics-and-insights/\">https://www.demandsphere.com/blog/whats-the-difference-between-data-analytics-and-insights/</a></span>\n</li>\n<li>\n<span style=\"font-size: 12pt;\">The Difference Between Data, Analytics, and Insights - By Megan Marrs @ </span><span style=\"font-size: 12pt;\"> <a href=\"https://uplandsoftware.com/localytics/resources/blog/difference-between-data-analytics-insights/\">https://uplandsoftware.com/localytics/resources/blog/difference-between-data-analytics-insights/</a></span>\n</li>\n</ul>\n<p> </p>\n<p><span style=\"text-decoration: underline;\"><strong>Then please answer the following questions about the reading - please submit as a PDF.</strong></span></p>\n<p>(1) First Reading (Donoho) (5 points each)</p>\n<ol>\n<li>Write a brief paragraph on what aspects of data science are less developed compared to its components fields and how you expect those areas to develop.</li>\n<li>Find an example curriculum for another data science program: (easy to find examples with google - things like MIDS at Duke, Data Science at USF, Data Analytics at Denison) and compare its course structure to the vision that Donoho presents.</li>\n<li>How does WSU’s curriculum compare to the other programs that you reviewed? Write a short paragraph comparing the content of these degree programs.</li>\n<li>Do you think that their respective graduates will be well-prepared to perform data analytics in the real world?</li>\n</ol>\n<p><span style=\"font-size: 12pt;\">(2) Read two of the short blog posts: (5 points each)</span></p>\n<ol>\n<li>Write a brief paragraph describing the differences between data, analytics, and insight as defined in the posts that you read.</li>\n<li>What assumptions do the authors of the blog posts make when compared to the discussion in the Donoho piece?</li>\n</ol>\n<ul>\n</ul>',NULL,'2020-10-13 09:10:40','2020-10-13 09:10:40',NULL,'https://canvas-lms.ga/courses/6/assignments/58/submissions?zip=1',NULL,NULL),(31,42,76,'HW 1',8,'https://canvas-lms.ga/courses/6/assignments/42',6,'<p>The assignment itself is worth 37 points. Questions are labeled with point values.</p>\n<p>If you have the assignment turned in on time, it will be an additional 3 points awarded for a total of 40 points. </p>\n<p> </p>\n<p><a class=\"instructure_file_link instructure_scribd_file\" title=\"HW 1.docx\" href=\"https://canvas-lms.ga/courses/6/files/289/download?verifier=SWEkVzyt7pydBxUXyne2owPqfkqqzuTY7EAFurOE&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/6/files/289\" data-api-returntype=\"File\">HW 1.docx</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:10:38','2020-10-13 09:10:38',NULL,'https://canvas-lms.ga/courses/6/assignments/42/submissions?zip=1',NULL,NULL),(32,21,76,'QuickQuiz 1',8,'https://canvas-lms.ga/courses/6/assignments/21',6,'<p>The questions on this quiz are made to ensure that you are watching the recorded material. <br>As there are 2 lectures each week, it is set up for one question per lecture </p>',NULL,'2020-10-13 09:10:31','2020-10-13 09:10:31',NULL,'https://canvas-lms.ga/courses/6/quizzes/13/submissions?zip=1',NULL,NULL),(33,74,76,'Respond to 2 peers introductions - (5 points each)',9,'https://canvas-lms.ga/courses/6/assignments/74',6,'<p><span>Respond to at least 2 peers by the end of the week, and focus on the people who don\'t have any comments on them first.  Generally/Statistically, the first few people end up with all the comments, and the bottom ones as left untouched, lets change this. =]</span></p>\n<p><a title=\"Introductions\" href=\"https://canvas-lms.ga/courses/6/discussion_topics/17\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/6/discussion_topics/17\" data-api-returntype=\"Discussion\">Introductions</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:10:42','2020-10-13 09:10:42',NULL,'https://canvas-lms.ga/courses/6/assignments/74/submissions?zip=1',NULL,NULL),(34,65,76,'Reading 2',9,'https://canvas-lms.ga/courses/6/assignments/65',6,'<p><span style=\"text-decoration: underline;\">(1) ## Add information for reading assignment:</span></p>\n<ul>\n<li>\n</li>\n</ul>\n<p> </p>\n<p><span style=\"text-decoration: underline;\">(2) ## Add information for reading assignment:</span></p>\n<p> </p>\n<p><span style=\"text-decoration: underline; font-size: 18pt;\"><strong>Then please answer the following questions about the reading - <span style=\"color: #800000; text-decoration: underline;\" data-darkreader-inline-color=\"\"><em>please submit as a PDF</em></span>.</strong></span></p>\n<p>(1) First Reading - (5 points each)</p>\n<ol>\n<li> ##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li> </li>\n</ol>\n<p><span style=\"font-size: 12pt;\">(2) Second Reading -  (5 points each)</span></p>\n<ol>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>\n</li>\n</ol>\n<ul>\n</ul>',NULL,'2020-10-13 09:10:41','2020-10-13 09:10:41',NULL,'https://canvas-lms.ga/courses/6/assignments/65/submissions?zip=1',NULL,NULL),(35,38,76,'Discussion WK 2 - Climate Corp case study',9,'https://canvas-lms.ga/courses/6/assignments/38',6,'<p>Please watch the following link for the discussion prompts this week:</p>\n<p><a href=\"https://wsu.hosted.panopto.com/Panopto/Pages/Viewer.aspx?id=163355a4-7d1b-4368-ab38-abc7012fc0a0\">https://wsu.hosted.panopto.com/Panopto/Pages/Viewer.aspx?id=163355a4-7d1b-4368-ab38-abc7012fc0a0</a></p>\n<p> </p>\n<p>Please explain why you feel that Climate Corp has struggled to get more people interested in their product. (10 points)</p>\n<p>Please also include a recap of the information that is in the presentation to help justify your response.  (10 points)</p>\n<p> </p>\n<p>* You may upload a video for your discussion post, or a written work, whichever you prefer. </p>',NULL,'2020-10-13 09:10:37','2020-10-13 09:10:37',NULL,'https://canvas-lms.ga/courses/6/assignments/38/submissions?zip=1',NULL,NULL),(36,49,76,'HW 2',9,'https://canvas-lms.ga/courses/6/assignments/49',6,'<p>The assignment itself is worth 37 points. Questions are labeled with point values.</p>\n<p>If you have the assignment turned in on time, it will be an additional 3 points awarded for a total of 40 points. </p>\n<p> </p>\n<p>## insert HW template here</p>\n<ul>\n</u