the exam solutions</strong></em>.</li>\n<li>On a separate <strong>Word document</strong>, for <em><strong>each problem you got wrong or lost points on</strong></em>, answer the following questions:</li>\n<li>         <strong> a)</strong><em>  Which problem did you get wrong?</em>\n</li>\n<li>\n<em>          </em><strong> b)</strong><em> Identify your mistake and give a quick, but detailed, explanation on how you made this mistake.</em>\n</li>\n<li>\n<em>           </em><strong>c)</strong><em> What will could/would you do in the future to not make this kind of mistake?</em>\n</li>\n<li>Upload <em><strong>Word Document</strong></em> in \"<em><strong>Test 1 Reflections/Corrections</strong></em>\".</li>\n<li>\n<em><strong>Submit</strong></em> the assignment when done.</li>\n</ol>\n<p> </p>\n<p><strong>Notes:</strong></p>\n<p> <em>5 point problems get plus 3 added to them, 8 total points</em></p>\n<p><em>10 point problems get plus 6 added to them, 16 total points</em></p>\n<p><em>Problems left blank on original exam will only be eligible for half(1.5 – 3 points) of the correction points.</em></p>\n<p><em>Calculating your new percent for Test 1, the new total points will be out of 192 instead of 120.</em></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:19:38','2020-10-13 09:19:47',NULL,'https://canvas-lms.ga/courses/7/assignments/167/submissions?zip=1',NULL,NULL),(45,169,76,'Test 2 Reflections/Corrections ',26,'https://canvas-lms.ga/courses/7/assignments/169',7,'<p><span style=\"color: #000080;\"><strong>Reflections/Corrections for Exams:</strong></span></p>\n<ol>\n<li>Go to your CANVAS Math 3A course and click on \"<span style=\"color: #000080;\"><em><strong>Test Solutions</strong></em></span>\" to <em><strong>download or print the exam solutions</strong></em>.</li>\n<li>On a separate <span style=\"color: #000080;\"><strong>Word document</strong></span>, for <em><strong>each problem you got wrong or lost points on</strong></em>, answer the following questions:</li>\n<li>         <