Conference ID: gxr-qrqe-hjg</span></div>\n</div>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:34','2020-10-28 14:15:34',NULL,'https://canvas-lms.ga/courses/13/assignments/512/submissions?zip=1',NULL,NULL),(70,648,76,'1.5 | Customize Your Profile ?',70,'https://canvas-lms.ga/courses/15/assignments/648',15,'<p><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/planting-page-header+(1).png\" alt=\"Planting with Canvas\" width=\"4917\" height=\"493\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/191740\" data-api-returntype=\"File\"></p>\n<h2 style=\"text-align: left;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" alt=\"\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\" data-decorative=\"true\">  TRY IT! </strong></h2>\n<hr>\n<p>This is an Assignment. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Assignments Icon displayed next to it:  <i class=\"icon-assignment\"></i> </p>\n<hr>\n<p>In this Assignment, you are asked to customize your Canvas Profile. You learned how to update your Profile and Settings in <a title=\" 1.3 | Your Profile and Settings\" href=\"https://canvas-lms.ga/courses/15/pages/1-dot-3-%7C-your-profile-and-settings\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/pages/1-dot-3-%257C-your-profile-and-settings\" data-api-returntype=\"Page\"> 1.3 | Your Profile and Settings</a> and how to customize your Notifications in <a title=\"1.4 | Canvas Communication:  Notification Settings\" href=\"https://canvas-lms.ga/courses/15/pages/1-dot-4-%7C-canvas-communication-notification-settings\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/pages/1-dot-4-%257C-canvas-communication-notification-settings\" data-api-returntype=\"Page\">1.4 | Canvas Communication: Notification Settings</a>. Take a few minutes and be sure to do the following:</p>\n<ol>\n<li>Upload a Profile Picture</li>\n<li>Consider adding an additional way to be contacted (perhaps an additional email address, or your cell phone number to receive SMS (text) messages</li>\n<li>Adjust your Notifications</li>\n</ol>\n<p>Then, you\'ll submit evidence below of what you customized. Feel free to either submit that in the text box, or use file upload to show a screenshot of what you completed. </p>\n<hr>\n<p>If you need help submitting this assignment, check out the Canvas Guide <a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-submit-a-text-entry-assignment/ta-p/303\" target=\"_blank\">How do I submit a text entry assignment</a> or the Canvas Guide <a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-upload-a-file-as-an-assignment-submission-in-Canvas/ta-p/274\">How do I upload a file as an assignment submission</a>. </p>\n<ul>\n</ul>',NULL,'2020-12-24 13:29:39','2020-12-24 13:29:40',NULL,'https://canvas-lms.ga/courses/15/assignments/648/submissions?zip=1',NULL,NULL),(71,649,76,'1.8 | Try the Calendar ?',70,'https://canvas-lms.ga/courses/15/assignments/649',15,'<h2 style=\"text-align: left;\"><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/planting-page-header+(1).png\" alt=\"Planting with Canvas\" width=\"4917\" height=\"493\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/191740\" data-api-returntype=\"File\"></h2>\n<h2>\n<span style=\"color: #ff0000;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\">  </strong></span><strong>TRY IT!</strong>\n</h2>\n<hr>\n<p><em>This is an Assignment. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Assignments Icon displayed next to it: </em>  <i class=\"icon-assignment\"></i> </p>\n<hr>\n<p>In this Assignment, you are asked to try some of the features of the Canvas Calendar. You learned about the Canvas Calendar in <a title=\"1.7 | Calendar Overview\" href=\"https://canvas-lms.ga/courses/15/pages/1-dot-7-%7C-calendar-overview\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/pages/1-dot-7-%257C-calendar-overview\" data-api-returntype=\"Page\">1.7 | Calendar Overview</a>. Things for you to do:</p>\n<ol>\n<li>Add an Event to your personal calendar layer</li>\n<li>From the Calendar, add an Assignment to your Sandbox course called Practice Assignment</li>\n</ol>\n<p>Then, you\'ll submit your evidence below. Feel free to either submit that in the text box, or use file upload to show a screenshot of what you completed.</p>\n<hr>\n<p><em>If you need help submitting this assignment, check out the Canvas Guide  <a href=\"https://community.canvaslms.com/docs/DOC-10663-421254353\">How do I upload a file as an assignment submission</a>. </em></p>\n<ul>\n</ul>',NULL,'2020-12-24 13:29:40','2020-12-24 13:29:40',NULL,'https://canvas-lms.ga/courses/15/assignments/649/submissions?zip=1',NULL,NULL),(72,650,76,'2.11 | Try Creating Modules ?',70,'https://canvas-lms.ga/courses/15/assignments/650',15,'<p><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/nurturing-page-header.png\" alt=\"Nurturing with Canvas\" width=\"1065\" height=\"106\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192157\" data-api-returntype=\"File\"></p>\n<h2 style=\"text-align: left;\">\n<strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\">  </strong><strong>TRY IT! </strong>\n</h2>\n<hr>\n<p>This is an Assignment. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Assignments Icon displayed next to it:  <i class=\"icon-assignment\"></i> </p>\n<hr>\n<ol>\n<li>Add two Modules to your course</li>\n<li>In the first Module, add:<br>\n<ul>\n<li>A Page Shell</li>\n<li>A Discussion Shell</li>\n<li>An Assignment Shell</li>\n<li>A Quiz Shell</li>\n</ul>\n</li>\n</ol>\n<p>Then, you\'ll submit your evidence below. Feel free to either submit that in the text box, or use file upload to show a screenshot of what you completed.</p>\n<hr>\n<p>If you need help submitting this assignment, check out the Canvas Guide <a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-upload-a-file-as-an-assignment-submission-in-Canvas/ta-p/274\">How do I upload a file as an assignment submission</a>. </p>\n<ul>\n</ul>',NULL,'2020-12-24 13:29:40','2020-12-24 13:29:40',NULL,'https://canvas-lms.ga/courses/15/assignments/650/submissions?zip=1',NULL,NULL),(73,651,76,'3.6 | Assignment Creation ?',70,'https://canvas-lms.ga/courses/15/assignments/651',15,'<p style=\"text-align: left;\"><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/sprouting-page-header.png\" alt=\"\" width=\"4917\" height=\"493\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192158\" data-api-returntype=\"File\" data-decorative=\"true\"></p>\n<h2 style=\"text-align: left;\">\n<span style=\"color: #ff0000;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\">  </strong></span><strong>TRY IT!</strong>\n</h2>\n<hr>\n<p>This is an Assignment. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Assignments Icon displayed next to it:  <i class=\"icon-assignment\"></i> </p>\n<hr>\n<p>Now that we\'ve learned about Assignments, let\'s practice creating one.</p>\n<ol>\n<li>\n<p>In your course, use the Assignment placeholder you created in <a title=\"2.11 | Try Creating Modules ?\" href=\"https://canvas-lms.ga/courses/15/assignments/650\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/assignments/650\" data-api-returntype=\"Assignment\">2.11 | Try Creating Modules ?</a> and build out an Assignment that you would give to your students in one of your classes.</p>\n</li>\n<li>\n<p>Focus on including the following features as you create your Assignment:</p>\n<ul>\n<li>\n<p><span style=\"font-size: 12pt;\">Title</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Due Date</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Submission Type</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Rubric</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Multi-Media Element (Arc Video, Slide Show, Picture, Graph, or document)</span></p>\n</li>\n</ul>\n</li>\n<li>\n<p>Adjust the Assignment Settings and click Save.</p>\n</li>\n</ol>\n<p>Then, you\'ll submit evidence below of what you created. Feel free to either submit that in the text box, or use file upload to show a screenshot of what you completed. </p>\n<hr>\n<p>If you need help submitting this assignment, check out the Canvas Guide <a class=\"external\" href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-submit-a-text-entry-assignment/ta-p/303\" target=\"_blank\">How do I submit a text entry assignment<span class=\"screenreader-only\"> (Links to an external site.)</span><span class=\"ui-icon ui-icon-extlink ui-icon-inline\" title=\"Links to an external site.\"><span class=\"screenreader-only\">Links to an external site.</span></span></a> or the Canvas Guide <a class=\"external\" href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-upload-a-file-as-an-assignment-submission-in-Canvas/ta-p/274\" target=\"_blank\">How do I upload a file as an assignment submission<span class=\"screenreader-only\"> (Links to an external site.)</span><span class=\"ui-icon ui-icon-extlink ui-icon-inline\" title=\"Links to an external site.\"><span class=\"screenreader-only\">Links to an external site.</span></span></a>. </p>\n<ul>\n</ul>',NULL,'2020-12-24 13:29:40','2020-12-24 13:29:40',NULL,'https://canvas-lms.ga/courses/15/assignments/651/submissions?zip=1',NULL,NULL),(74,652,76,'3.9 | Create a Quiz ?',70,'https://canvas-lms.ga/courses/15/assignments/652',15,'<p style=\"text-align: left;\"><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/sprouting-page-header.png\" alt=\"Sprouting with Canvas\" width=\"1065\" height=\"106\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192158\" data-api-returntype=\"File\"></p>\n<h2>\n<span style=\"color: #ff0000;\"><strong><img src=\"https://canvas-lms.ga/courses/15/files/608/download?verifier=J10JvS0XBKlQhYn1xSKbZCIS5AoNQbe0BrSqRTT8\" width=\"51\" height=\"50\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/files/608\" data-api-returntype=\"File\">  </strong></span><strong>TRY IT!</strong>\n</h2>\n<hr>\n<p>This is an Assignment. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Assignments Icon displayed next to it:  <i class=\"icon-assignment\"></i> </p>\n<hr>\n<p><span style=\"font-size: 12pt;\">Now that we\'ve learned about Quizzes, let\'s practice creating one.</span></p>\n<ol>\n<li>In your course, use the Quiz placeholder you created in <a title=\"2.11 | Try Creating Modules ?\" href=\"https://canvas-lms.ga/courses/15/assignments/650\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/assignments/650\" data-api-returntype=\"Assignment\">2.11 | Try Creating Modules ?</a>and build out an Quiz that you would give to your students in one of your classes.</li>\n<li>Focus on including the following features as you create your Quiz:\n<ul>\n<li><span style=\"font-size: 12pt;\">Settings</span></li>\n<li>Student Instructions</li>\n<li>5 different types of questions</li>\n<li>Just in time feedback </li>\n</ul>\n</li>\n<li>Adjust the Quiz Settings and click Save</li>\n</ol>\n<p>Then, you\'ll submit evidence below of what you created. For this Assignment, you\'ll submit the URL to your completed Quiz, a detailed description in the text box, or a screenshot.</p>\n<hr>\n<p>If you need help submitting this assignment, check out the Canvas Guide <a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-enter-a-URL-as-an-assignment-submission/ta-p/286\"><span style=\"font-size: 12pt;\">How do I enter a URL as an assignment submission?</span></a></p>\n<ul>\n</ul>',NULL,'2020-12-24 13:29:40','2020-12-24 13:29:40',NULL,'https://canvas-lms.ga/courses/15/assignments/652/submissions?zip=1',NULL,NULL),(75,653,76,'4.5 | Using SpeedGrader ?',70,'https://canvas-lms.ga/courses/15/assignments/653',15,'<p><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/flowering-page-header.png\" alt=\"Flowering with Canvas\" width=\"4917\" height=\"493\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192155\" data-api-returntype=\"File\"></p>\n<h2 style=\"text-align: left;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" alt=\"\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\" data-decorative=\"true\">  TRY IT! </strong></h2>\n<hr>\n<p>This is an Assignment. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Assignments Icon displayed next to it:  <i class=\"icon-assignment\"></i> </p>\n<hr>\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\">This activity asks you to submit a sample assignment and then provide feedback and a grade.  Follow these steps to complete this assignment: </span></p>\n<ol>\n<li>Either use the Assignment we created in <a title=\"3.6 | Assignment Creation ?\" href=\"https://canvas-lms.ga/courses/15/assignments/651\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/assignments/651\" data-api-returntype=\"Assignment\">3.6 | Assignment Creation ?</a> or create a new assignment. Make sure Online Submission is selected from<strong> Submission Type</strong> and select <strong>File Upload</strong> from the online submission options.</li>\n<li>Publish your assignment in your course, and make sure the Module it\'s in is also published.</li>\n<li>Enter student view (either from Settings or from the Home Page of your course) and go to the assignment.</li>\n<li>Click <strong>Submit Assignment </strong>and upload a file for your submission.</li>\n<li>Leave Student View (bottom right of the screen).  </li>\n<li>Return to the assignment and click on SpeedGrader<sup>TM </sup>to enter and see the submitted work.</li>\n<li>Give a grade, provide feedback in the comments tab, and use the annotation tools to \"mark-up\" the document.</li>\n<li>Take a screenshot of the assignment once it has been:  a) Marked Up, b) Grade Given, c) Comment Made.</li>\n</ol>\n<p>Then, you\'ll submit your evidence below. Feel free to either submit that in the text box, or use file upload to show a screenshot of what you completed.</p>\n<hr>\n<p>If you need help submitting this assignment, check out the Canvas Guide  <a class=\"external\" href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-upload-a-file-as-an-assignment-submission-in-Canvas/ta-p/274\" target=\"_blank\">How do I upload a file as an assignment submission<span class=\"screenreader-only\"> (Links to an external site.)</span><span class=\"ui-icon ui-icon-extlink ui-icon-inline\" title=\"Links to an external site.\"><span class=\"screenreader-only\">Links to an external site.</span></span></a>. </p>\n<ul>\n</ul>',NULL,'2020-12-24 13:29:41','2020-12-24 13:29:41',NULL,'https://canvas-lms.ga/courses/15/assignments/653/submissions?zip=1',NULL,NULL),(76,645,76,'2.9 | Home Page Submission ?',71,'https://canvas-lms.ga/courses/15/assignments/645',15,'<p><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/nurturing-page-header.png\" alt=\"\" width=\"4917\" height=\"493\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192157\" data-api-returntype=\"File\" data-decorative=\"true\"></p>\n<h2 style=\"text-align: left;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" alt=\"\" width=\"51\" height=\"50\" data-decorative=\"true\">  TRY IT!</strong></h2>\n<hr>\n<p>This is a Discussion. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Discussion Icon displayed next to it:  <i class=\"icon-discussion\"></i> </p>\n<hr>\n<p>In this Discussion, you are asked to customize your Home Page. You can design it from the ground up or you can modify an existing template. You learned how to select and build a Home Page in <a title=\"2.7 | Home Page\" href=\"https://canvas-lms.ga/courses/15/pages/2-dot-7-%7C-home-page\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/pages/2-dot-7-%257C-home-page\" data-api-returntype=\"Page\">2.7 | Home Page.</a>  You might also want to check out some Community resources around Home Pages to get ideas for building yours, such as the Education Services <a href=\"https://community.canvaslms.com/t5/Instructional-Designer/Teacher-Appreciation-2018-Home-Page-Templates/ba-p/275466\"><span style=\"font-size: 12pt;\">Teacher Appreciation 2018 | Home Page Templates.</span></a></p>\n<p>Take a few minutes and be sure to do the following:<span> </span></p>\n<ol>\n<li><span>Set your homepage either as a Pages Front Page, or Syllabus.  </span></li>\n<li>\n<span>Make sure your home page has the following content:</span>\n<ul>\n<li><span>Course Name </span></li>\n<li><span>Instructor Name</span></li>\n<li><span>Contact Information</span></li>\n<li><span>Optional: Link to course syllabus</span></li>\n</ul>\n</li>\n<li>Then, you\'ll submit evidence below of what you customized. Feel free to either submit that in the text box, or take a screenshot of your new Home Page and share it with the others in this course!</li>\n<li>Finally, because this is a Discussion, you will be able to see your fellow participants\' Home Pages. Provide feedback to at least one other post in this Discussion thread.</li>\n</ol>\n<hr>\n<p>If you need help submitting this discussion, check out the Canvas Guide <span style=\"font-size: 12pt;\"><a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-reply-to-a-discussion-as-a-student/ta-p/334\">How do I reply to a discussion as a student</a> </span>or the Canvas Guide <span style=\"font-size: 12pt;\"><a href=\"https://community.canvaslms.com/t5/Student-Guide/How-do-I-embed-an-image-in-a-discussion-reply-as-a-student/ta-p/313\">How do I embed an image in a discussion reply as a student</a>.</span></p>',NULL,'2020-12-24 13:29:29','2020-12-24 13:29:30',NULL,'https://canvas-lms.ga/courses/15/assignments/645/submissions?zip=1',NULL,NULL),(77,646,76,'3.4 | Discussions: Chat About It! ?',71,'https://canvas-lms.ga/courses/15/assignments/646',15,'<h2 style=\"text-align: left;\"><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/sprouting-page-header.png\" alt=\"Sprouting with Canvas\" width=\"1065\" height=\"106\" data-api-returntype=\"File\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192158\"></h2>\n<h2 style=\"text-align: left;\">\n<span style=\"color: #ff0000;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\">  </strong></span><strong>TRY IT!</strong>\n</h2>\n<hr>\n<p>This is a Discussion. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Discussion Icon displayed next to it:  <i class=\"icon-discussion\"></i> </p>\n<hr>\n<p><span style=\"font-size: 12pt;\">Now that we\'ve learned about Discussions, let\'s practice creating a couple of discussion posts. </span></p>\n<ol>\n<li>\n<p><span style=\"font-size: 12pt;\">In your course, use the Discussions placeholder you created in <a title=\"2.11 | Try Creating Modules ?\" href=\"https://canvas-lms.ga/courses/15/assignments/650\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/15/assignments/650\" data-api-returntype=\"Assignment\">2.11 | Try Creating Modules ?</a>and build out a Discussion that you would assign in one of your classes. Adjust the Discussion Settings and click Save.</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Then, reply to this prompt and answer the following:</span></p>\n<ul>\n<li>\n<p><span style=\"font-size: 12pt;\">How can Discussions enhance student learning?</span></p>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">What was the Discussion topic you created in your course? How do you expect your students to respond (text, audio, video, etc.)?</span></p>\n</li>\n</ul>\n</li>\n<li>\n<p><span style=\"font-size: 12pt;\">Finally, because this is a Discussion, you will be able to see your fellow participants\' responses. Provide feedback to at least one other post in this Discussion thread.</span></p>\n</li>\n</ol>',NULL,'2020-12-24 13:29:30','2020-12-24 13:29:31',NULL,'https://canvas-lms.ga/courses/15/assignments/646/submissions?zip=1',NULL,NULL),(78,647,76,'5.4 | How Might You Use Groups and Collaborations? ?',71,'https://canvas-lms.ga/courses/15/assignments/647',15,'<p style=\"text-align: left;\"><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/harvesting-page-header.png\" alt=\"Harvesting with Canvas\" width=\"1065\" height=\"106\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192156\" data-api-returntype=\"File\"></p>\n<h2 style=\"text-align: left;\">\n<span style=\"color: #ff0000;\"><strong><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" alt=\"\" width=\"51\" height=\"50\" data-api-endpoint=\"https://trainingk12.instructure.com/api/v1/courses/1490/files/192086\" data-api-returntype=\"File\" data-decorative=\"true\">  </strong></span><strong>TRY IT!</strong>\n</h2>\n<hr>\n<p>This is a Discussion. You can tell when you look at it from the Calendar or from the Modules page because it has the Canvas Discussion Icon displayed next to it:  <i class=\"icon-discussion\"></i> </p>\n<hr>\n<ol>\n<li>Reply to this prompt and answer the following:\n<ul>\n<li>Identify at least two ways that you might use Groups and/or Collaborations in Canvas to promote collaboration</li>\n<li>What tool do you see yourself using the most often? Why?</li>\n</ul>\n</li>\n<li>Because this is a Discussion, you will be able to see your fellow participants\' responses. Provide feedback to at least one other post in this Discussion thread.</li>\n</ol>',NULL,'2020-12-24 13:29:31','2020-12-24 13:29:32',NULL,'https://canvas-lms.ga/courses/15/assignments/647/submissions?zip=1',NULL,NULL),(79,644,76,'6.2 | Reviewing Key Concepts ?',72,'https://canvas-lms.ga/courses/15/assignments/644',15,'<p><img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/course_headers/growing-page-header.png\" alt=\"Growing with Canvas\" width=\"1033\" height=\"104\"></p>\n<h2>\n<img src=\"https://s3.amazonaws.com/SSL_Assets/learning_services/Growing+with+Canvas/Growing%20with%20Canvas/try-it.png\" alt=\"\" width=\"51\" height=\"50\" data-decorative=\"true\">  <strong>TRY IT! </strong>\n</h2>\n<p>Thank you for working through the <strong>Growing With Canvas</strong> course.  This is the final activity for this course.  This quiz reviews some of the key concepts that were presented throughout this course.</p>',NULL,'2020-12-24 13:29:28','2020-12-24 13:29:29',NULL,'https://canvas-lms.ga/courses/15/quizzes/59/submissions?zip=1',NULL,NULL),(80,501,76,'Career Search',45,'https://canvas-lms.ga/courses/12/assignments/501',12,'<p>Answer the following questions in the text box provided or upload a document.</p>\n<p>1. What are you interested in?</p>\n<p>2. What are your strengths?</p>\n<p>3. List at least 5 different careers related to woodworking.  (A career is long term so search for options that intrest you and take advantage of your strengths)</p>\n<p>4. Choose two careers from the list you generated and answer the following questions for each:</p>\n<p>                 a. Self employed or employed?</p>\n<p>                 b. Potential salary/wage:</p>\n<p>                 c. How can you advance your position with a company (employed) or scale your business (self-employed)?  In other words: How can your progress in this career?</p>\n<p>                 d. What are 4 essential skills needed for this career?</p>\n<p>                 e. Who could you contact to learn more about this career?</p>\n<p>                  f. How can you gain the skills and/or credentials to begin this career?</p>\n<ul>\n</ul>',NULL,'2020-10-28 13:17:50','2020-10-28 13:17:51',NULL,'https://canvas-lms.ga/courses/12/assignments/501/submissions?zip=1',NULL,NULL),(81,476,76,'Gene mapping video and GN',37,'https://canvas-lms.ga/courses/10/assignments/476',10,'<p>Please watch the video and complete the worksheet. </p>\n<p>video: <a href=\"http://www.bozemanscience.com/genetic-recombination-gene-mapping/?rq=chromosome\">http://www.bozemanscience.com/genetic-recombination-gene-mapping/?rq=chromosome</a></p>\n<p>worksheet: <a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Crossing over and gene mapping.pdf\" href=\"https://canvas-lms.ga/courses/10/files/448/download?verifier=4Zhp3YNQOp0mmxvMhLrLRpoGs3lK6892o8NZZLnN&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/448\" data-api-returntype=\"File\">Crossing over and gene mapping.pdf</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:20','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/476/submissions?zip=1',0,NULL),(82,484,76,'Masteringbio chromosomal disorders and mapping',37,'https://canvas-lms.ga/courses/10/assignments/484',10,'<p>Please complete the masteringbiology assignment \"chromosomal disorders and mapping genes.\" It is worth 23 points, should take NO MORE than 30 minutes, and you have 4 tries for each question before you lose credit. </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/484/submissions?zip=1',0,NULL),(83,486,76,'Masteringbiology Variation',37,'https://canvas-lms.ga/courses/10/assignments/486',10,'<p>Please complete the mastering biology assignment \"genetic variation and meiosis\"</p>\n<p>It is worth 26 points, you have four tries for each question. Please try twice without looking at notes, try to puzzle your way through. Then, use the final two attempts with your notes if you need to. Any score below an 85 requires the adaptive followup. It is due at 8:00am on 1.13 for both classes. Anything later than that will receive a 50% reduction in points. </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/486/submissions?zip=1',0,NULL),(84,489,76,'Non-Mendelian genetics vid and gn',37,'https://canvas-lms.ga/courses/10/assignments/489',10,'<p>Watch the following video and complete the worksheet below. Upload a completed worksheet by the due date for full credit.</p>\n<p><a class=\"\" href=\"https://www.youtube.com/watch?v=YoEgUqHOcbc\">https://www.youtube.com/watch?v=YoEgUqHOcbc</a></p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"non-mendelian genetics vid gn.pdf\" href=\"https://canvas-lms.ga/courses/10/files/468/download?verifier=zbdbf8cSk2T96EYkfmEfd2SxQTavf8PcNzAUrrwC&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/468\" data-api-returntype=\"File\">non-mendelian genetics vid gn.pdf</a></p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:22','2020-10-13 12:32:28',NULL,'https://canvas-lms.ga/courses/10/assignments/489/submissions?zip=1',0,NULL),(85,487,76,'Mendelian Genetics Vid and GN',37,'https://canvas-lms.ga/courses/10/assignments/487',10,'<p>Watch the following video:</p>\n<p><a href=\"http://www.bozemanscience.com/029-mendelian-genetics\">http://www.bozemanscience.com/029-mendelian-genetics</a></p>\n<p>and complete the worksheet below:</p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Mendelian Genetics vid and GN.pdf\" href=\"https://canvas-lms.ga/courses/10/files/484/download?verifier=VQ2w2Fy4yGXorAFXZ8tDGZJgoCMyJWbAhcTUUpv9&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/484\" data-api-returntype=\"File\">Mendelian Genetics vid and GN.pdf</a></p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"Mendelian Genetics vid and GN.pdf\" href=\"https://canvas-lms.ga/courses/10/files/484/download?verifier=VQ2w2Fy4yGXorAFXZ8tDGZJgoCMyJWbAhcTUUpv9&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/484\" data-api-returntype=\"File\"></a>Due 1/13 for Red day class</p>\n<p>Due 1/17 for White day class </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:22','2020-10-13 12:32:22',NULL,'https://canvas-lms.ga/courses/10/assignments/487/submissions?zip=1',0,NULL),(86,477,76,'Gene switches video ',37,'https://canvas-lms.ga/courses/10/assignments/477',10,'<p>Watch the following video, there are questions embedded in the video that you will answer for credit. This is graded on correctness of your answers. </p>\n<p>In addition, please take notes on the video. I will check your notes in class. </p>\n<p><a id=\"\" class=\"\" title=\"\" href=\"https://www.playposit.com/play/552146/new-bulb-20170215-171543\" target=\"\">https://www.playposit.com/play/552146/new-bulb-20170215-171543</a></p>\n<p>5 points for notes, 10 points for the video questions. </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:21',NULL,'https://canvas-lms.ga/courses/10/assignments/477/submissions?zip=1',0,NULL),(87,485,76,'Masteringbiology Chromosomal inheritance',37,'https://canvas-lms.ga/courses/10/assignments/485',10,'<p>Please complete the \"Chromosomal Inheritance\" mastering biology. You will have four tries for each question. It is worth 30 points. It must be completed by 8:00am on 1/18 (WED) for red day class, and 1/19 for White day class for full credit. After that time, 50% point reduction will occur. </p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:21',NULL,'https://canvas-lms.ga/courses/10/assignments/485/submissions?zip=1',0,NULL),(88,465,76,'Chapter 21',37,'https://canvas-lms.ga/courses/10/assignments/465',10,'<p>Please choose 2 of the following:</p>\n<p>1. playposit video:<a id=\"\" class=\"\" title=\"\" href=\"https://www.playposit.com/play/564008/solving-hardy-wienberg-problems-chpt-21\" target=\"\">https://www.playposit.com/play/564008/solving-hardy-wienberg-problems-chpt-21</a></p>\n<p>2. notes from bozeman video: <a class=\"\" href=\"https://www.youtube.com/watch?v=xPkOAnK20kw\">https://www.youtube.com/watch?v=xPkOAnK20kw</a></p>\n<p>3. notes from chapter 21</p>\n<p>4. End of chapter questions from 21</p>\n<p>5. Masteringbiology chapter 21 </p>\n<p>Each one is worth 10 points for a total of 20.</p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:19','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/465/submissions?zip=1',0,NULL),(89,464,76,'Chapter 19 Descent with Modification (Natural Selection)',37,'https://canvas-lms.ga/courses/10/assignments/464',10,'<p>Chapter 19: Choose <span style=\"text-decoration: underline; background-color: #ffff00;\"><strong>two</strong></span> of the following for 20 points credit (10 points each)</p>\n<p>1. Watch the following \"Playposit\" video and answer the embedded questions: </p>\n<p><a id=\"\" class=\"\" title=\"\" href=\"https://www.playposit.com/play/549182/examples-of-natural-selection-bozemanscience\" target=\"\">https://www.playposit.com/play/549182/examples-of-natural-selection-bozemanscience</a></p>\n<p>2. Read the chapter in your text and upload your notes here.</p>\n<p>3. Answer the questions at the end of Chapter 19 and upload here.</p>\n<p>4. Watch the following video and take notes (upload here)</p>\n<p><a class=\"\" href=\"https://www.youtube.com/watch?v=S7EhExhXOPQ\">https://www.youtube.com/watch?v=S7EhExhXOPQ</a></p>\n<p>5. Masteringbiology \"Natural Selection\"</p>\n<p>All except Playposit and mastering biology can be uploaded here. </p>\n<p>Anything that you did not complete can be used to study for the exam! </p>\n<p>Email me with any questions! </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:18','2020-10-13 12:32:26',NULL,'https://canvas-lms.ga/courses/10/assignments/464/submissions?zip=1',0,NULL),(90,466,76,'Chapter 40',37,'https://canvas-lms.ga/courses/10/assignments/466',10,'<p>Please choose two of the following assignments. Each is worth 10 points for a total of 20. </p>\n<p>1. playposit video: <a href=\"https://www.playposit.com/play/567587/new-bulb-20170309-192302-22\"><span>https://www.playposit.com/play/567587/new-bulb-20170309-192302-22</span></a></p>\n<p>2. Notes on a bozeman video: (upload notes)</p>\n<p><a class=\"\" href=\"https://www.youtube.com/watch?v=PQ-CQ3CQE3g\">https://www.youtube.com/watch?v=PQ-CQ3CQE3g</a></p>\n<p>3. Notes from chapter 40 (upload notes)</p>\n<p>4. Questions from the end of chapter 40 (upload answers)</p>\n<p>5. Masteringbiology: Chapter 40</p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:19','2020-10-13 12:32:19',NULL,'https://canvas-lms.ga/courses/10/assignments/466/submissions?zip=1',0,NULL),(91,488,76,'New Homework Policy spring 2017',37,'https://canvas-lms.ga/courses/10/assignments/488',10,'<p>Please read, sign, and add any comments! </p>\n<p>Thanks. </p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"New Homework policy.pdf\" href=\"https://canvas-lms.ga/courses/10/files/474/download?verifier=Rs9652GWQLiimJ7hnXi2kJrZUxfjQLzrMYBcD8Ry&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/474\" data-api-returntype=\"File\">New Homework policy.pdf</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:22','2020-10-13 12:32:22',NULL,'https://canvas-lms.ga/courses/10/assignments/488/submissions?zip=1',0,NULL),(92,469,76,'Ecology Video and Lab 2 video',37,'https://canvas-lms.ga/courses/10/assignments/469',10,'<p>Please watch the following video and complete the worksheet below:</p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"ecology video workshett.pdf\" href=\"https://canvas-lms.ga/courses/10/files/486/download?verifier=eAJOwKk3kWx2qwX8YPhe5LmbukkhuhFjQp4LJiiG&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/486\" data-api-returntype=\"File\">ecology video worksheet.pdf</a>  (upload this worksheet once you are done!)</p>\n<p><a class=\"\" href=\"https://www.youtube.com/watch?v=Ot_KmOTYfRA\">https://www.youtube.com/watch?v=Ot_KmOTYfRA</a></p>\n<p>After completing this worksheet please watch the following video from <span style=\"background-color: #ffcc00;\"><em><strong>TIMES 4:50-8:00</strong></em></span> </p>\n<p>This video covers some of the labs that we did not have time to complete. Take notes, but you do not need to turn them in. </p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:20','2020-10-13 12:32:20',NULL,'https://canvas-lms.ga/courses/10/assignments/469/submissions?zip=1',0,NULL),(93,492,76,'Practice Exam 1 in Cliff notes',37,'https://canvas-lms.ga/courses/10/assignments/492',10,'<p>Complete practice exam 1 in the back of your Review book. </p>\n<p>This is due at the beginning of the 3rd rotation. </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:22','2020-10-13 12:32:28',NULL,'https://canvas-lms.ga/courses/10/assignments/492/submissions?zip=1',0,NULL),(94,463,76,'CELLS and molecular Movement: Self guided',37,'https://canvas-lms.ga/courses/10/assignments/463',10,'<p>Read chapter 3 in the Cliff notes review book regarding cells and molecular movement. Also read pages 278-281 (cell lab) Complete the questions at the end of the chapter, as well as questions 1-3 on page 300. Upload a picture of your questions completed in the book.</p>\n<p>1. Read chapter 3</p>\n<p>2. Read pages 278-281</p>\n<p>3. Complete chapter 3 questions and 1-3 on page 300</p>\n<p>4. upload answers to canvas</p>\n<p>Once complete, you may move on to take the quiz on Canvas. You must score an 85% to move onto the energy section.  <a id=\"\" class=\"\" title=\"Cells\" href=\"https://canvas-lms.ga/courses/10/quizzes/48\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/quizzes/48\" data-api-returntype=\"Quiz\">Cells</a> (quiz)</p>\n<p>I would also suggest you work on the worksheets found in the following review content page: <a id=\"\" class=\"\" title=\"Cells\" href=\"https://canvas-lms.ga/courses/10/pages/cells\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/pages/cells\" data-api-returntype=\"Page\">Cells</a> (page)</p>\n<p>the answer keys are posted so you can check your answers.</p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:18','2020-10-13 12:32:18',NULL,'https://canvas-lms.ga/courses/10/assignments/463/submissions?zip=1',0,NULL),(95,470,76,'Energy and Enzymes: Self Guided',37,'https://canvas-lms.ga/courses/10/assignments/470',10,'<p>Read the following chapters and complete the questions at the end of the chapter:</p>\n<p>Chapter 4 Cellular Respiration</p>\n<p>Chapter 5 Photosynthesis</p>\n<p>Chapter 2 pages 22-24 (complete questions 1-3 and 5)</p>\n<p>then read pages 282-284, 298-299 and answer questions pg 301 #4,-6, pg. 302 8 and 9</p>\n<p>Once completed and uploaded to canvas, you can take the energy quiz. you must score an 85% in order to move on.</p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:20','2020-10-13 12:32:20',NULL,'https://canvas-lms.ga/courses/10/assignments/470/submissions?zip=1',0,NULL),(96,480,76,'HW Free Response',37,'https://canvas-lms.ga/courses/10/assignments/480',10,'<p><img src=\"https://canvas-lms.ga/courses/10/files/494/preview?verifier=T5PHiMYBnkrNx9VL1DSHiXRIVxsrnQOIaUjVcQTz\" alt=\"Screenshot 2017-03-20 11.05.27.png\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/10/files/494\" data-api-returntype=\"File\"></p>\n<p>Answer on a separate sheet of paper and upload a doc scan (pdf only) of your answer. </p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:21','2020-10-13 12:32:21',NULL,'https://canvas-lms.ga/courses/10/assignments/480/submissions?zip=1',0,NULL),(97,474,76,'Extra Credit Masteringbiology',37,'https://canvas-lms.ga/courses/10/assignments/474',10,'<ul>\n</ul>',NULL,'2020-10-13 12:32:20','2020-10-13 12:32:20',NULL,'https://canvas-lms.ga/courses/10/assignments/474/submissions?zip=1',0,NULL),(98,459,76,'Genetic variation',39,'https://canvas-lms.ga/courses/10/assignments/459',10,'<p>You will have two tries on each question. This is timed, 10 minutes to complete. the highest grade will be posted to the grade book. </p>',NULL,'2020-10-13 12:32:14','2020-10-13 12:32:15',NULL,'https://canvas-lms.ga/courses/10/quizzes/45/submissions?zip=1',45,NULL),(99,462,76,'Mendelian Genetics',39,'https://canvas-lms.ga/courses/10/assignments/462',10,'<p>Two tries, 10 minutes. Highest grade is recorded. Good luck.</p>',NULL,'2020-10-13 12:32:17','2020-10-13 12:32:17',NULL,'https://canvas-lms.ga/courses/10/quizzes/49/submissions?zip=1',49,NULL),(100,461,76,'Cells',39,'https://canvas-lms.ga/courses/10/assignments/461',10,'<p>You will have multiple tries on this quiz. You must score above an 85% to move on. You can only complete this quiz once your cell chapter is complete in the review book.</p>',NULL,'2020-10-13 12:32:16','2020-10-13 12:32:16',NULL,'https://canvas-lms.ga/courses/10/quizzes/48/submissions?zip=1',48,NULL),(101,460,76,'Energy Self Guided',39,'https://canvas-lms.ga/courses/10/assignments/460',10,'<p>You have multiple tries to achieve an 85% to move on. Remember the highest grade is recorded. </p>',NULL,'2020-10-13 12:32:15','2020-10-13 12:32:15',NULL,'https://canvas-lms.ga/courses/10/quizzes/46/submissions?zip=1',46,NULL),(102,471,76,'Exam 1 Spring 2017',40,'https://canvas-lms.ga/courses/10/assignments/471',10,'<ul>\n</ul>',NULL,'2020-10-13 12:32:20','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/471/submissions?zip=1',0,NULL),(103,473,76,'Exam Chapters 18-20',40,'https://canvas-lms.ga/courses/10/assignments/473',10,'<p>In class exam covers chapters 19-21</p>\n<ul>\n</ul>',NULL,'2020-10-13 12:32:20','2020-10-13 12:32:27',NULL,'https://canvas-lms.ga/courses/10/assignments/473/submissions?zip=1',0,NULL),(104,472,76,'Exam 3 Spring 2017 Ch\'s 21, 40 and 41',40,'https://canvas-lms.ga/courses/10/assignments/472',10,'<ul>\n</ul>',NULL,'2020-10-13 12:32:20','2020-10-13 12:32:20',NULL,'https://canvas-lms.ga/courses/10/assignments/472/submissions?zip=1',0,NULL),(105,494,76,'Summary of Research project',41,'https://canvas-lms.ga/courses/10/assignments/494',10,'<p>This is due for every student by 8:00am</p>\n<p><a id=\"\" class=\"instructure_file_link instructure_scribd_file \" title=\"summary of research.pdf\" href=\