','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/325/submissions?zip=1',NULL,NULL),(110,326,76,'September 26',25,'https://canvas-lms.ga/courses/8/assignments/326',8,'<p><span>What is the law of definite proportions? How does this law relate to the lab that we did Friday?</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/326/submissions?zip=1',NULL,NULL),(111,327,76,'September 27',25,'https://canvas-lms.ga/courses/8/assignments/327',8,'<p><span>tell me about the relationship between protons and atomic number. tell me in person to get the next assignment.</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:28',NULL,'https://canvas-lms.ga/courses/8/assignments/327/submissions?zip=1',NULL,NULL),(112,328,76,'September 28',25,'https://canvas-lms.ga/courses/8/assignments/328',8,'<p>Today is test day. Try to draw a dinosaur in your science notebook. <img src=\"https://s-media-cache-ak0.pinimg.com/564x/5c/12/72/5c1272d606a12ff0bd37906ed527ce95.jpg\" alt=\"\" width=\"300\" height=\"300\"></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:28',NULL,'https://canvas-lms.ga/courses/8/assignments/328/submissions?zip=1',NULL,NULL),(113,329,76,'September 29',25,'https://canvas-lms.ga/courses/8/assignments/329',8,'<p>There are 3 isotopes of Hydrogen, Hydrogen-1, Hydrogen-2, and Hydrogen-3. Discuss the differences between them including their protons, electrons, and neutrons.</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:28',NULL,'https://canvas-lms.ga/courses/8/assignments/329/submissions?zip=1',NULL,NULL),(114,330,76,'September 30',25,'https://canvas-lms.ga/courses/8/assignments/330',8,'<p>Yay, today is Friday and Homecoming! So, I found some videos that should help introduce our new topic so we can discuss it. Watch these 2 videos and take notes. (I will be checking that you took notes).</p>\n<p><a id=\"\" class=\"\" title=\"\" href=\"https://youtu.be/accyCUzasa0\" target=\"\">Link</a></p>\n<p> </p>\n<p><a id=\"\" class=\"\" title=\"\" href=\"https://youtu.be/2AFPfg0Como\" target=\"\">Link</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:28',NULL,'https://canvas-lms.ga/courses/8/assignments/330/submissions?zip=1',NULL,NULL),(115,300,76,'Monday October 3',25,'https://canvas-lms.ga/courses/8/assignments/300',8,'<p><span>This is the last week of the 9 weeks! So, tell me something you know, want to know or don\'t understand about electron orbitals.</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:25','2020-10-13 09:20:52',NULL,'https://canvas-lms.ga/courses/8/assignments/300/submissions?zip=1',NULL,NULL),(116,392,76,'Tuesday October 4',25,'https://canvas-lms.ga/courses/8/assignments/392',8,'<p><span>Hey guys, I will be out today, so I need you to be awesome and diligent for the sub.  You need to work on your chapter 4 review that I handed out yesterday. If you lost the handout it is online in chapter 4 module in canvas. Use the chapter 4 notes to help you. If you have questions I should be available by email. If you get done with time to spare, go ahead and read the fireworks article. We will be discussing it tomorrow. Thanks guys.  </span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:35','2020-10-13 09:20:35',NULL,'https://canvas-lms.ga/courses/8/assignments/392/submissions?zip=1',NULL,NULL),(117,369,76,'Thursday October 6',25,'https://canvas-lms.ga/courses/8/assignments/369',8,'<p><span>Explain the relationship between electrons and light. Use google or the textbook if you need to, but do not copy and paste an answer. </span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:32','2020-10-13 09:20:33',NULL,'https://canvas-lms.ga/courses/8/assignments/369/submissions?zip=1',NULL,NULL),(118,367,76,'Thursday October 13th',25,'https://canvas-lms.ga/courses/8/assignments/367',8,'<p><span>I hope you all had a great break! Today each of you will make a comprehensive study guide on Chapter 4. You will use your review worksheet, your Energy and Light POGIL, and any other information from chapter 4 to make it, and then we are going to use your study guides for an activity, so make a good one!</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:32','2020-10-13 09:20:32',NULL,'https://canvas-lms.ga/courses/8/assignments/367/submissions?zip=1',NULL,NULL),(119,249,76,'Friday October 14th',25,'https://canvas-lms.ga/courses/8/assignments/249',8,'<p>How does light reveal the behavior of electrons in an atom? (This is what the Electron Energy and Light POGIL was about. Think about the light tubes and colors of flame we saw in the lab. )</p>\n<p> </p>\n<p>Anyone not here: We are continuing to create and study our chapter 4 study guides in preparation of the Chapter 4 test next week. It will be for a grade. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:19','2020-10-13 09:20:19',NULL,'https://canvas-lms.ga/courses/8/assignments/249/submissions?zip=1',NULL,NULL),(120,390,76,'Tuesday October 18',25,'https://canvas-lms.ga/courses/8/assignments/390',8,'<p>I hope you all had a great long weekend! Write the full electron configuration and orbital diagram for cobalt in your science notebooks. ( also the story teller festival threw off my plans, so your test is tomorrow) Also Mole day is Friday, if you would like extra credit there is the make a mole project in module 5. We will also be signing up to bring food for a potluck. It will be a fun day!</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:35','2020-10-13 09:20:35',NULL,'https://canvas-lms.ga/courses/8/assignments/390/submissions?zip=1',NULL,NULL),(121,416,76,'Wednesday October 19',25,'https://canvas-lms.ga/courses/8/assignments/416',8,'<p><span>Today is test day! I highly suggest that you look over the review worksheet from earlier in the chapter. ( hint: several things are taken directly from this sheet). After you have read this draw an atom (any atom you want) in your science notebook under today\'s date and label it \"chapter 4 test- I\'ll show you how orbitals work\".</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:38','2020-10-13 09:20:38',NULL,'https://canvas-lms.ga/courses/8/assignments/416/submissions?zip=1',NULL,NULL),(122,250,76,'Friday October 21',25,'https://canvas-lms.ga/courses/8/assignments/250',8,'<p>Today we are celebrating mole day! Tell me what a mole is. Write the answer in your science notebook. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:19','2020-10-13 09:20:19',NULL,'https://canvas-lms.ga/courses/8/assignments/250/submissions?zip=1',NULL,NULL),(123,299,76,'Monday October 24',25,'https://canvas-lms.ga/courses/8/assignments/299',8,'<p><span>What are periodic trends? How do elements change as you go across and down the periodic table?</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:25','2020-10-13 09:20:25',NULL,'https://canvas-lms.ga/courses/8/assignments/299/submissions?zip=1',NULL,NULL),(124,391,76,'Tuesday October 25',25,'https://canvas-lms.ga/courses/8/assignments/391',8,'<p><span>Why is period one of the periodic table considered ugly ducklings?</span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:35','2020-10-13 09:20:35',NULL,'https://canvas-lms.ga/courses/8/assignments/391/submissions?zip=1',NULL,NULL),(125,368,76,'Thursday October 27',25,'https://canvas-lms.ga/courses/8/assignments/368',8,'<p><span>Explain why even though the right side of the periodic table has more electron, its atomic radius is smaller than those on the left side of the periodic table. </span></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:32','2020-10-13 09:20:32',NULL,'https://canvas-lms.ga/courses/8/assignments/368/submissions?zip=1',NULL,NULL),(126,251,76,'Friday October 28',25,'https://canvas-lms.ga/courses/8/assignments/251',8,'<p>Write a paragraph to explain why we used the magnets yesterday to help us understand Coloumbic attraction, ionization energy, electronegativity, electron affinity, and atomic radius? (yes, it has to do with all of this)</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:19','2020-10-13 09:20:19',