hope you all had a wonderful long weekend!</p>\n<p>What do you know about atoms and elements? Write your answer on  sheet of paper. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:33','2020-10-13 09:20:33',NULL,'https://canvas-lms.ga/courses/8/assignments/378/submissions?zip=1',NULL,NULL),(155,405,76,'Wednesday January 18',25,'https://canvas-lms.ga/courses/8/assignments/405',8,'<p>I hope you are all having a wonderful Wednesday! We are already halfway through the week!!! </p>\n<p><strong>Today in class:</strong> We will practice using significant figures more today. </p>\n<p>We will be starting scientific notation today. </p>\n<p>We will have a quiz on the metric system, significant figures and scientific notation Friday.</p>\n<p><strong>Bell Ringer: </strong></p>\n<p>1. Convert 23 meters into kilometers and millimeters. </p>\n<p>2. Express 12.0 + 13.57 in the correct number of significant figures.</p>\n<p>3. Express 10.00/ 5.0  in the correct number of significant figures.</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:37','2020-10-13 09:20:37',NULL,'https://canvas-lms.ga/courses/8/assignments/405/submissions?zip=1',NULL,NULL),(156,335,76,'Significant Figure Practice 2',25,'https://canvas-lms.ga/courses/8/assignments/335',8,'<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"significant figure practice-2.pdf\" href=\"https://canvas-lms.ga/courses/8/files/381/download?verifier=twkjcDIocFm356fN0T6LlMZWYhTInRDfUTKFilBS&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/381\" data-api-returntype=\"File\">significant figure practice-2.pdf</a></p>\n<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"significant figure practice-2.pdf\" href=\"https://canvas-lms.ga/courses/8/files/381/download?verifier=twkjcDIocFm356fN0T6LlMZWYhTInRDfUTKFilBS&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/381\" data-api-returntype=\"File\"></a><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"Significant Digits Arithmetic WorkSheet.doc\" href=\"https://canvas-lms.ga/courses/8/files/386/download?verifier=T3KxHmZM57N42BRr2UU1eaXqyt1CPnjQF5yWfntI&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/386\" data-api-returntype=\"File\">Significant Digits Arithmetic WorkSheet.doc</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:28','2020-10-13 09:20:28',NULL,'https://canvas-lms.ga/courses/8/assignments/335/submissions?zip=1',NULL,NULL),(157,356,76,'Thursday January 19th',25,'https://canvas-lms.ga/courses/8/assignments/356',8,'<p>It\'s Thursday, we are mostly through this week already!</p>\n<p>Today in class: We are going to review the metric system, significant figures, and scientific notation today in preparation for our quiz tomorrow. We may also start density. </p>\n<p>Tomorrow: we will play a review game, quiz, and then start properties of matter. </p>\n<p>Bell Ringer:</p>\n<p>1. How many millimeters are in a meter?</p>\n<p>2. what is the numerical value for a dekaliter?</p>\n<p>3. Put 5500000000000 into scientific notation. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:31','2020-10-13 09:20:31',NULL,'https://canvas-lms.ga/courses/8/assignments/356/submissions?zip=1',NULL,NULL),(158,239,76,'Friday January 20th',25,'https://canvas-lms.ga/courses/8/assignments/239',8,'<p>It\'s Friday!!! This school week is over. </p>\n<p><strong>Today in class:</strong> We will play a review game, and quiz on the metric system, significant figures, and scientific notation. After the quiz we will start on properties of matter.</p>\n<p><strong>Bell Ringer: </strong></p>\n<p>What is density?</p>\n<p>What is the formula for density?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:18','2020-10-13 09:20:18',NULL,'https://canvas-lms.ga/courses/8/assignments/239/submissions?zip=1',NULL,NULL),(159,291,76,'Monday January 23',25,'https://canvas-lms.ga/courses/8/assignments/291',8,'<p>I hope you all have a good weekend.</p>\n<p><strong>Today in class:</strong> We will be discussing the difference between accuracy and precision. Then, we will be starting on the properties of matter. </p>\n<p><strong>Bell Ringer question:  </strong>Without looking it up, tell me what you think is the difference between accuracy and precision. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:24','2020-10-13 09:20:24',NULL,'https://canvas-lms.ga/courses/8/assignments/291/submissions?zip=1',NULL,NULL),(160,379,76,'Tuesday January 24',25,'https://canvas-lms.ga/courses/8/assignments/379',8,'<p>Today in class: More classifying of materials!</p>\n<p>Tomorrow: Isolating chemicals from mixtures lab.</p>\n<p>Bell ringer: Explain the difference between an element, compound, and a mixture. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:34','2020-10-13 09:20:34',NULL,'https://canvas-lms.ga/courses/8/assignments/379/submissions?zip=1',NULL,NULL),(161,406,76,'Wednesday January 25',25,'https://canvas-lms.ga/courses/8/assignments/406',8,'<p>We are officially half way through the week!!!</p>\n<p>Today in class: we will do the pre-lab for the kool-aid lab in class, then we will go into the lab to perform chromatography on mixture to isolate out chemicals. </p>\n<p> </p>\n<p>Bell Ringer: What are intensive and extensive properties?</p>\n<p>After you are done with the bell ringer start reading the kool-aid lab procedure located in module 1 in cannvas. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:37','2020-10-13 09:20:37',NULL,'https://canvas-lms.ga/courses/8/assignments/406/submissions?zip=1',NULL,NULL),(162,357,76,'Thursday January 26',25,'https://canvas-lms.ga/courses/8/assignments/357',8,'<p>The week is almost over!</p>\n<p><strong>Today in class:</strong> We will finish chapter 1 notes, discuss more about intensive and extensive properties. </p>\n<p><strong>Tomorrow:</strong> your completed lab reports are due. </p>\n<p><strong>Bell Ringer:</strong> how did separating the dye out of the koolaid prove that it was a mixture?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:31','2020-10-13 09:20:31',NULL,'https://canvas-lms.ga/courses/8/assignments/357/submissions?zip=1',NULL,NULL),(163,240,76,'Friday January 27',25,'https://canvas-lms.ga/courses/8/assignments/240',8,'<p>It is finally Friday!</p>\n<p>Today in class: your lab report is due. You will have a few minutes to finish it up, then we will be discussing law of conservation of mass and we will play quizlet live with the chapter 1 vocabulary. </p>\n<p> </p>\n<p>Bell Ringer: What is plasma? Also if a chemical is listed as a solution, what does this tell you about the chemical?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:18','2020-10-13 09:20:18',NULL,'https://canvas-lms.ga/courses/8/assignments/240/submissions?zip=1',NULL,NULL),(164,395,76,'Vocabulary Quizlet',25,'https://canvas-lms.ga/courses/8/assignments/395',8,'<p><a id=\"\" class=\"\" title=\"\" href=\"https://quizlet.com/_31lrwx\" target=\"\">Link</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:35','2020-10-13 09:20:35',NULL,'https://canvas-lms.ga/courses/8/assignments/395/submissions?zip=1',NULL,NULL),(165,292,76,'Monday, January 30th',25,'https://canvas-lms.ga/courses/8/assignments/292',8,'<p>Welcome back to school on this glorious, albeit cold Monday!</p>\n<p><strong>Today in class: </strong>We will review for the vocabulary quiz tomorrow, I will give you a grade for the review 1 worksheet that you completed Friday, and we will complete review worksheet 2 today in class. Your Chapter 1 test will be Thursday.</p>\n<p><strong>Tomorrow: </strong>We will take a vocabulary quiz, and start talking about atoms. </p>\n<p><strong>Bell Ringer:</strong> What information does the periodic table give you about an element? Be specific. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:24','2020-10-13 09:20:24',NULL,'https://canvas-lms.ga/courses/8/assignments/292/submissions?zip=1',NULL,NULL),(166,380,76,'Tuesday, January 31st',25,'https://canvas-lms.ga/courses/8/assignments/380',8,'<p><strong>Today in class:</strong> We will play quizlet live to prepare for the vocabulary quiz, then we will discuss bonding and annotate the periodic table. </p>\n<p><strong>Tomorrow: </strong>You will complete review worksheet 2, and get into groups to do study games. </p>\n<p><strong>Thursday Is your chapter 1 test!</strong></p>\n<p><strong>Bell Ringer:</strong></p>\n<p>What is a valence shell?</p>\n<p>What is a valence electron?</p>\n<p>Why is this information important to chemical bonding?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:34','2020-10-13 09:20:34',NULL,'https://canvas-lms.ga/courses/8/assignments/380/submissions?zip=1',NULL,NULL),(167,401,76,'Wednesday, February 1st',25,'https://canvas-lms.ga/courses/8/assignments/401',8,'<p>Hi everyone! as discussed I will not be here today or tomorrow. That being said you still have a bell ringer both days and you still have your chapter 1 test tomorrow. </p>\n<p><strong>Today In Class:</strong> You will break into your groups of 5, and you will each have 15 questions to answer. Sophie\'s group will take the 1st 15, Maddie\'s group will take the 2nd 15, and Bryce\'s group will take the last 15. You will then take a few minutes to discuss your answers with the rest of the class and then one person from each group will quiz the class. The group with the 1st correct answer will get a point, the group with the most points gets 5 bonus points on the test. </p>\n<p><strong>Tomorrow:</strong> Chapter 1 test. </p>\n<p><strong>Bell Ringer:</strong> What are the 3 major types of chemical bonds and how do we determine how atoms will form those bonds?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:36','2020-10-13 09:20:36',NULL,'https://canvas-lms.ga/courses/8/assignments/401/submissions?zip=1',NULL,NULL),(168,353,76,'Thursday, February 2nd',25,'https://canvas-lms.ga/courses/8/assignments/353',8,'<p>Good morning ladies and gentlemen! Thank you for working diligently yesterday. Also, congratulations to Cade, Chase, Bryce, Evan, and Jonathan for winning the 5 bonus points of your test! Although, Sophie and Tyriq, with how competitive you both are I was almost surprised to hear the result. But good job, to all of you. I hope you are well prepared for the test. </p>\n<p><strong>Today in class: </strong>Chapter 1 Test, Good Luck!</p>\n<p><strong>Tomorrow in class: </strong>NaCl lab</p>\n<p><strong>Bell Ringer:</strong> This is for 1 bonus point on your test as well as your daily bell ringer grade. </p>\n<p>How much wood could a woodchuck chuck if a woodchuck could chuck wood?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:30','2020-10-13 09:20:31',NULL,'https://canvas-lms.ga/courses/8/assignments/353/submissions?zip=1',NULL,NULL),(169,237,76,'Friday, February 3rd',25,'https://canvas-lms.ga/courses/8/assignments/237',8,'<p>Happy Friday! Your tests are half graded, and will hopefully be finished by Monday. Good news about the tests is that I have decided to make the short answer question bonus points, bad news is that no one made a 100 naturally,  :( </p>\n<p><strong>Today in class: </strong>NaCl lab! Lab reports will be due Wednesday.</p>\n<p><strong>Monday:</strong> We will start chapter 3.</p>\n<p><strong>Bell Ringer:</strong> How would you determine how much of a solution was a particular substance?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:18','2020-10-13 09:20:18',NULL,'https://canvas-lms.ga/courses/8/assignments/237/submissions?zip=1',NULL,NULL),(170,208,76,'Chapter 1 study guide 2/1/17',25,'https://canvas-lms.ga/courses/8/assignments/208',8,'<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"chapter1_studyguide.doc\" href=\"https://canvas-lms.ga/courses/8/files/390/download?verifier=kgdgxXRlsX3WcFVUyNMsLjY7G21Qmz6yTVu38qhf&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/390\" data-api-returntype=\"File\">chapter1_studyguide.doc</a></p>\n<p> </p>\n<p>A few of the questions did not make it onto the study guide, deal with it as best you can. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:14','2020-10-13 09:20:14',NULL,'https://canvas-lms.ga/courses/8/assignments/208/submissions?zip=1',NULL,NULL),(171,290,76,'Monday, February 6th',25,'https://canvas-lms.ga/courses/8/assignments/290',8,'<p>Good Afternoon, I hope you all had a good weekend!</p>\n<p><strong>Today in class:</strong> We will start module 3, and begin discussing the atom and the various molecular models that lead us to the current quantum mechanical model.</p>\n<p><strong>Bell Ringer:</strong> If your solution had more substances in it than just pure water and salt, would you be able to use the same method as Friday to separate the mixture?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:24','2020-10-13 09:20:24',NULL,'https://canvas-lms.ga/courses/8/assignments/290/submissions?zip=1',NULL,NULL),(172,376,76,'Tuesday, February 7th',25,'https://canvas-lms.ga/courses/8/assignments/376',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:33','2020-10-13 09:20:33',NULL,'https://canvas-lms.ga/courses/8/assignments/376/submissions?zip=1',NULL,NULL),(173,403,76,'Wednesday, February 8th',25,'https://canvas-lms.ga/courses/8/assignments/403',8,'<p>Good afternoon! We are half way through the week and your lab reports are due today. </p>\n<p><strong>Today in class:</strong> We will calculate the relative abundance of isotopes to determine average molecular weigh, and we will also practice using dimensional analysis. Have your calculators today!</p>\n<p><strong>Tomorrow in class:</strong> Law of Definite Proportions lab</p>\n<p><strong>BellRinger:</strong> Why do the atomic masses on the periodic table have decimal point when we know that protons and neutrons come together in whole numbers only?</p>\n<p>How do we determine which isotope is most common from the information presented on the periodic table?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:37','2020-10-13 09:20:37',NULL,'https://canvas-lms.ga/courses/8/assignments/403/submissions?zip=1',NULL,NULL),(174,354,76,'Thursday, February 9th',25,'https://canvas-lms.ga/courses/8/assignments/354',8,'<p>So there is some good and bad news. The good news is that the week is almost over. The bad news is that your class no longer gets any candy privileges, because after you left I found candy wrappers left in the classroom. And that was after I let you have candy even though the class was overly rambunctious and would not listen as I was going over problems yesterday. So, no more candy.</p>\n<p>Today In class: We will perform and take data from the Law of Definite Proportions Lab. If you behave in the lab the way you did in class yesterday, we will leave the lab and everyone will receive a zero for your lab grade no questions asked. </p>\n<p>Dimensional analysis practice from yesterday is do at the end of class today. </p>\n<p>Tomorrow: we will be calculating Atomic mass using the relative abundance of isotopes.</p>\n<p>Bell Ringer: Convert 120062 meters per second to miles per minute. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:31','2020-10-13 09:20:31',NULL,'https://canvas-lms.ga/courses/8/assignments/354/submissions?zip=1',NULL,NULL),(175,235,76,'Friday, February 10th',25,'https://canvas-lms.ga/courses/8/assignments/235',8,'<p><strong>Happy Friday!!!</strong></p>\n<p><strong>Today in class:</strong> we will be calculating some relative abundances and doing an activity along those lines. </p>\n<p>If you did not turn in your dimensional analysis worksheet yesterday I need it on the front table or in my hand before we begin class. </p>\n<p>Lab reports are due Monday.</p>\n<p><strong>Bell Ringer</strong>: How did yesterdays lab relate to the law of definite proportions?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:17','2020-10-13 09:20:17',NULL,'https://canvas-lms.ga/courses/8/assignments/235/submissions?zip=1',NULL,NULL),(176,302,76,'NaCl lab report submission link',25,'https://canvas-lms.ga/courses/8/assignments/302',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:25','2020-10-13 09:20:25',NULL,'https://canvas-lms.ga/courses/8/assignments/302/submissions?zip=1',NULL,NULL),(177,288,76,'Monday, February 13th',25,'https://canvas-lms.ga/courses/8/assignments/288',8,'<p>Bell Ringer: How did the sugar lab prove the law of definite proportions?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:23','2020-10-13 09:20:23',NULL,'https://canvas-lms.ga/courses/8/assignments/288/submissions?zip=1',NULL,NULL),(178,344,76,'Submit POGIL here',25,'https://canvas-lms.ga/courses/8/assignments/344',8,'<p><a class=\"\" href=\"https://youtu.be/xirPkCI1sMA\">https://youtu.be/xirPkCI1sMA</a></p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:29','2020-10-13 09:20:30',NULL,'https://canvas-lms.ga/courses/8/assignments/344/submissions?zip=1',NULL,NULL),(179,186,76,'Atomic History',25,'https://canvas-lms.ga/courses/8/assignments/186',8,'<p>Several key scientists contributed to our understanding of the atom.The scientists are <strong>Democritus, John Dalton, J.J. Thomson, Robert Millikan, and Ernest Rutherford</strong>.  For each of those people, I would like you to use your book, or any other resource you would like, to determine what he contributed to the atomic model we now use.  Do this in a <strong>google slide share</strong> with your group members and be sure to include pictures.</p>\n<p>Each group member will need to turn in a link to the file share and explain their contribution to the project in this submission box to get credit for the assignment. </p>\n<p>What did each \"discover?\"  </p>\n<p>How did it improve or disprove something that came before?  </p>\n<p>How did he find out the information?   </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:12','2020-10-13 09:20:12',NULL,'https://canvas-lms.ga/courses/8/assignments/186/submissions?zip=1',NULL,NULL),(180,400,76,'Wednesday February 15th',25,'https://canvas-lms.ga/courses/8/assignments/400',8,'<p>I hope you all had a wonderful valentines day, and I hope you enjoyed your Chemist Tea Party yesterday even though I could not be there. </p>\n<p><strong>Today in class:</strong> you will need to turn in your POGIL, which no one did yet.</p>\n<p>You will also need to work on the Atomic History assignment that is in module 3, in groups of no more than 4 people per group.</p>\n<p>After that you will probably need to watch the composition stoichiometry review videos and then do compositional stoichiometry practice 1 and 2 that are also in chapter 3 modules. </p>\n<p><strong>Bell Ringer:</strong> How did it go yesterday? Was there a particular tea you liked or didn\'t like? Tell me about your day. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:36','2020-10-13 09:20:36',NULL,'https://canvas-lms.ga/courses/8/assignments/400/submissions?zip=1',NULL,NULL),(181,351,76,'Thursday, February 16th',25,'https://canvas-lms.ga/courses/8/assignments/351',8,'<p> </p>\n<p>Today in class: We will discuss the atomic model and we will perform the comosition stoicheometry practice together, since no one seemingly did it yesterday.   </p>\n<p> </p>\n<p>Bell Ringer: What is the atomic model we currently use and how was it developed?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:30','2020-10-13 09:20:30',NULL,'https://canvas-lms.ga/courses/8/assignments/351/submissions?zip=1',NULL,NULL),(182,402,76,'Wednesday February 22',25,'https://canvas-lms.ga/courses/8/assignments/402',8,'<p>Today in class: We will review the composition stoichiometry and atomic history.</p>\n<p>Friday is the Chapter 3 test.</p>\n<p>Bell Ringer: what is Avogadro\'s number and what does it represent?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:36','2020-10-13 09:20:36',NULL,'https://canvas-lms.ga/courses/8/assignments/402/submissions?zip=1',NULL,NULL),(183,352,76,'Thursday February 23',25,'https://canvas-lms.ga/courses/8/assignments/352',8,'<p><strong>Today in class:</strong> Chapter 3 Review</p>\n<p><strong>Tomorrow: Test</strong></p>\n<p><strong>Bell Ringer:</strong> Convert 15.33 x 10^18 atoms of Carbon into grams. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:30','2020-10-13 09:20:30',NULL,'https://canvas-lms.ga/courses/8/assignments/352/submissions?zip=1',NULL,NULL),(184,236,76,'Friday February 24th',25,'https://canvas-lms.ga/courses/8/assignments/236',8,'<p>Today is test day!!!</p>\n<p><strong>Today in class:</strong> we will have a few minutes to review before the test, but I have no voice, and can not speak above a whisper, so you will have  to listen closely. </p>\n<p> </p>\n<p><strong>Bell Ringer: </strong>Why do you have to account for relative abundance when calculating average atomic mass? Why can you not just average them like you would average numbers in math?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:17','2020-10-13 09:20:17',NULL,'https://canvas-lms.ga/courses/8/assignments/236/submissions?zip=1',NULL,NULL),(185,289,76,'Monday February 27th',25,'https://canvas-lms.ga/courses/8/assignments/289',8,'<p><strong>Good Afternoon! My voice still sucks, so you will have to do the bulk of the talking today! </strong></p>\n<p><strong>Today in class:</strong> we will start chapter 4 notes and electron configuration.</p>\n<p><strong>Bell Ringer:</strong> What is the relationship between atoms and light?</p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:23','2020-10-13 09:20:24',NULL,'https://canvas-lms.ga/courses/8/assignments/289/submissions?zip=1',NULL,NULL),(186,375,76,'Tuesday February 28th',25,'https://canvas-lms.ga/courses/8/assignments/375',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:33','2020-10-13 09:20:33',NULL,'https://canvas-lms.ga/courses/8/assignments/375/submissions?zip=1',NULL,NULL),(187,393,76,'Turn POGIL in here',25,'https://canvas-lms.ga/courses/8/assignments/393',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:35','2020-10-13 09:20:35',NULL,'https://canvas-lms.ga/courses/8/assignments/393/submissions?zip=1',NULL,NULL),(188,408,76,'Wednesday March 1st',25,'https://canvas-lms.ga/courses/8/assignments/408',8,'<p>Bell ringer: What was the purpose of yesterdays lab?</p>\n<p>Today in class: after the hecticness of the day, with so few people in class, we continued watching The Martian. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:37','2020-10-13 09:20:37',NULL,'https://canvas-lms.ga/courses/8/assignments/408/submissions?zip=1',NULL,NULL),(189,360,76,'Thursday March 2nd',25,'https://canvas-lms.ga/courses/8/assignments/360',8,'<p>Today in class: we will complete the light spectrometry lab. </p>\n<p>Due tomorrow: Light spectrometry lab, Light and energy POGIL, lab purpose and procedure for flame test lab. </p>\n<p>All makeup work is due no later than Tuesday. After you have turned in all online assignments, please send me just 1 email in cannvas with a list of the assignments turned in. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:31','2020-10-13 09:20:32',NULL,'https://canvas-lms.ga/courses/8/assignments/360/submissions?zip=1',NULL,NULL),(190,244,76,'Friday, March 3rd',25,'https://canvas-lms.ga/courses/8/assignments/244',8,'<p>It is Friday! Only ONE full week left till SPRING BREAK!</p>\n<p><strong>Today in class:</strong> We will go into the lab to do the Flame test. </p>\n<p><strong>Due today:</strong> POGIL, Light spectrometry lab.</p>\n<p>All makeup work due by Tuesday!</p>\n<p><strong>Bell Ringer:</strong> How do fireworks get their colors?</p>\n<p><img src=\"https://canvas-lms.ga/courses/8/files/378/preview?verifier=nfbUCkXywSZlLQKUdj6D8LMgUoFdyePuhYynswYL\" alt=\"Chemistry cat traveling light.jpg\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/378\" data-api-returntype=\"File\"></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:18','2020-10-13 09:20:19',NULL,'https://canvas-lms.ga/courses/8/assignments/244/submissions?zip=1',NULL,NULL),(191,295,76,'Monday March 6th',25,'https://canvas-lms.ga/courses/8/assignments/295',8,'<p>Good Afternoon! I hope everyone had a good weekend.</p>\n<p><strong>Today in class:</strong> We will be discussing and practicing electron orbital diagrams.</p>\n<p><span style=\"color: #ff0000;\"><strong>All Makeup/ missing work is due Tomorrow!</strong></span></p>\n<p><strong>Bell Ringer:</strong> Explain the relationship between wavelength and energy. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:24','2020-10-13 09:20:24',NULL,'https://canvas-lms.ga/courses/8/assignments/295/submissions?zip=1',NULL,NULL),(192,383,76,'Tuesday March 7th',25,'https://canvas-lms.ga/courses/8/assignments/383',8,'<p>Today in class: We will Practice our orbital Diagrams, and do a who is who of scientist.</p>\n<p> </p>\n<p>Bell Ringer: All noble gasses end in what type of orbital?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:34','2020-10-13 09:20:34',NULL,'https://canvas-lms.ga/courses/8/assignments/383/submissions?zip=1',NULL,NULL),(193,411,76,'Wednesday March 8th',25,'https://canvas-lms.ga/courses/8/assignments/411',8,'<p>Today in class: we will finish discussing orbital diagrams and review for tomorrows test.</p>\n<p>Bell Ringer: By what principle do electron orbits fill with the up arrow before adding a downward spinning electron?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:38','2020-10-13 09:20:38',NULL,'https://canvas-lms.ga/courses/8/assignments/411/submissions?zip=1',NULL,NULL),(194,362,76,'Thursday March 9th',25,'https://canvas-lms.ga/courses/8/assignments/362',8,'<p>Today in class: Chapter 4 test</p>\n<p> </p>\n<p>Bell Ringer: What is the visible spectrum of light?</p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:32','2020-10-13 09:20:32',NULL,'https://canvas-lms.ga/courses/8/assignments/362/submissions?zip=1',NULL,NULL),(195,242,76,'Friday March 10th',25,'https://canvas-lms.ga/courses/8/assignments/242',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:18','2020-10-13 09:20:18',NULL,'https://canvas-lms.ga/courses/8/assignments/242/submissions?zip=1',NULL,NULL),(196,294,76,'Monday, March 20th',25,'https://canvas-lms.ga/courses/8/assignments/294',8,'<p>I hope you all had a wonderful long break!</p>\n<p><strong>Today in class:</strong> We will start Chapter 5 about periodic trends. </p>\n<p><strong>Tomorrow: </strong>Practice using the information about  the periodic trends.</p>\n<p><strong>Test no later than Friday!</strong></p>\n<p><strong>Bell Ringer:</strong> Tell me about your spring break in a complete paragraph, using proper sentence structure and punctuation. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:24','2020-10-13 09:20:52',NULL,'https://canvas-lms.ga/courses/8/assignments/294/submissions?zip=1',NULL,NULL),(197,381,76,'Tuesday March 21st',25,'https://canvas-lms.ga/courses/8/assignments/381',8,'<p><strong>Today in class:</strong> We will finish chapter 5 notes. Then you will work on the Atomic trends POGIL. </p>\n<p><strong>Tomorrow in class:</strong> We will do some of the review sheets</p>\n<p><strong>Bell Ringer:</strong> Which groups from the periodic table will form cations and which will form anions; why?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:34','2020-10-13 09:20:56',NULL,'https://canvas-lms.ga/courses/8/assignments/381/submissions?zip=1',NULL,NULL),(198,409,76,'Wednesday March 22nd',25,'https://canvas-lms.ga/courses/8/assignments/409',8,'<p>I hope you enjoyed yesterday while it was sunny, because we are going to have <strong>rain all weekend</strong>. ToT</p>\n<p><strong>Today in class:</strong> Your POGIL is due today. If we have time I will give you some to work on the pogil. However I also want to start some of the reviews. Your test is Friday. </p>\n<p><strong>Bell Ringer:</strong> Why are the trends of Ionization energy and electronegativity the same? Why are they opposite of the trend for atomic radius?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:37','2020-10-13 09:20:57',NULL,'https://canvas-lms.ga/courses/8/assignments/409/submissions?zip=1',NULL,NULL),(199,394,76,'Turn POGIL in here',25,'https://canvas-lms.ga/courses/8/assignments/394',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:35','2020-10-13 09:20:35',NULL,'https://canvas-lms.ga/courses/8/assignments/394/submissions?zip=1',NULL,NULL),(200,359,76,'Thursday March 23rd',25,'https://canvas-lms.ga/courses/8/assignments/359',8,'<p><strong>Today in class:</strong> we will be finishing up the review worksheets and doing the chapter 5 practice test.</p>\n<p><strong>Tomorrow: Chapter 5 test!</strong></p>\n<p><strong>Bell Ringer:</strong> Explain why the larger the atomic radius the less electronegativity. Use the shielding effect in your explanation. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:31','2020-10-13 09:20:55',NULL,'https://canvas-lms.ga/courses/8/assignments/359/submissions?zip=1',NULL,NULL),(201,382,76,'Tuesday March 28th',25,'https://canvas-lms.ga/courses/8/assignments/382',8,'<p>I hope you all enjoyed leaving early yesterday!</p>\n<p><strong>Today in class:</strong> We will be starting chapter 6 on molecular bonding! yay! It is at the least more interesting than the last chapter. </p>\n<p>Also, I have<strong> not</strong> graded your tests yet, so please do not ask.</p>\n<p> </p>\n<p><strong>Bell Ringer:</strong> What is one of the most basic ways to determine the bond type that will form between compounds?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:34','2020-10-13 09:20:56',NULL,'https://canvas-lms.ga/courses/8/assignments/382/submissions?zip=1',NULL,NULL),(202,410,76,'Wednesday March 29th',25,'https://canvas-lms.ga/courses/8/assignments/410',8,'<p>Today in class: Since I have been informed that no one reads what we are going to do in class, I have decided to stop telling you and just let it be a surprise! Also try to say pink flamingos do flamingo dancing on the fandango site 5 times fast.</p>\n<p> </p>\n<p>Bell Ringer: How do we determine how many of each element are going to be required to form a bond? </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:38','2020-10-13 09:20:57',NULL,'https://canvas-lms.ga/courses/8/assignments/410/submissions?zip=1',NULL,NULL),(203,361,76,'Thursday March 30th',25,'https://canvas-lms.ga/courses/8/assignments/361',8,'<p>Today in class: we will be working more with predicting bond types. Then we will work some on molecular geometry.</p>\n<p> </p>\n<p>Bell Ringer: If you did not have an electronegativity chart, how would you determine if a covalent bond is polar or non-polar?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:32','2020-10-13 09:20:55',NULL,'https://canvas-lms.ga/courses/8/assignments/361/submissions?zip=1',NULL,NULL),(204,243,76,'Friday March 31st',25,'https://canvas-lms.ga/courses/8/assignments/243',8,'<p>Today in class: you are going to work on the molecular geometry pogil. <strong>You need to start this when you get into class!</strong></p>\n<p><strong>Grading:</strong> Also I need to see your homework. This is the ionic bonding that I didn\'t get to check yesterday and the Covalent bonding 2 wks. This is also the last day I will accept your Quizlets. </p>\n<p> </p>\n<p>Bell Ringer: How many electrons are being shared between a single bond, double bond, and triple bond?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:18','2020-10-13 09:20:50',NULL,'https://canvas-lms.ga/courses/8/assignments/243/submissions?zip=1',NULL,NULL),(205,282,76,'Molecular Geometry POGIL',25,'https://canvas-lms.ga/courses/8/assignments/282',8,'<p><a id=\"\" class=\"\" title=\"\" href=\"https://drive.google.com/a/acs-k12.org/file/d/0B-x7KXj4oNyAMHVRLUNUdzZZcnc/view?usp=sharing\" target=\"\">Molecular Geometry POGIL</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:23','2020-10-13 09:20:51',NULL,'https://canvas-lms.ga/courses/8/assignments/282/submissions?zip=1',NULL,NULL),(206,287,76,'Monday, April 3rd',25,'https://canvas-lms.ga/courses/8/assignments/287',8,'<p>Today in class: We are going to finish up chapter 6, and review any questions you have.</p>\n<p>Tomorrow: The end of series beta testing.</p>\n<p>Bell Ringer: How do lewis dot bonding structures differ between ionic and covalent bonds?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:23','2020-10-13 09:20:52',NULL,'https://canvas-lms.ga/courses/8/assignments/287/submissions?zip=1',NULL,NULL),(207,374,76,'Tuesday, April 4th',25,'https://canvas-lms.ga/courses/8/assignments/374',8,'<p>Today in class: Achievement series beta testing. At the end of the test, it will let you see how many you missed, and how many you got right, I need to see this page before you finish!!!!</p>\n<p> </p>\n<p>Website for test: <a href=\"http://www.achievementseries.com\">www.achievementseries.com</a> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:33','2020-10-13 09:20:33',NULL,'https://canvas-lms.ga/courses/8/assignments/374/submissions?zip=1',NULL,NULL),(208,399,76,'Wednesday April 5th',25,'https://canvas-lms.ga/courses/8/assignments/399',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:36','2020-10-13 09:20:36',NULL,'https://canvas-lms.ga/courses/8/assignments/399/submissions?zip=1',NULL,NULL),(209,349,76,'Thursday April 6th',25,'https://canvas-lms.ga/courses/8/assignments/349',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:30','2020-10-13 09:20:30',NULL,'https://canvas-lms.ga/courses/8/assignments/349/submissions?zip=1',NULL,NULL),(210,233,76,'Friday,  April 7th',25,'https://canvas-lms.ga/courses/8/assignments/233',8,'<p>Today in class: We will do a quick review, then you will take a quick chapter 6 test. </p>\n<p> </p>\n<p>Bell Ringer: The chemical formula for methane is CH<sub>4 ,</sub> What could another name for it be?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:17','2020-10-13 09:20:50',NULL,'https://canvas-lms.ga/courses/8/assignments/233/submissions?zip=1',NULL,NULL),(211,284,76,'Monday, April 10th',25,'https://canvas-lms.ga/courses/8/assignments/284',8,'<p>We are very far behind, so there will be no time to waste these next few weeks. </p>\n<p>Today in Class: We will be starting chapter 7 notes, then we will practice determining formulas for Ionic compounds based on their names. </p>\n<p> </p>\n<p>Bell Ringer: After grading your tests, I feel I have to ask; What is the difference in electron movement between ionic compounds and covalent compounds. (If you answer flippantly you will receive a zero for he assignment.)</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:23','2020-10-13 09:20:52',NULL,'https://canvas-lms.ga/courses/8/assignments/284/submissions?zip=1',NULL,NULL),(212,371,76,'Tuesday, April 11th',25,'https://canvas-lms.ga/courses/8/assignments/371',8,'<p>Today in class: We will go over the answers to the homework, then we will begin discussing the difference between ionic and covalent nomenclature.</p>\n<p> </p>\n<p>Bell Ringer: what is the difference between oxide, hydride, and hydroxide?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:33','2020-10-13 09:20:55',NULL,'https://canvas-lms.ga/courses/8/assignments/371/submissions?zip=1',NULL,NULL),(213,396,76,'Wednesday, April 12th',25,'https://canvas-lms.ga/courses/8/assignments/396',8,'<p><strong>Today in class:</strong> We will get more practice with nomenclature, and hopefully we will have enough time to start molecular weight.</p>\n<p>If you finished the nomenclature worksheet 1 as homework turn it in before we start going over the answers to receive your extra credit. </p>\n<p><span style=\"color: #ff0000;\"><strong>If you have failed a test</strong></span>, I will let you do a re-take. You need to let me know a time that you can come to retake the test. </p>\n<p><strong>Bell Ringer:</strong> How do you determine which naming scheme you need to use when naming chemical compounds?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:35','2020-10-13 09:20:56',NULL,'https://canvas-lms.ga/courses/8/assignments/396/submissions?zip=1',NULL,NULL),(214,346,76,'Thursday, April 13th',25,'https://canvas-lms.ga/courses/8/assignments/346',8,'<p>I hope you all had a wonderful long Easter weekend. </p>\n<p> </p>\n<p>Today in class: we will be practicing more with nomenclature, and formula weight.</p>\n<p> </p>\n<p>Bell Ringer: what is the name and formula weight of Mg(OH)<sub>2</sub>? </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:30','2020-10-13 09:20:54',NULL,'https://canvas-lms.ga/courses/8/assignments/346/submissions?zip=1',NULL,NULL),(215,285,76,'Monday, April 17th',25,'https://canvas-lms.ga/courses/8/assignments/285',8,'<div class=\"assignment-title\">\n<div class=\"assignment-buttons\">\n<a class=\"btn edit_assignment_link\" href=\"https://canvas-lms.ga/courses/8/assignments/346\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/assignments/346\" data-api-returntype=\"Assignment\"><i class=\"icon-edit\"></i> Edit</a> <a class=\"al-trigger btn\" role=\"button\" aria-haspopup=\"true\" aria-owns=\"toolbar-1\" href=\"https://canvas-lms.ga/courses/8/assignments/346\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/assignments/346\" data-api-returntype=\"Assignment\"><i class=\"icon-settings\"></i> <i class=\"icon-mini-arrow-down\"></i><span class=\"screenreader-only\">Manage</span></a>\n</div>\n</div>\n<div class=\"clear\"></div>\n<div class=\"clear\"></div>\n<div class=\"description user_content teacher-version enhanced\">\n<p>I hope you all had a wonderful long Easter weekend. </p>\n<p> </p>\n<p>Today in class: we will be practicing more with nomenclature, and formula weight.</p>\n<p> </p>\n<p>Bell Ringer: what is the name and formula weight of Mg(OH)<sub>2</sub>? </p>\n</div>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:23','2020-10-13 09:20:52',NULL,'https://canvas-lms.ga/courses/8/assignments/285/submissions?zip=1',NULL,NULL),(216,372,76,'Tuesday, April 18th',25,'https://canvas-lms.ga/courses/8/assignments/372',8,'<p>Today in class: we will discuss the difference between molecular formula and empirical formula, then you will practice empirical formulas and determining formula from mass. </p>\n<p> </p>\n<p>Chapter 7 Test Friday!</p>\n<p>Bell Ringer:  If I told you a Compound was 11.21% Hydrogen and 88.79% Oxygen, what would the compound be?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:33','2020-10-13 09:20:55',NULL,'https://canvas-lms.ga/courses/8/assignments/372/submissions?zip=1',NULL,NULL),(217,397,76,'Wednesday, April 19th',25,'https://canvas-lms.ga/courses/8/assignments/397',8,'<p>Today most of you are taking the ACT or the ASPIRE. </p>\n<p>If you are not taking the ACT you need to do this assignment to get credit for being here today as an e-learning day.</p>\n<p> </p>\n<p> </p>\n<p>Tell me what you still have trouble with in this section. If you really need extra practice you need to pick 5 questions from worksheet to use for practice, or I will find an assignment for you. let me know. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:36','2020-10-13 09:20:56',NULL,'https://canvas-lms.ga/courses/8/assignments/397/submissions?zip=1',NULL,NULL),(218,347,76,'Thursday, April 20th',25,'https://canvas-lms.ga/courses/8/assignments/347',8,'<p>Today in class it is ch 7 review. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: remind me to talk to you about mole day tomorrow. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:30','2020-10-13 09:20:30',NULL,'https://canvas-lms.ga/courses/8/assignments/347/submissions?zip=1',NULL,NULL),(219,231,76,'Friday, April 21st',25,'https://canvas-lms.ga/courses/8/assignments/231',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:17','2020-10-13 09:20:17',NULL,'https://canvas-lms.ga/courses/8/assignments/231/submissions?zip=1',NULL,NULL),(220,286,76,'Monday, April 24th',25,'https://canvas-lms.ga/courses/8/assignments/286',8,'<p>Today in class: you will do chapter 7 test. You need to turn in your reviews online, yes the submission boxes are now open. </p>\n<p> </p>\n<p>Bell Ringer: What is the name for Ti(NO<sub>3</sub>)<sub>4</sub>? Remember transition metals have to include something to denote their charge. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:23','2020-10-13 09:20:52',NULL,'https://canvas-lms.ga/courses/8/assignments/286/submissions?zip=1',NULL,NULL),(221,373,76,'Tuesday, April 25th',25,'https://canvas-lms.ga/courses/8/assignments/373',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:33','2020-10-13 09:20:33',NULL,'https://canvas-lms.ga/courses/8/assignments/373/submissions?zip=1',NULL,NULL),(222,398,76,'Wednesday, April 26th',25,'https://canvas-lms.ga/courses/8/assignments/398',8,'<p>Today in class: we will be balancing equations!</p>\n<p>This is the absolute last day for mole projects!</p>\n<p> </p>\n<p> </p>\n<p>Bell ringer: What is a coefficient? Why when balancing equations must you change the coefficient not the subscripts on the atoms?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:36','2020-10-13 09:20:56',NULL,'https://canvas-lms.ga/courses/8/assignments/398/submissions?zip=1',NULL,NULL),(223,348,76,'Thursday, April 27th',25,'https://canvas-lms.ga/courses/8/assignments/348',8,'<p>Today in class: Balancing reactions and chemical reactions.</p>\n<p> </p>\n<p> </p>\n<p>Bell ringer:Tell what type of reaction, then write and balance the equation for</p>\n<p>copper (II) nitrate + sodium hydroxide -----&gt;copper (II) hydroxide + sodium nitrate </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:30','2020-10-13 09:20:30',NULL,'https://canvas-lms.ga/courses/8/assignments/348/submissions?zip=1',NULL,NULL),(224,232,76,'Friday, April 28th',25,'https://canvas-lms.ga/courses/8/assignments/232',8,'<p>Today in class: I have moved your lab to Monday, as per you unanimous requests. Today you will work on finishing the writing, balancing, and identifying equations from yesterday and do chapter 6 test corrections. </p>\n<p> </p>\n<p>Test corrections are worth half the credit lost.</p>\n<p> </p>\n<p>Bell Ringer: deal with it       <img src=\"https://canvas-lms.ga/courses/8/files/388/preview?verifier=47cyBOYuK49ckictLZbgAutjfXmAR4uPEhmMoQhS\" alt=\"sunglass emoji.png\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/388\" data-api-returntype=\"File\"></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:17','2020-10-13 09:20:17',NULL,'https://canvas-lms.ga/courses/8/assignments/232/submissions?zip=1',NULL,NULL),(225,314,76,'Quizlet',25,'https://canvas-lms.ga/courses/8/assignments/314',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:26','2020-10-13 09:20:53',NULL,'https://canvas-lms.ga/courses/8/assignments/314/submissions?zip=1',NULL,NULL),(226,296,76,'Monday, May 1st',25,'https://canvas-lms.ga/courses/8/assignments/296',8,'<p>Today in class, we will review chemical equations and reactions.</p>\n<p>Tomorrow: Chemical reactions lab! This is a test grade!!! So be sure to be here.</p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: Can you guess why we are having the lab tomorrow instead of today?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:24','2020-10-13 09:20:24',NULL,'https://canvas-lms.ga/courses/8/assignments/296/submissions?zip=1',NULL,NULL),(227,384,76,'Tuesday, May 2nd',25,'https://canvas-lms.ga/courses/8/assignments/384',8,'<p>Today in class: LAB!!!!</p>\n<p>Your Worksheets should be completed and turned in.</p>\n<p>You need your lab sheets that I handed out. One of them is your data sheet for this lab, and the other is the instruction sheet for this lab. </p>\n<p><strong>This lab counts as your chapter 8 test grade! Don\'t goober it up!!!!</strong></p>\n<p> </p>\n<p><strong>Bell Ringer:</strong> Define the terms: Aqueous, precipitate, solution, reactant, and product. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:34','2020-10-13 09:20:56',NULL,'https://canvas-lms.ga/courses/8/assignments/384/submissions?zip=1',NULL,NULL),(228,413,76,'Wednesday, May 3rd',25,'https://canvas-lms.ga/courses/8/assignments/413',8,'<p>Today in class: you will turn in your lab report.</p>\n<p>Then we will start chapter 9 on stoichiometry. You will need to be able to write and balance equations and to use that information as well as molecular weights to solve stoichiometry problems. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: why are the coefficients we use to balance our chemical equations called molar coefficients?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:38','2020-10-13 09:20:57',NULL,'https://canvas-lms.ga/courses/8/assignments/413/submissions?zip=1',NULL,NULL),(229,364,76,'Thursday, May 4th',25,'https://canvas-lms.ga/courses/8/assignments/364',8,'<p>May the 4th be with you!                      <img src=\"https://canvas-lms.ga/courses/8/files/395/preview?verifier=gpJAtTO3d3ilEGKFgzXM3D3kjY1eukZEJC7Tva53\" alt=\"Deal with it Yoda.jpg\" width=\"262\" height=\"288\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/395\" data-api-returntype=\"File\"></p>\n<p> </p>\n<p>Today in Class: we will work stoichiometry problems and start on Limiting reactants.</p>\n<p>Bell Ringer: Try to explain why we need to use the mole ratios from the balanced chemical equation when doing stoichiometry problems.</p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:32','2020-10-13 09:20:32',NULL,'https://canvas-lms.ga/courses/8/assignments/364/submissions?zip=1',NULL,NULL),(230,246,76,'Friday, May 5th',25,'https://canvas-lms.ga/courses/8/assignments/246',8,'<p>Today in class: Limiting reactants and Percent composition. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: what is the significance of Cinco de Mayo?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:19','2020-10-13 09:20:19',NULL,'https://canvas-lms.ga/courses/8/assignments/246/submissions?zip=1',NULL,NULL),(231,297,76,'Monday, May 8th',25,'https://canvas-lms.ga/courses/8/assignments/297',8,'<p>Today in class: Practice with limiting reactants and percent yield.</p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: What is a limiting reactant?</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:24','2020-10-13 09:20:52',NULL,'https://canvas-lms.ga/courses/8/assignments/297/submissions?zip=1',NULL,NULL),(232,385,76,'Tuesday, May 9th',25,'https://canvas-lms.ga/courses/8/assignments/385',8,'<p>Today in class: Stoichiometry test</p>\n<p> </p>\n<p>Then: Gas laws</p>\n<p> </p>\n<p>Bell ringer: Pick a partner for your test. Only 1 other person. </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:34','2020-10-13 09:20:34',NULL,'https://canvas-lms.ga/courses/8/assignments/385/submissions?zip=1',NULL,NULL),(233,412,76,'Wednesday, May 10th',25,'https://canvas-lms.ga/courses/8/assignments/412',8,'<p>Today in class: Work on and turn in Gas laws, once you are done with that, you need to work on your final review worksheet I gave you yesterday. </p>\n<p> </p>\n<p> </p>\n<p>Bell Ringer: without it being labeled, how can you determine which gas law equation you need to use? </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:38','2020-10-13 09:20:38',NULL,'https://canvas-lms.ga/courses/8/assignments/412/submissions?zip=1',NULL,NULL),(234,363,76,'Thursday, May 11th',25,'https://canvas-lms.ga/courses/8/assignments/363',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:32','2020-10-13 09:20:32',NULL,'https://canvas-lms.ga/courses/8/assignments/363/submissions?zip=1',NULL,NULL),(235,245,76,'Friday, May 12th',25,'https://canvas-lms.ga/courses/8/assignments/245',8,'<ul>\n</ul>',NULL,'2020-10-13 09:20:19','2020-10-13 09:20:19',NULL,'https://canvas-lms.ga/courses/8/assignments/245/submissions?zip=1',NULL,NULL),(236,271,76,'Lab Safety Video I',29,'https://canvas-lms.ga/courses/8/assignments/271',8,'<p>Watch the first two minutes and thirty seconds of this video.  </p>\n<p><video preload=\"none\" class=\"instructure_inline_media_comment\" data-media_comment_id=\"0_hm71pesg\" data-media_comment_type=\"video\" controls=\"controls\" poster=\"https://canvas-lms.ga/media_objects/0_hm71pesg/thumbnail?height=448&amp;type=3&amp;width=550\" src=\"https://canvas-lms.ga/courses/8/media_download?entryId=0_hm71pesg&amp;media_type=video&amp;redirect=1\" data-alt=\"\">this is a media comment</video></p>\n<p>In your composition notebook, make a list of all of the safety violations you see.  What safety rules would have eliminated these problems?  </p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:21','2020-10-13 09:20:22',NULL,'https://canvas-lms.ga/courses/8/assignments/271/submissions?zip=1',NULL,NULL),(237,272,76,'Lab Safety Video II',29,'https://canvas-lms.ga/courses/8/assignments/272',8,'<p>Watch the following video outlining all lab safety rules.  Also look at <a href=\"http://chem.answers.com/education/chemistry-lab-safety\">this site</a> which lists and explains some lab safety rules. <a id=\"\" href=\"http://chem.answers.com/education/chemistry-lab-safety\"><br></a></p>\n<p><a href=\"https://www.youtube.com/watch?v=1191ZkZUzH4\">Lab Safety Video</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:22','202