ourses/8/assignments/258/submissions?zip=1',NULL,NULL),(261,264,76,'How the World Wastes Food - Science in the News',29,'https://canvas-lms.ga/courses/8/assignments/264',8,'<p>We will read the article <a href=\"http://www.popsci.com/article/science/how-world-wastes-food-infographic\">\"How the World Wastes Food\"</a> from Popular Science\'s September Issue.  We will then work on writing a \"good\" summary as a class.</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:21','2020-10-13 09:20:21',NULL,'https://canvas-lms.ga/courses/8/assignments/264/submissions?zip=1',NULL,NULL),(262,265,76,'Indirect Measurement Lab Data',29,'https://canvas-lms.ga/courses/8/assignments/265',8,'<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"Indirect Measurement Lab.doc\" href=\"https://canvas-lms.ga/courses/8/files/387/download?verifier=SWzmAKr5H5jF8L3onpSRUpng68RmVma90I8BmS7p&amp;wrap=1\" target=\"\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/387\" data-api-returntype=\"File\">Indirect Measurement Lab</a></p>\n<p>Put your group\'s data on the <a href=\"https://docs.google.com/a/acs-k12.org/spreadsheets/d/1MnUP89vXs6qTpr6Dy4xWcy16UnAEXYpMFqqUHxmKUf8/edit?usp=sharing\">class data table</a>.  Once you have the data for the whole class., calculate the average for each measurement.  Use the average to calculate the % difference for each of your measurements.  Then, write a conclusion explaining what could have caused the differences.  % Difference = [(average - measured)/average] x 100</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:21','2020-10-13 09:20:21',NULL,'https://canvas-lms.ga/courses/8/assignments/265/submissions?zip=1',NULL,NULL),(263,193,76,'CH 2 Review WS',29,'https://canvas-lms.ga/courses/8/assignments/193',8,'<p><a href=\"https://docs.google.com/a/acs-k12.org/document/d/17AMCYhsZkbwczCHDyvlhIvWFkj3diGjaEEqk5xS1KOc/edit?usp=sharing\">CH 2 Review WS</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:13','2020-10-13 09:20:13',NULL,'https://canvas-lms.ga/courses/8/assignments/193/submissions?zip=1',NULL,NULL),(264,194,76,'CH 2 Review WS II',29,'https://canvas-lms.ga/courses/8/assignments/194',8,'<p><a href=\"https://docs.google.com/a/acs-k12.org/document/d/1n-aQ9nqb3h5qgL3vlFG1XyTZH4fsWl38B0KFGDHll8k/edit?usp=sharing\">CH 2 Review WS II</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:13','2020-10-13 09:20:13',NULL,'https://canvas-lms.ga/courses/8/assignments/194/submissions?zip=1',NULL,NULL),(265,192,76,'CH 2 Practice Test',29,'https://canvas-lms.ga/courses/8/assignments/192',8,'<p><a href=\"https://docs.google.com/a/acs-k12.org/document/d/1MLDCFj5I_l0fqqKskdAjYMiAwnye6tEEpX-e8uRnQ5w/edit?usp=sharing\">CH 2 Practice Test</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:13','2020-10-13 09:20:13',NULL,'https://canvas-lms.ga/courses/8/assignments/192/submissions?zip=1',NULL,NULL),(266,277,76,'Mass Number vs. Atomic Mass',29,'https://canvas-lms.ga/courses/8/assignments/277',8,'<p>Watch the videos <a href=\"http://www.youtube.com/watch?v=m15DWkkGe_0\">\"What is the Difference Between Mass Number and Atomic Mass?\"</a> and <a href=\"http://www.youtube.com/watch?v=ULRsJYhQmlo\">\"How to Calculate Atomic Mass Practice Problems.\"</a>  After watching, complete the <a href=\"https://docs.google.com/a/acs-k12.org/document/d/1B-EAoMJCO5GP44Z-KY7Ex81iU6ST4Lu1hwftuHboQWE/edit?usp=sharing\">Atomic Mass Practice Problems</a> in your composition book.  Come to class prepared with any questions you have.  We will be doing a lab to reinforce this concept.</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:22','2020-10-13 09:20:22',NULL,'https://canvas-lms.ga/courses/8/assignments/277/submissions?zip=1',NULL,NULL),(267,226,76,'Excited Elements Lab Questions',29,'https://canvas-lms.ga/courses/8/assignments/226',8,'<p><span>Excited Elements Lab Questions</span></p>\n<p><span><span> </span></span></p>\n<ol>\n<li>\n<p><span>Compare the color of light emitted by the spectrum tube to that observed through the spectroscope.  Explain any differences.</span></p>\n</li>\n<li>\n<p><span>Compare the spectrum of the fluorescent light to those of the gases you observed.  What gases do you think are in the fluorescent light bulb and why do you think that?</span></p>\n</li>\n<li><span>Identify a use of a spectroscope in the science of astronomy.</span></li>\n</ol>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:16','2020-10-13 09:20:16',NULL,'https://canvas-lms.ga/courses/8/assignments/226/submissions?zip=1',NULL,NULL),(268,197,76,'CH 5 Periodicity Review WS',29,'https://canvas-lms.ga/courses/8/assignments/197',8,'<p><a href=\"https://docs.google.com/a/acs-k12.org/document/d/1S7g7Pg-MCVbovjTijiyWMW7wB4wzrp9AkOkB-kC0kgA/edit?usp=sharing\">CH 5 Periodicity Review WS</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:13','2020-10-13 09:20:48',NULL,'https://canvas-lms.ga/courses/8/assignments/197/submissions?zip=1',NULL,NULL),(269,199,76,'CH 5 Review WS',29,'https://canvas-lms.ga/courses/8/assignments/199',8,'<p><a href=\"https://docs.google.com/a/acs-k12.org/document/d/1NCOGNwzSP0zD9FyhUiPWJGm3Pbv_QMuSDqtjWp5olZk/edit?usp=sharing\">CH 5 Review WS</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:13','2020-10-13 09:20:48',NULL,'https://canvas-lms.ga/courses/8/assignments/199/submissions?zip=1',NULL,NULL),(270,198,76,'CH 5 Practice Test',29,'https://canvas-lms.ga/courses/8/assignments/198',8,'<p><a href=\"https://docs.google.com/a/acs-k12.org/document/d/1FFONZcyf-f3oYdtnOsp7Sr2NKhVSUXkf60IIfpQBMgA/edit?usp=sharing\">CH 5 Practice Test</a></p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:13','2020-10-13 09:20:13',NULL,'https://canvas-lms.ga/courses/8/assignments/198/submissions?zip=1',NULL,NULL),(271,310,76,'Paint Chip Activity',29,'https://canvas-lms.ga/courses/8/assignments/310',8,'<p><strong>Paint Chip Activity</strong></p>\n<p> </p>\n<p>1.      Remove the color chips from the bag and place them on a flat surface, color side up.</p>\n<p>2.      Identify a property that you can use to divide the chips into groups.  </p>\n<p>3.      Identify a second property that you can use to order the chips from top to bottom within a group.</p>\n<p>4.      Use the properties you chose to arrange the chips into a table with rows and columns.</p>\n<p>5.      Your teacher deliberately left out a chip from each bag.  Decide where to leave a gap in your table for the missing chip.</p>\n<p> </p>\n<p><strong>Questions:  Talk about these questions with your partner.  Write the answers in your composition book.</strong></p>\n<p> </p>\n<p>1.      What property did you use to divide the color chips into groups?</p>\n<p>2.      What property did your use to arrange the chips within a group from top to bottom?</p>\n<p>3.      What pattern repeats across each row of your table?</p>\n<p>4.      Based on its location on your table, describe the missing chip.</p>\n<p>5.      Compare the process you used to construct your table to the process Mendeleev used to make his table.  Describe similarities and differences.</p>\n<ul>\n</ul>',NULL,'2020-10-13 09:20:26','2020-10-13 09:20:26',NULL,'https://canvas-lms.ga/courses/8/assignments/310/submissions?zip=1',NULL,NULL),(272,276,76,'Make a Mole Project',29,'https://canvas-lms.ga/courses/8/assignments/276',8,'<p><a href=\"https://docs.google.com/a/acs-k12.org/document/d/1-MHiOta9ItAYUm52yWQtHiOzyo6UsXhEszJlB8CQhWI/edit?usp=sharing\">Make a Mole Project</a></p>\n<p><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"Mole Pattern.pdf\" href=\"https://canvas-lms.ga/courses/8/files/380/download?verifier=6TCeUKfJi8gTUOjCn5r7AZ80Hi0kAXDJZbgBZILV&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/380\" data-api-returntype=\"File\">Mole Pattern.pdf</a><a id=\"\" class=\" instructure_scribd_file instructure_file_link\" title=\"Mole Pattern.pdf\" href=\"https://canvas-lms.ga/courses/8/files/380/download?verifier=6TCeUKfJi8gTUOjCn5r7AZ80Hi0kAXDJZbgBZILV&amp;wrap=1\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/8/files/380\" data-api-returntype=\"File\"><b