p your Questions of the Day. Click the Grey tab to open them. Complete the questions of the day/What is not like the other (scroll down) as I take attendance. </span>\n</div>\n<div><a style=\"font-family: inherit; font-size: 1rem;\" title=\"(6) September Question of the Day (ODD)\" href=\"https://canvas-lms.ga/courses/13/assignments/508\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/508\" data-api-returntype=\"Assignment\">(6) September Question of the Day (ODD)</a></div>\n<p> </p>\n</div>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:33','2020-10-28 14:15:33',NULL,'https://canvas-lms.ga/courses/13/assignments/504/submissions?zip=1',NULL,NULL),(340,503,76,'(6) Live Stream (Even)',48,'https://canvas-lms.ga/courses/13/assignments/503',13,'<div>\n<div><a href=\"https://meet.google.com/tfq-nrni-nkr\">Join Google Meet</a></div>\n<div>Or join by dialing <a href=\"tel:+1-585-491-8815,,496026657\">+1 585-491-8815 pin: 496026657</a>\n</div>\n<div><span>Conference ID: tfq-nrni-nkr</span></div>\n<div><span><a title=\"(6) September Question of the Day (ODD)\" href=\"https://canvas-lms.ga/courses/13/assignments/508\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/508\" data-api-returntype=\"Assignment\">(6) September Question of the Day (ODD)</a></span></div>\n</div>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:33','2020-10-28 14:15:33',NULL,'https://canvas-lms.ga/courses/13/assignments/503/submissions?zip=1',NULL,NULL),(341,623,76,'Digital Portfolio for the year',49,'https://canvas-lms.ga/courses/13/assignments/623',13,'<p><span style=\"font-size: 14pt;\">Throughout the year, you are to save all of your work in your google drive. You need to keep it organized under your social studies folder- divided into units. </span></p>\n<p><span style=\"font-size: 14pt;\">This digital portfolio is instead of keeping a notebook! You are collecting all your work in one place!</span></p>\n<p><span style=\"font-size: 14pt;\">You are given this template, to link all of your work from google drive into your portfolio and reflect on what you have learned. It will be due by the end of the year for a very large grade to show what you have learned! (directions on how to link are in the document). </span></p>\n<p><span style=\"font-size: 14pt;\">If you ever have free time in this class, near the end of a project, this is what you need to be working on! I will occasionally check in with you to see if you are keeping it up to date. </span></p>\n<p> </p>\n<p><span style=\"font-size: 14pt; background-color: #ffff00;\"><strong>Make a copy.</strong> Keep track of this copy- put under your social studies folder, but not under any unit folders. <a title=\"(6) 2019-2020 Student Portfolio-Grade 6 Social Studies (USI to 1865)\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F26224309\" target=\"_blank\">(6) 2019-2020 Student Portfolio-Grade 6 Social Studies (USI to 1865)</a></span></p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:50',NULL,'https://canvas-lms.ga/courses/13/assignments/623/submissions?zip=1',NULL,NULL),(342,632,76,'Self/peer evaluation (CBG)',49,'https://canvas-lms.ga/courses/13/assignments/632',13,'<p><span style=\"font-size: 18pt;\">Fill out this <a href=\"https://docs.google.com/forms/d/1XlsYG_p8FFsb3RjUKK_k9R7afSqPWqqHKt4kbcmgKM8/edit?usp=sharing\">google form- </a></span></p>\n<p><span>You need to score yourself and your peers out of 10 points. Just type the number. For example- just put 4, not 4/10. </span></p>\n<p><span>If you did not have a 4th or 5th person- just put N/A for everything. </span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:51','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/632/submissions?zip=1',NULL,NULL),(343,633,76,'Self/peer evaluation (Cougar Academy)',49,'https://canvas-lms.ga/courses/13/assignments/633',13,'<p><span style=\"font-size: 14pt;\">Answer and submit this<a href=\"https://docs.google.com/forms/d/1iKfY_vTskyb1O_ZU2yuZQXi5CBfvnmFrUjoZe7c5oRg/edit?usp=sharing\"> google form.</a> </span></p>\n<p><span>When you score yourself and your peers out of 10 points, just put a number. For example- just 4, not 4/10. </span></p>\n<p><span>If you did not have a 4th or 5th person- just put N/A for everything and click submit. </span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:51','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/633/submissions?zip=1',NULL,NULL),(344,502,76,'(6) Hook- not complete. ',50,'https://canvas-lms.ga/courses/13/assignments/502',13,'<ul>\n</ul>',NULL,'2020-10-28 14:15:33','2020-10-28 14:15:33',NULL,'https://canvas-lms.ga/courses/13/assignments/502/submissions?zip=1',NULL,NULL),(345,506,76,'(6) Practice Longitude and Latitude',50,'https://canvas-lms.ga/courses/13/assignments/506',13,'<p><span style=\"background-color: #ffff00;\">Click on the Grey Tab Below. </span></p>\n<p>It will open you to a google document. I want you to finish working on Longitude and Latitude, and then practice pressing Submit, the small Blue button in the top right hand corner. </p>\n<p>This will not tell you that you have submitted. But after you press the blue button, if you see a small black font time stamp under the blue title of the document, then it means that you have submitted! This is why we are doing the first few submissions together! So I can show you!</p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:33','2020-10-28 14:15:33',NULL,'https://canvas-lms.ga/courses/13/assignments/506/submissions?zip=1',NULL,NULL),(346,617,76,'(6) US Digital Regional Map',50,'https://canvas-lms.ga/courses/13/assignments/617',13,'<p><span style=\"background-color: #00ffff;\">Watch the instructions</span> to complete and submit your google map of the different US Regions. This is an individual assignment. </p>\n<ul>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400;\">Students will create a Google map depicting the location of the 8 Regions of the United States.  </span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400; background-color: #ffff00;\">At each location, students will include  the following information:</span></li>\n<ul>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400; background-color: #ffff00;\">Name of the region</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400; background-color: #ffff00;\">A written description of the region (including geography, climate, topography (hills/mountains/flat?) and any other special features such as access to water?</span></li>\n<li style=\"font-weight: 400;\"><span style=\"font-weight: 400; background-color: #ffff00;\">3-5 pictures of the region</span></li>\n</ul>\n</ul>\n</ul>\n<p> </p>\n<ul>\n<li><strong>Students will then Save their Google Map in their Social Studies Folder on the Google Drive and then Add their Google Map to the Canvas Assignment and Turn it in by clicking submit.   </strong></li>\n</ul>\n<p> </p>\n<p><a title=\"(6) Unit 1 Lesson 2 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25699677\" target=\"_blank\">(6) Unit 1 Lesson 2 Notes</a></p>\n<p><a title=\"(6) Unit 1 Lesson 2 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25699677\" target=\"_blank\"></a><a title=\"(6) Unit 1 Lesson 2 Slide show\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25699678\" target=\"_blank\">(6) Unit 1 Lesson 2 Slide show</a></p>\n<p>Then, click on this  discussion link. </p>\n<p><a style=\"font-family: sans-serif; font-size: 1rem;\" title=\"Where would you live? US Regions\" href=\"%24CANVAS_OBJECT_REFERENCE%24/discussion_topics/g81bf8ad8845528dd56903907698a25e2\" data-api-endpoint=\"https://mychesterfieldschools.instructure.com/api/v1/courses/86564/discussion_topics/152710\" data-api-returntype=\"Discussion\">Where would you live? US Regions</a><span style=\"font-family: sans-serif; font-size: 1rem;\"> It will take you to a discussion. Answer: If you could live in any region of the US, what would it be and why? Clearly state which region it would be and give at least 3 reasons. Complete sentences and correct grammar please. I grade for grammar!</span></p>\n<p><span style=\"background-color: #00ffff;\">Watch this video on how to submit your map!</span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:49','2020-10-28 14:15:49',NULL,'https://canvas-lms.ga/courses/13/assignments/617/submissions?zip=1',NULL,NULL),(347,529,76,'(6) Unit 1 PBL: Task 1- Jeopardy Geography Brainstorm!',50,'https://canvas-lms.ga/courses/13/assignments/529',13,'<p style=\"text-align: center;\"><span style=\"background-color: #ffff00; font-size: 18pt; color: #ff0000;\">Unit 1 PBL: Geography Jeopardy!</span></p>\n<p>You are going to prove what you know by creating a Jeopardy game quizzing on all of the Geography that you have learned! The best way to study is to be the one making the Quiz! Remember- you are the expert creating the questions! </p>\n<p><span style=\"background-color: #ffff00;\">Three total Tasks wiill make up this project! </span></p>\n<p>Task 1- You are going to make a <a href=\"http://Students%20included%20hyperlinked%20research%20URLs%20to%20each%20one%20of%20their%20questions%20that%20were%20not%20found%20directly%20from%20the%20HW.%20Everything%20is%20in%20their%20own%20words.\">copy of this jeopardy braiinstorm chart</a>/share with everyone in group/CCPS. Complete the brainstorm and submit via website URL. </p>\n<p>Task 2- (Next Canvas assignment)- You are going to take all of the questions and insert them into the Jeopardy Template that I provide for you.</p>\n<p>Task 3- After everyone submits, I will collect them in one google document, and share with you so that you can play each other\'s jeopardy games! I will take one of the most well-made Jeopardy games and use it to play with the class together! I will also send the best 3 games home in an email to parents so that the whole family can play! Make them good and know your Geography well! </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:36','2020-10-28 14:15:36',NULL,'https://canvas-lms.ga/courses/13/assignments/529/submissions?zip=1',NULL,NULL),(348,530,76,'(6) Unit 1 PBL: Task 2- Build Jeopardy Template!',50,'https://canvas-lms.ga/courses/13/assignments/530',13,'<p style=\"text-align: center;\"><span style=\"background-color: #ffff00; font-size: 18pt;\">Make final Jeopardy Game!</span></p>\n<p>Okay- so now take your previous brainstorm of questions and answers. Double check that they meet all of the requirements and that your grammar is correct. </p>\n<p> </p>\n<p>Simply make a copy of this <a href=\"https://docs.google.com/presentation/d/1FyJj1RNvnWe8w1SR4PaNYqhLIjNAlQMqvZa39dvKqHo/edit?usp=sharing\">Jeopardy Template. </a></p>\n<p>Title it- \"Your first and last name- Jeopardy Game\"</p>\n<p>Make sure that you change the share settings so that everyone in Chesterfield county can VIEW IT- NOT EDIT. </p>\n<p>Make sure you put it in your folder- Social studies- Unit 1 Geography. </p>\n<p> </p>\n<p>In order to submit, click- submit assignment, Website URL, and take the Website URL of the finished Jeopardy Template, and copy and paste it into the blank space. Then click submit assignment! </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:36','2020-10-28 14:15:36',NULL,'https://canvas-lms.ga/courses/13/assignments/530/submissions?zip=1',NULL,NULL),(349,525,76,'(6) Unit 1 Lesson 1 HW Questions/Quiz',51,'https://canvas-lms.ga/courses/13/assignments/525',13,'<p>To-do list every week. Monday- You recieve access to your weekly HW (Questions/Quiz). You will use the notes and power point that I give you to help you answer your Questions (in the grey tab at the bottom) and then you will complete the weekly Quiz. Both due by Sunday Night. </p>\n<p><a title=\"(6)  Unit 1 Lesson 1 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25245128\" target=\"_blank\">(6) Unit 1 Lesson 1 Notes</a><a title=\"(6) Unit 1 Lesson 1\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25245129\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 1 Lesson 1\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25245129\" target=\"_blank\">(6) Unit 1 Lesson 1 powerpoint</a></p>\n<p style=\"padding-left: 40px;\">Read notes. Look over powerpoint. You need to have Discovery Education open in another browser to open videos. </p>\n<p>Click on link Grey below at the very bottom! It will open in the new tab. You can go back and forth between Lesson notes and the questions to answer the questions.  </p>\n<p>When finished with the HW Questions- You must Also Complete the Quiz. Click here: <a title=\"(6) Unit 1 Lesson 1 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/526\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/526\" data-api-returntype=\"Assignment\">(6) Unit 1 Lesson 1 Quiz</a></p>\n<p> </p>\n<p><span style=\"background-color: #ffff00;\">But first submit the questions here!!!!</span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:36','2020-10-28 14:15:36',NULL,'https://canvas-lms.ga/courses/13/assignments/525/submissions?zip=1',NULL,NULL),(350,526,76,'(6) Unit 1 Lesson 1 Quiz- Requir