ga/courses/13/assignments/527/submissions?zip=1',NULL,NULL),(353,639,76,'Unit 1 Lesson 3 Notes and Questions HW',51,'https://canvas-lms.ga/courses/13/assignments/639',13,'<p>Read the following notes and slide show. </p>\n<p><a title=\"(6) Unit 1 Lesson 3 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23366374\" target=\"_blank\">(6) Unit 1 Lesson 3 Notes</a></p>\n<p><a title=\"(6) Unit 1 Lesson 3 Questions\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23366365\" target=\"_blank\"></a><a title=\"(6) Unit 1 Lesson 3 Slide show\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23366366\" target=\"_blank\">(6) Unit 1 Lesson 3 Slide show</a></p>\n<p><a title=\"(6) Unit 1 Lesson 3 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/528\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/528\" data-api-returntype=\"Assignment\">(6) Unit 1 Lesson 3 Quiz- Don\'t forget to do the quiz too, after you answer the questions!</a></p>\n<p>Then Answer the following questions in RED</p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:52','2020-10-28 14:15:52',NULL,'https://canvas-lms.ga/courses/13/assignments/639/submissions?zip=1',NULL,NULL),(354,528,76,'(6) Unit 1 Lesson 3 Quiz',51,'https://canvas-lms.ga/courses/13/assignments/528',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:36','2020-10-28 14:15:36',NULL,'https://canvas-lms.ga/courses/13/assignments/528/submissions?zip=1',NULL,NULL),(355,640,76,'Unit 1 Lesson 4 Notes and Questions',51,'https://canvas-lms.ga/courses/13/assignments/640',13,'<p>Read the Following notes.</p>\n<p><a title=\"(6) Unit 1 Lesson 4 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23370184\" target=\"_blank\">(6) Unit 1 Lesson 4 Notes</a></p>\n<p> </p>\n<p> </p>\n<p>Then answer the Following questions in red. Do this after you finish your Amazing Race</p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:52','2020-10-28 14:15:52',NULL,'https://canvas-lms.ga/courses/13/assignments/640/submissions?zip=1',NULL,NULL),(356,641,76,'Unit 1 Lesson 4 Quiz',51,'https://canvas-lms.ga/courses/13/assignments/641',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:52','2020-10-28 14:15:52',NULL,'https://canvas-lms.ga/courses/13/assignments/641/submissions?zip=1',NULL,NULL),(357,637,76,'Unit 1: Geography Packet',51,'https://canvas-lms.ga/courses/13/assignments/637',13,'<p><span style=\"font-size: 14pt;\">I will give you two maps. You are to follow these instructions and come in on test day with these maps labeled correctly. You do not submit online- this is a paper submission.</span></p>\n<p><span style=\"font-size: 14pt;\">Study- powerpoints, Notes, Question of the day, and former quizzes!</span></p>\n<p><span style=\"font-size: 14pt;\">This study guide counts as a HW grade. </span></p>\n<p><iframe style=\"width: 800px; height: 600px;\" title=\"(6) Unit 1: Grade Geography Packet\" src=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23370358\" width=\"800\" height=\"600\" allowfullscreen=\"allowfullscreen\" webkitallowfullscreen=\"webkitallowfullscreen\" mozallowfullscreen=\"mozallowfullscreen\" allow=\"autoplay *\"></iframe></p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:51','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/637/submissions?zip=1',NULL,NULL),(358,531,76,'(6) Unit 1 Test: Geography',51,'https://canvas-lms.ga/courses/13/assignments/531',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:36','2020-10-28 14:15:37',NULL,'https://canvas-lms.ga/courses/13/assignments/531/submissions?zip=1',NULL,NULL),(359,536,76,'(6) Unit 2 PBL- Task 1: Native American Research Chart',52,'https://canvas-lms.ga/courses/13/assignments/536',13,'<p style=\"text-align: center;\"><span style=\"font-weight: 400; background-color: #00ff00; font-size: 14pt;\"><strong>Collect/Research information Chart</strong></span></p>\n<p><span style=\"font-weight: 400;\">Task #1: </span> <span style=\"font-weight: 400;\">20 points______ <a href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/f6582cf6-2470-4e74-a3fc-77211c902619\"><span style=\"background-color: #ffcc00;\">Everyone watch my Instructional Video First!</span></a></span></p>\n<p><span style=\"font-weight: 400;\">Your group will select a Native American Indian Tribe from the tribes listed above and will research cultural information about them. Cultural information includes such things as: language, food, shelter, location, religious practices, clothing, recreation, festivals/celebrations, family organization, governmental structure, and technology. You can use online resources, encyclopedias (on-line or in the library), and books/magazines. You will collect and organize the data that your group gathers and determine the best way to display your findings.  This can be done either with project board displays, digital displays (powerpoints, prezis, videos etc..) or any form of media your group chooses to use.  </span></p>\n<p><a href=\"https://docs.google.com/document/d/1BhJ9eXNrZSv6xdbl4muyc4Pmvc_ieWzMaRUdAydkI3U/edit?usp=sharing\"><span style=\"font-weight: 400;\">Click on this link for a chart. (Make a copy and share with your group and everyone in Chesterfield County). </span></a></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:37','2020-10-28 14:15:37',NULL,'https://canvas-lms.ga/courses/13/assignments/536/submissions?zip=1',NULL,NULL),(360,540,76,'(6) Unit 2 PBL- Task 4:  Native American Dwelling',52,'https://canvas-lms.ga/courses/13/assignments/540',13,'<p>Native American Dwelling- Virtual Tour</p>\n<ul>\n<li>You will find 3 pictures that you will later put into your presentation and write a paragraph for each picture to teach about the Native American Dwelling and how they lived. Remember- you can research for more information as well as use your research chart to use information that you already collected!</li>\n</ul>\n<p><a href=\"https://docs.google.com/document/d/11Xuy2h57pJ-AyRKQHnpwOCbCQNwOWHgPrBGd6Gsy9_4/edit?usp=sharing\">Native American Preparation Chart- make a copy- share with everyone in group and in Chesterfield county</a></p>\n<p>Submit via Website URL. </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:38','2020-10-28 14:15:38',NULL,'https://canvas-lms.ga/courses/13/assignments/540/submissions?zip=1',NULL,NULL),(361,538,76,'(6) Unit 2 PBL- Task 3:  Food Dish',52,'https://canvas-lms.ga/courses/13/assignments/538',13,'<p style=\"text-align: center;\"><span style=\"font-weight: 400; background-color: #ffff00; font-size: 14pt;\">Task 3: Research a Food Dish and Recipe!</span></p>\n<p><span style=\"background-color: #ffff00;\"><a style=\"background-color: #ffff00;\" href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/d411204a-5ca4-4470-a622-8960ca682cb2\"><span style=\"font-weight: 400;\">Everyone watch my instructional video</span></a></span></p>\n<p><a href=\"https://docs.google.com/document/d/1687vxL0mBkwxGmdwaqq0ars2Vk54muB4PsDRHigsWo0/edit?usp=sharing\"><span style=\"font-weight: 400;\">Food Dish Preparation research (click and make a copy- share with your group/everyone in Chesterfield county). </span></a></p>\n<p><span style=\"font-weight: 400;\">Your exhibit must include a food dish associated with your tribe\'s culture and pictures/video/recipe.  Your exhibit must include the recipe which includes an ingredients list. </span></p>\n<p>Be prepared to be able to describe and talk about the food dish that you research and present. </p>\n<p>One person submit via website URL. </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:38','2020-10-28 14:15:38',NULL,'https://canvas-lms.ga/courses/13/assignments/538/submissions?zip=1',NULL,NULL),(362,537,76,'(6) Unit 2 PBL- Task 2:  Map of Tribal Area',52,'https://canvas-lms.ga/courses/13/assignments/537',13,'<p><span style=\"background-color: #ffff00; font-size: 18pt;\"><strong>Prepare map depicting Native American tribal area</strong></span></p>\n<p><a href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/7dba9fac-2242-406d-a2f3-8aa0624b2aec\"><span style=\"font-size: 12pt;\"><strong>Everyone watch my instruction video- click here. </strong></span></a></p>\n<p><span style=\"font-weight: 400;\">You will prepare a map marking (digitally color your map) the ancestral (original) living area of the Native American group you selected.  Please describe the location, geography, climate, and how that affected their life style In at least 1 paragraph of 5 sentences or more.  You will be able to copy and paste your labeled map into your power point presentation later, where you will also make a video reciting your paragraph of information about the geography! </span></p>\n<p><span style=\"font-weight: 400;\">Essentially- you are creating and preparing remarks for when you put your entire presentation together!</span></p>\n<p><a href=\"https://docs.google.com/drawings/d/1QSCUMXL9eoCHJFuaCWex39WnmLkwxD9aTgN7hHqgeRM/edit?usp=sharing\"><span style=\"font-weight: 400;\">Click Link for map- Make a copy- share with everyone in chesterfield county and your team. </span></a></p>\n<p><span style=\"font-weight: 400;\">Submit via website URL. </span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:37','2020-10-28 14:15:37',NULL,'https://canvas-lms.ga/courses/13/assignments/537/submissions?zip=1',NULL,NULL),(363,539,76,'(6) Unit 2 PBL- Task 4: Final Power point- narration included (NEED TO EDIT)',52,'https://canvas-lms.ga/courses/13/assignments/539',13,'<p>Final Stage! Watch this instruction video!</p>\n<p>You will now record your voice and link to your recordings within your power point! </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:38','2020-10-28 14:15:38',NULL,'https://canvas-lms.ga/courses/13/assignments/539/submissions?zip=1',NULL,NULL),(364,541,76,'(6) Unit 2 PBL- Task 4: Power Point Presentation (without Narration videos included)',52,'https://canvas-lms.ga/courses/13/assignments/541',13,'<p><a href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/f6582cf6-2470-4e74-a3fc-77211c902619\">Task 4: Preparing the Power Point Presentation Template</a></p>\n<p>Click on the Template and start to insert pictures, some information (but do not make very wordy!)</p>\n<p>In the last few slides, you will go back to your research chart topics and make slides on the topics we did not have a specific task for. Add in the pictures and you write in the script for your 1 minute video so I can give you feedback on those scripts (but know you will turn that into a video and take away the words from your power point. </p>\n<p>This stage is so I can make sure I give you feedback on your overall presentation of the work, before you start working on the naration videos, so that if you have something that needs fixing, you can fix it before getting distracted by the video work! </p>\n<p>One person submit via website URL. </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:38','2020-10-28 14:15:38',NULL,'https://canvas-lms.ga/courses/13/assignments/541/submissions?zip=1',NULL,NULL),(365,624,76,'Final Presentation- I graded using paper rubrics during the exhibit. ',52,'https://canvas-lms.ga/courses/13/assignments/624',13,'<p>I took all of the grades on the exhibit night! But I did this on paper! I feel that I have given much verbal feedback, and to get everything in on time, I don\'t have time to give enough written feedback. </p>\n<p> </p>\n<p>If you don\'t understand your grade, just ask and I will put out my paper rubric and go over it with you!</p>\n<p> </p>\n<p>This was just to put all the grades by group so that I can transfer the grades to synergy easier. </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:50',NULL,'https://canvas-lms.ga/courses/13/assignments/624/submissions?zip=1',NULL,NULL),(366,532,76,'(6) Unit 2: Lesson 1 Notes and Questions',53,'https://canvas-lms.ga/courses/13/assignments/532',13,'<p>Read the Lesson\'s Notes and look over the slide show as well. Here are the links. They should open in a new tab. </p>\n<p><a title=\"(6)  Unit 2 Lesson 1 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23675198\" target=\"_blank\">(6) Unit 2 Lesson 1 Notes</a></p>\n<p><span style=\"background-color: #ffff00;\">There is no slideshow for this lesson, just use the notes for the questions and quiz. </span></p>\n<p><span style=\"background-color: #ffff00;\"><a style=\"background-color: #ffff00;\" title=\"(6) Unit 2 Lesson 1 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/533\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/533\" data-api-returntype=\"Assignment\">(6) Unit 2 Lesson 1 Quiz</a></span></p>\n<p><span style=\"background-color: #ffff00;\">Answer the questions and the quiz- questions found below. You have to make sure that you submit!</span></p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:37','2020-10-28 14:15:37',NULL,'https://canvas-lms.ga/courses/13/assignments/532/submissions?zip=1',NULL,NULL),(367,533,76,'(6) Unit 2 Lesson 1 Quiz',53,'https://canvas-lms.ga/courses/13/assignments/533',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:37','2020-10-28 14:15:37',NULL,'https://canvas-lms.ga/courses/13/assignments/533/submissions?zip=1',NULL,NULL),(368,642,76,'Uni