ture.com%2Flti%2Fcontent-view%2Frce%2F29515361\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 3 Lesson 1 Slideshow\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F29515361\" target=\"_blank\">(6) Unit 3 Lesson 1 Slideshow</a></p>\n<p>When you are finished, please answer the following questions <span style=\"background-color: #ffff00;\">(click on Grey tab below to open up questions tab)</span> and type your answers in RED and submit by the due date. Make sure to submit and double check that you submitted!</p>\n<p><a title=\"(6) Unit 3 Lesson 1 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/545\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/545\" data-api-returntype=\"Assignment\">(6) Unit 3 Lesson 1 Quiz</a></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:38','2020-10-28 14:15:38',NULL,'https://canvas-lms.ga/courses/13/assignments/544/submissions?zip=1',NULL,NULL),(376,546,76,'(6) Unit 3 Lesson 2 Questions',54,'https://canvas-lms.ga/courses/13/assignments/546',13,'<p>Read the Lesson\'s Notes and look over the slide show as well. Here are the links. They should open in a new tab. </p>\n<p><a title=\"(6) Unit 1 Lesson 3 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F23675784\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 3 Lesson 2 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F29515378\" target=\"_blank\">(6) Unit 3 Lesson 2 Notes</a><a title=\"(6) Unit 3 Lesson 2 Slideshow\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F29515379\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 3 Lesson 2 Slideshow\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F29515379\" target=\"_blank\">(6) Unit 3 Lesson 2 Slideshow</a></p>\n<p>When you are finished, please answer the following questions<span style=\"background-color: #ffff00;\"> (click on Grey tab below to open up questions tab)</span> and type your answers in RED and submit by the due date. Make sure to submit and double check that you submitted!</p>\n<p><a title=\"(6) Unit 3 Lesson 2 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/547\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/547\" data-api-returntype=\"Assignment\">(6) Unit 3 Lesson 2 Quiz</a></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:39','2020-10-28 14:15:39',NULL,'https://canvas-lms.ga/courses/13/assignments/546/submissions?zip=1',NULL,NULL),(377,547,76,'(6) Unit 3 Lesson 2 Quiz',54,'https://canvas-lms.ga/courses/13/assignments/547',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:39','2020-10-28 14:15:39',NULL,'https://canvas-lms.ga/courses/13/assignments/547/submissions?zip=1',NULL,NULL),(378,552,76,'(6) Unit 3 Study Guide',54,'https://canvas-lms.ga/courses/13/assignments/552',13,'<p><span style=\"font-size: 12pt; background-color: #ffff00;\">Answer study guide questions (click on grey tab below!) and submit!</span></p>\n<p>Study notes, study question of the day, study old quizzes. </p>\n<p><span style=\"font-size: 18pt;\">You need to ACTIVELY STUDY. Put some of the questions and information into your own written chart or make flashcards to go with each explorer! </span></p>\n<p><span style=\"font-size: 18pt;\">Or answer all the questions and then put the study guide questions and answers into flashcards to study. </span></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:39','2020-10-28 14:15:39',NULL,'https://canvas-lms.ga/courses/13/assignments/552/submissions?zip=1',NULL,NULL),(379,553,76,'(6) Unit 3 Test: Exploration',54,'https://canvas-lms.ga/courses/13/assignments/553',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:40','2020-10-28 14:15:40',NULL,'https://canvas-lms.ga/courses/13/assignments/553/submissions?zip=1',NULL,NULL),(380,550,76,'(6) Unit 3 PBL: Google Draw Leadership Web (team)',55,'https://canvas-lms.ga/courses/13/assignments/550',13,'<p><strong> Part  2 - Building Questions and Getting Organized-</strong></p>\n<p><span style=\"font-weight: 400;\">If you and your shipmates were faced with a long journey on dangerous and uncharted seas, what qualities would you want in your leader? You wouldn\'t want to end up in the middle of the ocean with just any old captain! </span></p>\n<p><span style=\"background-color: #ffff00;\"><span style=\"font-weight: 400;\">With your team able you will brainstorm a list of qualities of a good leader. When your table has a sizable list, you will choose</span> <strong>four</strong> </span><span style=\"font-weight: 400;\"><span style=\"background-color: #ffff00;\">leadership qualities.</span> Make a web of the qualities you choose like the example below. </span><span style=\"font-weight: 400;\"> Use Google Draw to create your web.  Save it in your Social Studies Sub Folder titled Unit 3- Explorers. Title your Google Drawing Qualities of a Great Leader.</span></p>\n<p><a href=\"https://docs.google.com/document/d/1RcpqP70QiFBrXd2wNH6GYeoFgIoTxx1UFQrqHgxrOKw/edit?usp=sharing\"><span style=\"font-weight: 400;\">Click Here for Example of Google Draw Leadership Web</span></a></p>\n<p><span style=\"font-weight: 400;\">To turn in- one person from the group click SUBMIT, WEB URL- it has to be shared with everyone in chesterfield county for me to see it. Turn in before moving onto the next part of the module. </span></p>\n<p> </p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:39','2020-10-28 14:15:39',NULL,'https://canvas-lms.ga/courses/13/assignments/550/submissions?zip=1',NULL,NULL),(381,551,76,'(6) Unit 3 PBL: Research all explorers (team)',55,'https://canvas-lms.ga/courses/13/assignments/551',13,'<p>Research all four explorers. <a href=\"https://docs.google.com/document/d/1DxiqOo9vLCDJGTRBeIs5y7dyQi9wvRd0HtuJCi9VP70/edit?usp=sharing\"> Use this chart (make a copy and share with each other. Everyone needs to contribute to the explorer research).</a></p>\n<p><strong>Use Rubric below to see how I will grade you on your research- this is worth 50% of your final PBL grade. </strong></p>\n<p><span style=\"background-color: #ffff00;\">To turn in-</span> first everyone save it to their unit 3 social studies folder. One person- press SUBMIT and then chose WEBSITE URL. Make sure share settings are set to \"everyone in chesterfield county can view\"</p>\n<p><a href=\"https://docs.google.com/document/d/1XtkZzkNB06hThhBHHEjfMiDf5_6nbjKzWoVqeci1vVI/edit?usp=sharing\"><strong>Some links to get you started on your research. </strong></a></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:39','2020-10-28 14:15:39',NULL,'https://canvas-lms.ga/courses/13/assignments/551/submissions?zip=1',NULL,NULL),(382,548,76,'(6) Unit 3 PBL: Debate preparation',55,'https://canvas-lms.ga/courses/13/assignments/548',13,'<p>After we have all researched as much as we can on the different explorers, before we start writing, we are going to have a live debate! If we practice debating, the writing will come very easily!</p>\n<p style=\"padding-left: 40px;\">In a debate, one person will start off saying their explorer was the best leader because he was the most (leadership quality... such as brave). And then you would give an example of that bravery. </p>\n<p style=\"padding-left: 40px;\">Then I will call on someone else and they will make the argument that their person is more brave or better because their explorer was more honest! Or they could even say- well at least my explorer... did not ... like your explorer...</p>\n<p>The debate will consist of comparing different leadership qualities with EVIDENCE! With no evidence, you do not have a strong argument!</p>\n<p><a href=\"https://docs.google.com/document/d/1_KqD0UnVVWO_vLy3ZfX7X9gK0CmUP2c-_wXayGvKjZc/edit?usp=sharing\">Make a copy of the debate prep,</a> share with your group and everyone in Chesterfield county. Use your research chart to prepare for your debate! Once finished, go into your group google meet and practice debating so that your group can win in the class-wide live debate! You need to be prepared so that everyone can practicipate in the debate at least once!</p>\n<p>Submit via website URL</p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:39','2020-10-28 14:15:39',NULL,'https://canvas-lms.ga/courses/13/assignments/548/submissions?zip=1',NULL,NULL),(383,549,76,'(6) Unit 3 PBL: Final research paper (individual part)',55,'https://canvas-lms.ga/courses/13/assignments/549',13,'<p>Now that you have all this research and it is all turned in, look it over and decide which explorer you want to write about. This is an individual paper. You do not have to write about the same explorer as someone at your table. </p>\n<p> </p>\n<p><a href=\"https://docs.google.com/document/d/1Ns4Txm6lOea2jj_Yy7AVGdh7YcltHyG7JHxT9Kqv9iI/edit?usp=sharing\">Instructions for how to write your research paper -</a> step by step instructions as to how you should write your research paper. have this up in another tab next to your paper. </p>\n<p>By a certain date, I want you to all be done with your papers so that you can peer edit them in class. If we are not working in class and are using our computers for anything else, I will confiscate your computer and will call home. </p>\n<p>To turn in- submit via web url. </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:39','2020-10-28 14:15:39',NULL,'https://canvas-lms.ga/courses/13/assignments/549/submissions?zip=1',NULL,NULL),(384,554,76,'(6) Unit 4 Lesson 1 Questions/Quiz',56,'https://canvas-lms.ga/courses/13/assignments/554',13,'<p><a title=\"(6) Unit 4 Lesson 1 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F31948617\" target=\"_blank\">(6) Unit 4 Lesson 1 Notes</a></p>\n<p><a title=\"(6) Unit 4 Lesson 1 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F31948617\" target=\"_blank\"></a><a title=\"(6) Unit 4 Lesson 1 Slide show\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F31948618\" target=\"_blank\">(6) Unit 4 Lesson 1 Slide show</a></p>\n<p> </p>\n<p><a title=\"(6) Unit 4 Lesson 1 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/555\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/555\" data-api-returntype=\"Assignment\">(6) Unit 4 Lesson 1 Quiz</a></p>\n<p>Answer quiz after answering questions using notes/slideshow. <span style=\"background-color: #ffff00;\">Click on grey tab below to answer questions. Remember to press submit!</span></p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:40','2020-10-28 14:15:40',NULL,'https://canvas-lms.ga/courses/13/assignments/554/submissions?zip=1',NULL,NULL),(385,555,76,'(6) Unit 4 Lesson 1 Quiz',56,'https://canvas-lms.ga/courses/13/assignments/555',13,'<ul>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:40','2020-10-28 14:15:40',NULL,'https://canvas-lms.ga/courses/13/assignments/555/submissions?zip=1',NULL,NULL),(386,556,76,'(6) Unit 4 Lesson 2 Questions/Quiz',56,'https://canvas-lms.ga/courses/13/assignments/556',13,'<div class=\"description user_content enhanced\">\n<p><a title=\"(6) Unit 4 Lesson 2 Notes\" h