d.instructure.com%2Flti%2Fcontent-view%2Frce%2F38177387\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 6 Lesson 3 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F38177387\" target=\"_blank\">(6) Unit 6 Lesson 3 Notes</a></p>\n<p>Then take the quiz- <a title=\"(6) Unit 6 Lesson 3 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/584\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/584\" data-api-returntype=\"Assignment\">(6) Unit 6 Lesson 3 Quiz</a></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:44','2020-10-28 14:15:44',NULL,'https://canvas-lms.ga/courses/13/assignments/583/submissions?zip=1',NULL,NULL),(415,584,76,'(6) Unit 6 Lesson 3 Quiz',60,'https://canvas-lms.ga/courses/13/assignments/584',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:44','2020-10-28 14:15:44',NULL,'https://canvas-lms.ga/courses/13/assignments/584/submissions?zip=1',NULL,NULL),(416,582,76,'(6) Unit 6 Lesson 3 classwork- due 3/27',60,'https://canvas-lms.ga/courses/13/assignments/582',13,'<p>Do this classwork that goes with Unit 6, Lesson 3. Due by Friday 3/27.</p>\n<p>Click on Grey tab and make sure you press the blue submit button. </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:44','2020-10-28 14:15:44',NULL,'https://canvas-lms.ga/courses/13/assignments/582/submissions?zip=1',NULL,NULL),(417,589,76,'(6) Unit 6 Study Guide',60,'https://canvas-lms.ga/courses/13/assignments/589',13,'<p>Study for test. Flashcards. Notes. Videos. </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:45','2020-10-28 14:15:45',NULL,'https://canvas-lms.ga/courses/13/assignments/589/submissions?zip=1',NULL,NULL),(418,590,76,'(6) Unit 6 Test',60,'https://canvas-lms.ga/courses/13/assignments/590',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:45','2020-10-28 14:15:45',NULL,'https://canvas-lms.ga/courses/13/assignments/590/submissions?zip=1',NULL,NULL),(419,585,76,'(6) Unit 6 PBL- Task 1- Research chart',61,'https://canvas-lms.ga/courses/13/assignments/585',13,'<p><span style=\"font-size: 24pt; color: #ff0000;\"><strong>U.S. Constitution PBL</strong></span></p>\n<p>Students will assume the role of Constitutional scholars who have been hired to summarize the Constitution for new citizens who are preparing to take the American citizenship test..  As part of this task, you will be assigned a group and are expected to produce a product that encapsulates the ideals and principles of the American democracy with an engaging and entertaining display.</p>\n<p>The United States Citizenship and Immigration Service is hiring student groups to educate prospective citizens with displays that crystallize the Constitution.  Students will be asked to consider, then act upon the following idea- Jefferson said at the founding of our nation, “The price of freedom is eternal vigilance”, yet many Americans have little understanding of the government and liberties enshrined in the Constitution. Can you stem this tide?  Can you bring the Constitution alive to the people before our democracy withers?</p>\n<p>Informed citizens in the American democracy analyze the Constitution as a ‘living’ document to understand how their system of government endured the evolution of society and faced multiple challenges for over two centuries while enabling American citizens to define and defend their essential liberties.</p>\n<p><span style=\"color: #ff0000;\"><strong>Driving Question</strong></span></p>\n<p><span style=\"background-color: #ffff00;\">What does an immigrant in the United States need to know about the U.S. Constitution in order to become a U.S. citizen?  </span></p>\n<p><strong>Tasks</strong></p>\n<p>1) Complete the <a href=\"https://docs.google.com/document/d/11ezpqyDzT7yfz_qYd7taNJogIEztZ2SMTRDBmbyeaYk/edit?usp=sharing\">research chart</a> with links that I have provided you. Be sure to summarize when asked to do so. N0 more than 5 sentences to summarize, but no less than 3 sentences.</p>\n<p>2) Read and learn what immigrants must know to become a U.S. Citizen</p>\n<p><a class=\"external\" href=\"https://www.uscis.gov/sites/default/files/USCIS/Office%20of%20Citizenship/Citizenship%20Resource%20Center%20Site/Publications/100q.pdf\" target=\"_blank\">Copy of Citizenship test with answers</a></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:44','2020-10-28 14:15:44',NULL,'https://canvas-lms.ga/courses/13/assignments/585/submissions?zip=1',NULL,NULL),(420,586,76,'(6) Unit 6 PBL: Task 2- Graphic Organizers',61,'https://canvas-lms.ga/courses/13/assignments/586',13,'<ol start=\"3\">\n<li><span style=\"font-weight: 400;\"> Complete the following worksheets and  graphic organizers, or create one of your own, to show your understanding of Constitutional concepts.  You must go to File make a copy of each document and then get a shareable link.  You may want to use some of these graphic organizers on your display board.  </span></li>\n</ol>\n<p><span style=\"font-weight: 400;\">To turn in, click this<span style=\"font-size: 14pt;\"><a href=\"https://docs.google.com/document/d/1X9Mf3ZGKHMVaGvMwQRjmMuzioodg_-erOg4fg0elyok/edit?usp=sharing\"><span style=\"background-color: #ffff00;\"> Turn in page</span> </a></span>and copy and paste all shareable links to this google doc of all your graphic organizers. Share this document with me and all the documents with me. </span></p>\n<p> </p>\n<p><span style=\"background-color: #ffff00;\"> 2 points off for every sharable link that I do not have access to. </span></p>\n<p><span style=\"background-color: #ffff00;\">Total of 25 points</span></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:44','2020-10-28 14:15:44',NULL,'https://canvas-lms.ga/courses/13/assignments/586/submissions?zip=1',NULL,NULL),(421,626,76,'Make Studio Video- present at least 3 graphic organizers',61,'https://canvas-lms.ga/courses/13/assignments/626',13,'<p>Unfortunately, with all this time being taken off, I am going to have to take our display presentation and turn this into a DIGITAL project. </p>\n<p>You will record a video of yourself and your screen. You will teach at least 3 of your graphic organizers. </p>\n<ul>\n<li>1st- the 3 branches of government</li>\n<li>2nd- the bicameral legislation (make sure to explain the Great Compromise)</li>\n<li>3rd- your choice. </li>\n</ul>\n<p>You have to teach! I showed each class how to do this. Talk about each one for around 2 minutes each. I modeled for you in class how to teach- start large. With basic definitions and a overview summary (go back and see your researched summaries), and then explain the specifics. </p>\n<p> </p>\n<p><a href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/42e755bd-7b87-448c-b2c7-5989c2c72ecd\">Watch this video</a> to see my instructions on how to make and SHARE a studio video with me. Here are written instructions on how to use the <a href=\"https://community.canvaslms.com/docs/DOC-14584-50736857577\">recording system. </a></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:50',NULL,'https://canvas-lms.ga/courses/13/assignments/626/submissions?zip=1',NULL,NULL),(422,587,76,'(6) Unit 6 PBL: Task 3- Constitution Display Board',61,'https://canvas-lms.ga/courses/13/assignments/587',13,'<p><span style=\"font-weight: 400; font-size: 14pt;\">Display Board/Presentation</span></p>\n<p><span style=\"font-weight: 400; font-size: 14pt;\">Your team will create a display board and a presentation on the U.S. Constitution that you will use to teach immigrants about the U.S. Constitution who will be taking the Naturalization and Citizenship test. </span></p>\n<p>You must include:</p>\n<ul>\n<li>A large centered Title</li>\n<li>At least 5 graphic organizers</li>\n<li><strong>The information you do not include in the graphic organizers- you need to type out in a few sentences explaining the information. </strong></li>\n<li>Headings for all of your different pieces of information.</li>\n<li>Very organized. </li>\n<li>Decorate and make your board look eye catching and creative!</li>\n<li>You will need to practice teaching your display board as if you were teaching Immigrants studying for the test. You will need to practice! </li>\n</ul>\n<p>Your Display Board needs to be well organized, include a holistic summary of everything they need to know about the US Constitution.</p>\n<p><span style=\"font-weight: 400;\">All information needs to be accurate and presented on your board in a way that is easy to understand! Key points will be made clear without the viewer having to find extra information.</span></p>\n<p> </p>\n<p><span style=\"font-weight: 400;\"><span style=\"background-color: #ffff00;\">Read the Rubric below!</span> </span></p>\n<p><span style=\"font-weight: 400; background-color: #ffff00;\">Upload a picture when finished!!!</span></p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:44','2020-10-28 14:15:44',NULL,'https://canvas-lms.ga/courses/13/assignments/587/submissions?zip=1',NULL,NULL),(423,505,76,'(6) Participation points/ 10 points. ',61,'https://canvas-lms.ga/courses/13/assignments/505',13,'<p>I will keep track using my paper gradebook. </p>\n<p>If I have to talk to you about staying on track, being more productive in class, talking over me when I am giving instructions, messing around, having too much \"fun,\" socializing about things that do not have to do with class, and more. </p>\n<p>Anything that I deem not class related or not your most productive work. If I have to address you more than 3 times during this ENTIRE PROJECT, I will start taking from your project grade- which is a test grade. </p>\n<p>Meaning, if you group receives an 80, then you will receive a 70. </p>\n<p>I should not have to tell you over and over. You will see it affect your individual grade.  This is up to my discretion. </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:33','2020-10-28 14:15:33',NULL,'https://canvas-lms.ga/courses/13/assignments/505/submissions?zip=1',NULL,NULL),(424,588,76,'(6) Unit 6 PBL: Task 4- Group Presentation of Board',61,'https://canvas-lms.ga/courses/13/assignments/588',13,'<p>Everyone needs to present their board together as a team! You will need to practice this because your oral presentation in front of the class is worth 20 possible points!</p>\n<p><span style=\"color: #ff0000;\"><strong>Remember, the goal is to teach with the objective of teaching people what they need to know about the US Constitution for the Immigration Test. </strong></span></p>\n<p>Presentation grade is 10 points.</p>\n<ul>\n<li>Eye contact and body facing the audience.</li>\n<li>voice projection</li>\n<li>Clear organization and coordination with team</li>\n<li>Smoothly uses the visual aids that you are presenting into your explanation</li>\n<li>Uses Expert tone. </li>\n<li>Seems very prepared and practiced for this for this presentation.</li>\n<li>Everyone participated equally in the group.</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:44','2020-10-28 14:15:45',NULL,'https://canvas-lms.ga/courses/13/assignments/588/submissions?zip=1',NULL,NULL),(425,592,76,'(6) Unit 7 Lesson 1 Questions/Quiz',62,'https://canvas-lms.ga/courses/13/assignments/592',13,'<p><a title=\"(6) Unit 7 Lesson 1 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F40198887\" target=\"_blank\">(6) Unit 7 Lesson 1 Notes</a></p>\n<p><a title=\"(6) Unit 7 Lesson 1 Slide Show\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F40198888\" target=\"_blank\">(6) Unit 7 Lesson 1 Slide Show</a></p>\n<p>Answer Questions in grey tab- you will take a quiz next week on lessons 1 and 2. NO quiz this week. </p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:45','2020-10-28 14:15:45',NULL,'https://canvas-lms.ga/courses/13/assignments/592/submissions?zip=1',NULL,NULL),(426,593,76,'(6) Unit 7 Lesson 2 Questions/Quiz',62,'https://canvas-lms.ga/courses/13/assignments/593',13,'<p><a title=\"(6) Unit 7 Lesson 2 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F40198889\" target=\"_blank\">(6) Unit 7 Lesson 2 Notes</a></p>\n<p><a title=\"(6) Unit 7 Lesson 2 Slide Show\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F40198891\" target=\"_blank\">(6) Unit 7 Lesson 2 Slide Show</a></p>\n<p>Answer questions. Then take quiz-<a title=\"(6) Unit 7 Lesson 1 and 2 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/591\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/591\" data-api-returntype=\"Assignment\">(6) Unit 7 Lesson 1 and 2 Quiz</a></p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:45','2020-10-28 14:15:45',NULL,'https://canvas-lms.ga/courses/13/assignments/593/submissions?zip=1',NULL,NULL),(427,591,76,'(6) Unit 7 Lesson 1 and 2 Quiz',62,'https://canvas-lms.ga/courses/13/assignments/591',13,'<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:45','2020-10-28 14:15:45',NULL,'https://canvas-lms.ga/courses/13/assignments/591/submissions?zip=1',NULL,NULL),(428,594,76,'(6) Unit 7 Lesson 3 Questions/Quiz',62,'https://canvas-lms.ga/courses/13/assignments/594',13,'<p><a title=\"(6) Unit 7 Lesson 3 Notes\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F40198892\" target=\"_blank\">(6) Unit 7 Lesson 3 Notes</a></p>\n<p><a title=\"(6) Unit 7 Lesson 