m the notes need to be included in your scrapbook in some way. Everything needs to be in your own words.</li>\n<li>You may do extra research but be sure to include links to the websites/pictures. </li>\n<li><span>You need to include a link to the next infographic on the previous one- so they all link together. For every link that is not share d with (EVERYONE IN CHESTERFIELD COUNTY) will be -3 points. </span></li>\n</ul>\n</li>\n</ul>\n<ol>\n<li><span>Major Battles and Events </span></li>\n</ol>\n<p> </p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:48','2020-10-28 14:15:48',NULL,'https://canvas-lms.ga/courses/13/assignments/612/submissions?zip=1',NULL,NULL),(451,508,76,'(6) September Question of the Day (ODD)',65,'https://canvas-lms.ga/courses/13/assignments/508',13,'<p>For your warm up-Every day answer the \"Question of the Day\" and \"What is not like the other\" for the day\'s class period. </p>\n<p>If you do not know the answer, then at least write the question/what is not like the other- into the day\'s slot and we will go over it as a class 5 minutes later. </p>\n<p>At the end of the month, you will press submit. You only have to press submit at the end of the month. </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:34','2020-10-28 14:15:34',NULL,'https://canvas-lms.ga/courses/13/assignments/508/submissions?zip=1',NULL,NULL),(452,507,76,'(6) September Question of the Day (Even)',65,'https://canvas-lms.ga/courses/13/assignments/507',13,'<p>For your warm up-Every day answer the \"Question of the Day\" and \"What is not like the other\" for the day\'s class period. </p>\n<p>If you do not know the answer, then at least write the question/what is not like the other- into the day\'s slot and we will go over it as a class 5 minutes later. </p>\n<p>At the end of the month, you will press submit. You only have to press submit at the end of the month. </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:34','2020-10-28 14:15:34',NULL,'https://canvas-lms.ga/courses/13/assignments/507/submissions?zip=1',NULL,NULL),(453,631,76,'Recorded September Question of the Day (ODD)',65,'https://canvas-lms.ga/courses/13/assignments/631',13,'<p>If you are absent, watch the Question of the Day and \"What is not like the Other\" to make sure that you do not miss out on direct instruction. Make sure you reach out to your group and complete any classwork that you missed. Remember, you can do this by communicating with them on the group page.</p>\n<p><a title=\"(6) September question of the day- (ODD 20/21)\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F56384467\" target=\"_blank\">(6) September question of the day- (ODD 20/21)</a></p>\n<p> </p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:51','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/631/submissions?zip=1',NULL,NULL),(454,634,76,'September Question of the Day (Even)',66,'https://canvas-lms.ga/courses/13/assignments/634',13,'<p>Complete Question of the Day and \"What is not like the others\" each day you take your seat in class!</p>\n<p>It will be a classwork grade, due at the end of each month. If you are absent, ask for the question of the day from your teammates and have them catch you up. </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:51','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/634/submissions?zip=1',NULL,NULL),(455,628,76,'PRACTICE- CANVAS SCAVENGER HUNT PART 1- HW',67,'https://canvas-lms.ga/courses/13/assignments/628',13,'<p>Complete the Part 1 of the Canvas Scavenger Hunt by next class.</p>\n<p>Click on the Grey Tab below! to open the assignment. When finsihed, press submit in the top right hand corner- a blue Submit Button. Make sure that it timestamps the assignment so you know that you submitted!</p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:50',NULL,'https://canvas-lms.ga/courses/13/assi