=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25245128\" target=\"_blank\">(6) Unit 1 Lesson 1 Notes</a><a title=\"(6) Unit 1 Lesson 1\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25245129\" target=\"_blank\"></a></p>\n<p><a title=\"(6) Unit 1 Lesson 1\" href=\"https://canvas-lms.ga/courses/13/external_tools/retrieve?display=borderless&amp;url=https%3A%2F%2Fgoogle-drive-lti-iad-prod.instructure.com%2Flti%2Fcontent-view%2Frce%2F25245129\" target=\"_blank\">(6) Unit 1 Lesson 1 powerpoint  (instructional video on how to watch linked videos in power point)</a></p>\n<p> </p>\n<p>Click on link Grey below at the very bottom! It will open in the new tab. You can go back and forth between Lesson notes and the questions to answer the questions.  </p>\n<p>When finished with the HW Questions- You must Also Complete the Quiz. Click here: <a title=\"(6) Unit 1 Lesson 1 Quiz\" href=\"https://canvas-lms.ga/courses/13/assignments/526\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/13/assignments/526\" data-api-returntype=\"Assignment\">(6) Unit 1 Lesson 1 Quiz</a></p>\n<p><span style=\"background-color: #ffff00;\">But first submit the questions here!!!!</span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/630/submissions?zip=1',NULL,NULL),(460,629,76,'Practice How to Submit Group work- Via Website URL',68,'https://canvas-lms.ga/courses/13/assignments/629',13,'<p><span><strong>Submit Via Website URL-</strong></span></p>\n<p><span><strong>Step 1- you have your assignment (own google doc). Shared with the correct people and CCPS.</strong></span></p>\n<p><span><strong>Step 2:Take the sharable link of your google document- copy and paste it. </strong></span></p>\n<p><span><strong>Step 3: Go to the Canvas assignment in Canvas. Press submit assignment- then paste the URL. And then press submit again. </strong></span></p>\n<p><span><strong>_____________________________________________________________________________________________________</strong></span></p>\n<p><span><strong>Practice here. Do it at least 5 times. Just keep pressing resubmit. </strong></span><strong></strong></p>\n<p style=\"text-align: center;\"><span style=\"background-color: #00ff00; font-size: 14pt;\"><strong>Collect/Research information Chart</strong></span></p>\n<p><span>Task #1: </span><span>20 points______ <a class=\"external\" href=\"https://mychesterfieldschools.us-west-2.instructuremedia.com/embed/f6582cf6-2470-4e74-a3fc-77211c902619\" target=\"_blank\">Everyone watch my Instructional Video First!<span class=\"screenreader-only\"> (Links to an external site.)</span></a></span></p>\n<p><span>Your group will select a Native American Indian Tribe from the tribes listed above and will research cultural information about them. Cultural information includes such things as: language, food, shelter, location, religious practices, clothing, recreation, festivals/celebrations, family organization, governmental structure, and technology. You can use online resources, encyclopedias (on-line or in the library), and books/magazines. You will collect and organize the data that your group gathers and determine the best way to display your findings.  This can be done either with project board displays, digital displays (powerpoints, prezis, videos etc..) or any form of media your group chooses to use.  </span></p>\n<p><span style=\"background-color: #ffff00;\"><a class=\"external\" style=\"background-color: #ffff00;\" href=\"https://docs.google.com/document/d/1BhJ9eXNrZSv6xdbl4muyc4Pmvc_ieWzMaRUdAydkI3U/edit?usp=sharing\" target=\"_blank\">Click on this link for a chart. (Make a copy and share with your group and everyone in Chesterfield County). </a></span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:50',NULL,'https://canvas-lms.ga/courses/13/assignments/629/submissions?zip=1',NULL,NULL),(461,636,76,'Submit Group Expectations',68,'https://canvas-lms.ga/courses/13/assignments/636',13,'<p>Make a copy of the <a href=\"https://docs.google.com/document/d/1QM6RKq88I9nAaoU54jfgr8encN0d7syqppz9zKTS1nw/edit?usp=sharing\" target=\"_blank\">group norms</a>! Share with everyone in your group and everyone in Chesterfield County. </p>\n<p>Discuss as a group in your group chat. (Go to the home page- click on your group chat link- and open the group meeting link for your table.)</p>\n<ul>\n<li>Before you finish it- someone take the sharable link and paste it to an announcement on your Canvas Group Page. Under an Announcement titled \"group Expectations\" so you always have them!</li>\n</ul>\n<p><span style=\"background-color: #32e7fc;\">To submit-</span> When complete, please come back to this Canvas Assignment- Called \"Group Expectations\" and Submit via Website URL. </p>\n<p> </p>\n<p> </p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:51','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/636/submissions?zip=1',NULL,NULL),(462,625,76,'Group KWL Task',68,'https://canvas-lms.ga/courses/13/assignments/625',13,'<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:50',NULL,'https://canvas-lms.ga/courses/13/assignments/625/submissions?zip=1',NULL,NULL),(463,635,76,'Set up Google Drive Folders for the Year',68,'https://canvas-lms.ga/courses/13/assignments/635',13,'<p><span style=\"font-size: 14pt;\">You need to set up your history google drive Unit folders so that you can stay organized all year!!</span></p>\n<p><span style=\"font-size: 14pt;\">Once you finish, you will share with me your home folder so I can see that you set up your folders correctly. Submit via website URL. </span></p>\n<p style=\"text-align: left; padding-left: 80px;\"><span style=\"font-size: 14pt;\">Follow the written instructions in this google drive and watch my short videos if you need any extra help. <a href=\"https://docs.google.com/document/d/1PdtYIsWUcZuH_VlLprUWQVWfIawKJgqRcFbt19LPRH4/edit?usp=sharing\">Click for Instructions Here. </a></span></p>\n<ul>\n</ul>',NULL,'2020-10-28 14:15:51','2020-10-28 14:15:51',NULL,'https://canvas-lms.ga/courses/13/assignments/635/submissions?zip=1',NULL,NULL),(464,627,76,'Ms. Birnbaum\'s class Quiz',68,'https://canvas-lms.ga/courses/13/assignments/627',13,'<ul>\n</ul>',NULL,'2020-10-28 14:15:50','2020-10-28 14:15:50',NULL,'https://canvas-lms.ga/courses/13/assignments/627/submissions?zip=1',NULL,NULL),(465,16,76,'QuickQuiz 2',9,'https://canvas-lms.ga/courses/6/assignments/16',6,'<p>The questions on this quiz are made to ensure that you are watching the recorded material. <br>As there are 2 lectures each week, it is set up for one question per lecture </p>',NULL,'2020-10-13 09:10:28','2020-10-13 09:10:29',NULL,'https://canvas-lms.ga/courses/6/quizzes/8/submissions?zip=1',NULL,NULL),(466,66,76,'Reading 3',10,'https://canvas-lms.ga/courses/6/assignments/66',6,'<p><span style=\"text-decoration: underline;\">(1) ## Add information for reading assignment:</span></p>\n<p> </p>\n<p><span style=\"text-decoration: underline;\">(2) ## Add information for reading assignment:</span></p>\n<p> </p>\n<p><span style=\"text-decoration: underline; font-size: 18pt;\"><strong>Then please answer the following questions about the reading - <span style=\"color: #800000; text-decoration: underline;\" data-darkreader-inline-color=\"\"><em>please submit as a PDF</em></span>.</strong></span></p>\n<p>(1) First Reading - (5 points each)</p>\n<ol>\n<li> ##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li> </li>\n</ol>\n<p><span style=\"font-size: 12pt;\">(2) Second Reading -  (5 points each)</span></p>\n<ol>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>##Question about the reading</li>\n<li>\n</li>\n</ol>\n<ul>\n</ul>',NULL,'2020-10-13 09:10:41','2020-10-13 0