g=\"0\" cellpadding=\"0\">\n<colgroup>\n<col width=\"100\">\n<col width=\"154\">\n<col width=\"479\">\n</colgroup>\n<tbody>\n<tr>\n<td data-sheets-value=\'{\"1\":2,\"2\":\"8 Closure: What have I learned\"}\'>8 Closure: What have I learned</td>\n<td></td>\n<td data-sheets-value=\'{\"1\":2,\"2\":\"8-158, 8-159, 8-161, 8-164, 8-165, 8-166, 8-167\"}\'>8-158, 8-159, 8-161, 8-164, 8-165, 8-166, 8-167</td>\n</tr>\n</tbody>\n</table>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-13 09:25:09','2020-10-13 09:25:09',NULL,'https://canvas-lms.ga/courses/9/assignments/433/submissions?zip=1',NULL,NULL),(642,419,76,'ue1 - Unit 1 Exam',36,'https://canvas-lms.ga/courses/9/assignments/419',9,'<p>This exam will cover:</p>\n<ul>\n<li>\n<p>Sketch the graph of a polynomial function in factored form, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.1&amp;type=lesson#4-6\">4?6</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.1&amp;type=lesson#4-14\">4?14</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.3&amp;type=lesson#4-44\">4?44</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-75\">4?75</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-129\">CL 4?129</a>.</p>\n</li>\n<li>\n<p>Given the<span> </span><i>x</i>-intercepts (or roots) of a polynomial, write its equation, as in problems ?<a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.2&amp;type=lesson#4-27\">4?27</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-76\">4?76</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.1&amp;type=lesson#4-111\">4?111</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-130\">CL 4?130</a>.</p>\n</li>\n<li>\n<p>Determine the roots of a polynomial or solve polynomial equations, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.3&amp;type=lesson#4-42\">?4?42</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.1&amp;type=lesson#4-58\">4?58</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-83\">4?83</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.2&amp;type=lesson#4-122\">4?122</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-131\">CL 4?131</a>.</p>\n</li>\n<li>\n<p>Graph transformations of rational functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-77\">4?77</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.1&amp;type=lesson#4-110\">4?110</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.2&amp;type=lesson#4-124\">4?124</a><span> </span>(a) and (c), and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-132\">CL 4?132</a>.</p>\n</li>\n<li>\n<p>Identify horizontal, vertical, and slant asymptotes, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.1&amp;type=lesson#4-56\">4?56</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-82\">4?82</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.3&amp;type=lesson#4-100\">4?100</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-132\">CL 4?132</a>.</p>\n</li>\n<li>\n<p>State the end behavior of a polynomial or rational function, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.1&amp;type=lesson#4-6\">4?6</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.1.3&amp;type=lesson#4-44\">4?44</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.2.2&amp;type=lesson#4-75\">4?75</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.1&amp;type=lesson#4-110\">4?110</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.3.2&amp;type=lesson#4-120\">4?120</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=4.closure&amp;type=lesson#4-135\">CL 4?135</a>.</p>\n</li>\n<li>Expect a basic trig question too.</li>\n</ul>\n<p>You can use your toolkit pages and a unit circle</p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-13 09:25:06','2020-10-13 09:25:15',NULL,'https://canvas-lms.ga/courses/9/assignments/419/submissions?zip=1',NULL,NULL),(643,420,76,'ue2 - Unit 2 Exam',36,'https://canvas-lms.ga/courses/9/assignments/420',9,'<p>The following are the topics we will focus on:</p>\n<ul>\n<li>\n<p>Graph reciprocal functions and/or identify their asymptotes, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.1&amp;type=lesson#5-7\">5?7</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-68\">5?68</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-74\">5?74 (c)</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.4&amp;type=lesson#5-101\">5?101</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-135\">CL 5?135</a>.</p>\n</li>\n<li>\n<p>Solve polynomial and rational inequalities, as in problems <a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.2&amp;type=lesson#5-24\">5?24</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-76\">5?76</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-125\">5?125</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-136\">CL 5?136</a>.</p>\n</li>\n<li>\n<p>Rewrite equations of exponential functions in the form <i>y</i> =<span> </span><i>a </i>· <i>b</i><i><sup>x</sup></i>, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.2&amp;type=lesson#5-19\">5?19</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.3&amp;type=lesson#5-30\">5?30</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-72\">5?72</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-113\">5?113</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-129\">CL 5?129</a>.</p>\n</li>\n<li>\n<p>Understand the inverse relationship between exponents and logarithms, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.1&amp;type=lesson#5-43\">5?43</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.3&amp;type=lesson#5-87\">5?87 (a</a>),<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-132\">CL 5?132</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-134\">CL 5?134</a>.</p>\n</li>\n<li>\n<p>Use the definition of a logarithm to evaluate expressions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.2&amp;type=lesson#5-25\">5?25</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.2&amp;type=lesson#5-64\">5?64</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-114\">5?114</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-130\">CL 5?130</a>.</p>\n</li>\n<li>\n<p>Solve basic equations with exponents and logarithms, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.1.3&amp;type=lesson#5-35\">5?35</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.1&amp;type=lesson#5-44\">5?44</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.3&amp;type=lesson#5-86\">5?86</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-121\">5?121 (a)</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-131\">CL 5?131</a>.</p>\n</li>\n<li>\n<p>Graph basic transformations of the family of logarithmic functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.4&amp;type=lesson#5-98\">5?98</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.2.5&amp;type=lesson#5-116\">5?116</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=5.closure&amp;type=lesson#5-132\">CL 5?132</a>.</p>\n</li>\n</ul>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-13 09:25:06','2020-10-13 09:25:15',NULL,'https://canvas-lms.ga/courses/9/assignments/420/submissions?zip=1',NULL,NULL),(644,421,76,'ue3 - Unit 3 Exam',36,'https://canvas-lms.ga/courses/9/assignments/421',9,'<p>To be ready for this exam you should be ready to answer questions from the topics:</p>\n<p>                Solve basic trigonometric equations or situations, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.1&amp;type=lesson#3-14\">3-14</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.2&amp;type=lesson#3-31\">3-31</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.3&amp;type=lesson#3-127\">3-127</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.4&amp;type=lesson#3-138\">3-138</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.closure&amp;type=lesson#3-145\">CL 3-145</a>.</p>\n<ul>\n<li style=\"list-style-type: none;\">\n<ul>\n<li>\n<p>Graph the sine, cosine, and/or tangent function, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.3&amp;type=lesson#3-44\">3-44</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.5&amp;type=lesson#3-82\">3-82</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.3&amp;type=lesson#3-129\">3-129</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.closure&amp;type=lesson#3-144\">CL 3-144</a>.</p>\n</li>\n<li>\n<p>Complete operations with rational expressions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.1&amp;type=lesson#3-12\">3-12</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.1&amp;type=lesson#3-13\">3-13</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.2&amp;type=lesson#3-30\">3-30</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.3&amp;type=lesson#3-42\">3-42</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.4&amp;type=lesson#3-56\">3-56</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.5&amp;type=lesson#3-78\">3-78</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.2&amp;type=lesson#3-109\">3-109 (a) and (b)</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.4&amp;type=lesson#3-137\">3-137</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.closure&amp;type=lesson#3-147\">CL 3-147 (a) and (b)</a>.</p>\n</li>\n<li>\n<p>Simplify complex fractions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.2&amp;type=lesson#3-28\">3-28</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.3&amp;type=lesson#3-42\">3-42 (d)</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.5&amp;type=lesson#3-73\">3-73</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.2&amp;type=lesson#3-109\">3-109 (c)</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.closure&amp;type=lesson#3-147\">CL 3-147 (c)</a>.</p>\n</li>\n<li>\n<p>Solve nonlinear systems of equations, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.1&amp;type=lesson#3-17\">3-17</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.2&amp;type=lesson#3-35\">3-35</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.3&amp;type=lesson#3-41\">3-41</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.5&amp;type=lesson#3-71\">3-71</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.2&amp;type=lesson#3-108\">3-108</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.3&amp;type=lesson#3-124\">3-124</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.closure&amp;type=lesson#3-148\">CL 3-148</a>.</p>\n</li>\n<li>\n<p>Divide polynomials, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.4&amp;type=lesson#3-54\">3-54</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.5&amp;type=lesson#3-70\">3-70</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.1&amp;type=lesson#3-95\">3-95</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.4&amp;type=lesson#3-136\">3-136</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.closure&amp;type=lesson#3-149\">CL 3-149</a>.</p>\n</li>\n<li>\n<p>Solve word problems, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.5&amp;type=lesson#3-69\">3-69</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.1.5&amp;type=lesson#3-77\">3-77</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.1&amp;type=lesson#3-96\">3-96</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.3&amp;type=lesson#3-128\">3-128</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.2.4&amp;type=lesson#3-139\">3-139</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=3.closure&amp;type=lesson#3-150\">CL 3-150</a>.</p>\n</li>\n</ul>\n</li>\n</ul>\n<p>* Note that not all of these topics will show up on every version of the exam.</p>\n<ul></ul>\n<ul>\n</ul>',NULL,'2020-10-13 09:25:06','2020-10-13 09:25:06',NULL,'https://canvas-lms.ga/courses/9/assignments/421/submissions?zip=1',NULL,NULL),(645,422,76,'ue7 - Unit 7 Exam',36,'https://canvas-lms.ga/courses/9/assignments/422',9,'<p>To be ready for this exam your should be ready to answer questions from the topics:</p>\n<ul>\n<li>\n<p>Graph or write equations of trigonometric functions with multiple transformations, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.1.1&amp;type=lesson#8-8\">8?8</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.1&amp;type=lesson#8-90\">8?90</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-118\">8?118</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.5&amp;type=lesson#8-155\">8?155</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-161\">CL 8?161</a>.</p>\n</li>\n<li>\n<p>Model and evaluate situations using trigonometric functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.1.2&amp;type=lesson#8-26\">8?26</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.1.2&amp;type=lesson#8-34\">8?34</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.2.2&amp;type=lesson#8-75\">8?75</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-124\">8?124</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-160\">CL 8?160</a>.</p>\n</li>\n<li>\n<p>Complete problems involving the reciprocal trigonometric functions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.2.2&amp;type=lesson#8-73\">8?73</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.2&amp;type=lesson#8-102\">8?102</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.4&amp;type=lesson#8-140\">8?140</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-159\">CL 8?159</a>.</p>\n</li>\n<li>\n<p>Simplify trigonometric expressions, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.2.1&amp;type=lesson#8-63\">8?63</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.1&amp;type=lesson#8-88\">8?88</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-115\">8?115</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.4&amp;type=lesson#8-139\">8?139</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.closure&amp;type=lesson#8-158\">CL 8?158</a>.</p>\n</li>\n<li>Verifying trigonometric identities, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.2&amp;type=lesson#8-99\">8?99</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-116\">8?116</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-123\">8?123</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.5&amp;type=lesson#8-152\">8?152</a>.</li>\n<li>Applying the angle sum and difference identities, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-114\">8?114</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.3&amp;type=lesson#8-122\">8?122</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.4&amp;type=lesson#8-138\">8?138</a>, and<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=8.3.5&amp;type=lesson#8-151\">8?151</a>.</li>\n<li>\n<p>Solve triangles using the Law of Sines or the Law of Cosines, including the ambiguous case of the Law of Sines, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.1.1&amp;type=lesson#6-9\">6?9</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.1.1&amp;type=lesson#6-17\">6?17</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.1.2&amp;type=lesson#6-32\">6?32</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.1.3&amp;type=lesson#6-46\">6?46</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.2.3&amp;type=lesson#6-104\">6?104</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.2.4&amp;type=lesson#6-135\">6?135</a>, and<span> </span><a href=\"http://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.closure&amp;type=lesson#6-141\">CL 6?141</a>.</p>\n</li>\n<li>\n<p>Solve triangles when the ambiguous case of the Law of Sines could possibly apply, as in problems<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.1.3&amp;type=lesson#6-54\">6?54</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.2.1&amp;type=lesson#6-69\">6?69</a>,<span> </span><a href=\"https://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.2.4&amp;type=lesson#6-128\">6?128</a>, and<span> </span><a href=\"http://ebooks.cpm.org/bookdb.php?title=pc3&amp;name=6.closure&amp;type=lesson#6-142\">CL 6?142</a>.</p>\n</li>\n</ul>\n<p>* Note that not all of these topics will show up on every version of the exam.</p>\n<ul>\n</ul>\n<ul>\n</ul>',NULL,'2020-10-13 09:25:06','2020-10-13 09:25:07',NULL,'https://canvas-lms.ga/courses/9/assignments/422/submissions?zip=1',NULL,NULL),(646,655,76,'Week 1.8: Check for Understanding: Tips for Online Learning and Netiquette',76,'https://canvas-lms.ga/courses/18/assignments/655',18,'<p>Now that you\'ve read about tips for online learning success, the syllabus, and about netiquette take this check for understanding to demonstrate you\'re ready to get started!</p>\n<p>You may wish to open this syllabus <strong><em><span style=\"background-color: #ffff99;\">[insert link to syllabus]</span> </em></strong>in a separate tab, so you can reference it during the quiz.</p>\n<p><span style=\"background-color: #f1c40f;\">Check the settings and add a due date.</span></p>\n<p> </p>',NULL,'2021-01-04 06:59:18','2021-01-04 06:59:18',NULL,'https://canvas-lms.ga/courses/18/quizzes/68/submissions?zip=1',NULL,NULL),(647,660,76,'Week 1.2: Create Your Canvas Profile and Settings',76,'https://canvas-lms.ga/courses/18/assignments/660',18,'<p><span style=\"font-size: 12pt;\">Before getting started with our course, please take a minute to check and update your Canvas profile and settings.</span></p>\n<p><span style=\"color: #800000; font-size: 18pt;\">1. Upload your photo.</span></p>\n<p><span style=\"font-size: 12pt;\">Whether you upload a photo or take one through Canvas, you will find that attaching a photo to your Canvas profile is painless. Please remember that your photo must be academically appropriate.</span></p>\n<p style=\"text-align: left;\"><span style=\"font-size: 12pt;\">Here is a video walk-through of how to upload your photo.  You will learn about some other settings as well, such as adding additional email addresses and even a mobile number. Note: Names come to Canvas from WebAdvisor, so they cannot be changed by users.  If you would like to change your display name in Canvas, please contact Admissions or the Online Learning Center. </span></p>\n<p style=\"text-align: center;\"><iframe src=\"https://player.vimeo.com/video/74243735?title=0&amp;byline=0&amp;portrait=0\" width=\"640\" height=\"360\" allowfullscreen=\"allowfullscreen\" webkitallowfullscreen=\"webkitallowfullscreen\" mozallowfullscreen=\"mozallowfullscreen\" data-mce-fragment=\"1\"></iframe></p>\n<p style=\"text-align: center;\"><a href=\"https://vimeo.com/74243735\">111 - User Settings &amp; Profile Picture</a> from <a href=\"https://vimeo.com/canvaslms\">Canvas LMS</a> on <a href=\"https://vimeo.com\">Vimeo</a>.</p>\n<h3><span style=\"color: #800000;\">2. Update your Notification Preferences.</span></h3>\n<p>This video will show you how to set your notifications:</p>\n<ul>\n<li>which events you receive notifications about (like new grades and messages)</li>\n<li>where you receive notifications (college email, personal email, mobile phone, and even Twitter!)</li>\n<li>how often you receive notifications (immediately, daily, weekly, or never)</li>\n</ul>\n<p>As you learn what works best for you, you can change your preferences as often as you like.  However, please set the following initially.  I strongly recommend that you <strong>keep these notifications set to \"Notify me right away\": </strong></p>\n<ul>\n<li>announcement</li>\n<li>grading</li>\n<li>submission comment</li>\n<li>conversation message</li>\n</ul>\n<p style=\"text-align: center;\"><iframe src=\"https://player.vimeo.com/video/75514816?title=0&amp;byline=0&amp;portrait=0\" width=\"640\" height=\"360\" allowfullscreen=\"allowfullscreen\" webkitallowfullscreen=\"webkitallowfullscreen\" mozallowfullscreen=\"mozallowfullscreen\" data-mce-fragment=\"1\"></iframe></p>\n<p style=\"text-align: center;\"><a href=\"https://vimeo.com/75514816\">112 - Notification Preferences</a> from <a href=\"https://vimeo.com/canvaslms\">Canvas LMS</a> on <a href=\"https://vimeo.com\">Vimeo</a>.</p>\n<ul>\n</ul>',NULL,'2021-01-04 06:59:23','2021-01-04 06:59:23',NULL,'https://canvas-lms.ga/courses/18/assignments/660/submissions?zip=1',NULL,NULL),(648,654,76,'Syllabus & Welcome module Quiz [Sample Name, changes as needed]',77,'https://canvas-lms.ga/courses/18/assignments/654',18,'<p>Now that you\'ve read all of the essential course info included in our syllabus and Welcome module, take this quiz to demonstrate you\'re ready to get started!</p>\n<p>You may wish to open this syllabus <strong><em><span style=\"background-color: #ffff99;\">[insert link to syllabus]</span> </em></strong>in a separate tab, so you can reference it during the quiz. To open the syllabus in a separate tab or window, hold down your Control (Command for MAC users) key, click the syllabus link above, and select the option you\'d like.</p>\n<p> </p>\n<h2>Quiz Settings</h2>\n<ul>\n<li>You will have <strong><em><span style=\"background-color: #ffff99;\">[insert number or say unlimited]</span></em></strong> attempts to complete this quiz.</li>\n<li>You will have<em> <strong><span style=\"background-color: #ffff99;\">[insert time amount]</span></strong></em> long per attempt.</li>\n<li>After the attempt, you <strong><em><span style=\"background-color: #ffff99;\">may/may not</span></em></strong> see your answers and the correct answers. [<strong><em><span style=\"background-color: #ffff99;\">Rewrite to reflect the options you selected.]</span></em></strong>\n</li>\n<li><strong><em><span style=\"background-color: #ffff99;\">[insert other quiz settings you selected.]</span></em></strong></li>\n<li>This quiz will open on [<strong><em><span style=\"background-color: #ffff99;\">insert day/time].</span></em></strong>\n</li>\n<li>This quiz is due on <strong><em><span style=\"background-color: #ffff99;\">[insert day/time].</span></em></strong>\n</li>\n<li>This quiz will no longer be available after <strong><em><span style=\"background-color: #ffff99;\">[</span></em><em><span style=\"background-color: #ffff99;\"><strong><em>i</em></strong>nsert day/time].</span></em></strong>\n</li>\n</ul>\n<p><strong><em><span style=\"background-color: #ffff99;\">[NOTE: Make sure the options you select are reflected in this description.]</span></em></strong></p>\n<p> </p>',NULL,'2021-01-04 06:59:18','2021-01-04 06:59:18',NULL,'https://canvas-lms.ga/courses/18/quizzes/67/submissions?zip=1',NULL,NULL),(649,659,76,'Week 1.9: Meet-n-Greet',77,'https://canvas-lms.ga/courses/18/assignments/659',18,'<h2>Get to know your classmates!</h2>\n<p>Welcome students! Just like on the first day of a face-to-face class, we will take time to get to know each other.</p>\n<p>Initial post due by [<em><strong><span style=\"background-color: #ffff99;\">insert day/date</span></strong></em>] at [<strong><em><span style=\"background-color: #ffff99;\">insert time am/pm</span></em></strong>] | Replies due by [<strong><em><span style=\"background-color: #ffff99;\">insert day/date</span></em></strong>] at [<strong><em><span style=\"background-color: #ffff99;\">insert time am/pm</span></em></strong>]</p>\n<p> </p>\n<h2>Goal/Purpose</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here an explanation of the motivation(s) for the discussion and how it ties into course content and other assignments</span></em></strong>]</p>\n<p>[<em><strong><span style=\"background-color: #ffff99;\">Suggestion</span></strong></em>] This discussion is an opportunity to meet your classmates and build community. This learning community will help you stay on track and complete our course. Getting to know each other today will help you succeed tomorrow.</p>\n<p> </p>\n<h2>Posting Directions</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here and thoroughly describe all steps and tasks to be completed</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>] You will submit one (1) post to introduce yourself to the class.</p>\n<ul>\n<li>Begin by reading all the directions for this discussion.</li>\n<li>Complete one of the two options below before <span style=\"background-color: #f1c40f;\">11 pm on Tuesday</span>:</li>\n<li>Option #1: Text Intro\n<ul>\n<li>Once you are ready, click on Reply arrow below.</li>\n<li>Click into the text box.</li>\n<li>Introduce yourself to the class. [<span style=\"background-color: #f1c40f;\">There is a word counter in the bottom right of the text box to help you keep track if you would like to have a word count]</span>\n</li>\n<li>Tell us your name, something about your personality, and a hobby or favorite thing. Don\'t reveal anything too personal in your written text.</li>\n</ul>\n</li>\n</ul>\n<ul>\n<li>Option #2: Video Intro\n<ul>\n<li>Once you are ready, click on Reply arrow below these directions.</li>\n<li>Use the built-in media recorder (slightly rounded rectangle with a white play triangle), to reply to this discussion. (See below for more help on this option.)</li>\n<li>Record a 1-2 minute video, introducing yourself to the rest of the class.</li>\n<li>Tell us your name, something about your personality, and a hobby or favorite thing. Don\'t reveal anything too personal in your words or video.</li>\n<li>You will be given the option to Record using your webcam. </li>\n</ul>\n</li>\n</ul>\n<p> </p>\n<h2>Reply Posts</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here the directions for the replies to include, but not be limited to, the following:</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>] Replies are a way for you to have a conversation with your online classmates. This is the give-and-take of listening and responding like a face-to-face conversation. Remember to be polite and respectful of difference, uniqueness, and the unknown.</p>\n<p>You will replies three (3) times to have a conversation with one or more of your classmates.</p>\n<ul>\n<li>Complete all of three (3) replies following these direction before 11pm on Friday:\n<ul>\n<li>Read or view a classmates post.</li>\n<li>Once you are ready, click on the Reply arrow right beneath their post.</li>\n<li>Post either a 1-2 minutes video reply or a 100-150 word text reply.\n<ul>\n<li>Politely ask open-ended questions to get to know them better.</li>\n</ul>\n</li>\n<li>Or if someone replied to you, you can post a 1-2 minute video or 100-150 word reply to politely answer their questions.</li>\n<li>Remember: do not reveal anything too personal in your replies.</li>\n</ul>\n</li>\n</ul>\n<p> </p>\n<h2>Submission Instructions</h2>\n<p><strong><em><span style=\"background-color: #ffff99;\">[insert here a description of how they will click into the reply line to post; how to find which peer to reply to; and if they have to post before seeing their classmate\'s posts. Consider including screenshots.</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>]</p>\n<ul>\n<li>Reply to people with the fewest replies. When you collapse all the post (up arrow icon near the original Reply line), you can see everyone\'s initial posts. On the right hand side, you can see the number of unread/total posts.</li>\n<li>Video posts are not required. If you do not have a webcam or do not wish to show your face, use the text option for your posts.</li>\n<li>As you read and respond to others\' posts, keep in mind some basic rules for <a href=\"https://create.piktochart.com/embed/6004556-core-rules-of-netiquette\" target=\"_blank\">netiquette:</a>\n<ul>\n<li>Be kind and respectful to others</li>\n<li>Use full sentences</li>\n<li>Don\'t use too much jargon</li>\n<li>Treat others online as you wish to be treated</li>\n<li>Use language that supports others</li>\n</ul>\n</li>\n</ul>\n<p> </p>\n<h2>Grading &amp; Instructor Presence</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here a description of how and when the discussion board will be graded; refer students to the rubric with explanation/screenshot on how to find it; explain instructor level of participation on board (none vs some); remind students to check Grades for feedback.</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>]</p>\n<p>Your posts will be graded in 3-5 days after the Replies are due. I will use the attached rubric to grade your posts. Don\'t know how to view the rubric? Read this <a href=\"https://tuftsedtech.screenstepslive.com/s/18992/m/73355/l/899012-student-how-do-i-view-instructor-feedback-on-an-assignment\">quick Grades overview</a>. I will post an introduction of myself and reply to 30% of the class for this discussion. If you reply to me, I may reply back. Everyone will receive feedback in comments when I grade your posts.</p>\n<p> </p>\n<h2>Resources</h2>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">insert here a list of possible Canvas Guides, video tutorials, or walk-thrus that will help them complete this discussion; a list of additional content resources to expand on the discussion topic; and instructor availability for office hours</span></em></strong>]</p>\n<p>[<strong><em><span style=\"background-color: #ffff99;\">Suggestion</span></em></strong>]</p>\n<p>Here is a video tutorial on how Discussions work in Canvas.</p>\n<p><iframe title=\"vimeo-player\" src=\"https://player.vimeo.com/video/75056432\" width=\"320\" height=\"180\" allowfullscreen=\"allowfullscreen\"></iframe></p>\n<p><a href=\"https://vimeo.com/75056432\">Discussion Overview</a> from <a href=\"https://vimeo.com/canvaslms\">Instructure Community</a> on <a href=\"https://vimeo.com\">Vimeo</a>.</p>\n<h2>Need more help?</h2>\n<p>Here are three ways to contact me:</p>\n<ul>\n<li>Post a question to the <a title=\"Q&amp;A Discussion Forum ? \" href=\"%24CANVAS_OBJECT_REFERENCE%24/discussion_topics/g3a4802ac66470bf2c970c3f6c07af1e4\" data-api-endpoint=\"https://rccd.instructure.com/api/v1/courses/24695/discussion_topics/167485\" data-api-returntype=\"Discussion\">class Q&amp;A</a>.</li>\n<li>Add a private comment to this Discussion.</li>\n<li>Send me a private message in Canvas Inbox.</li>\n</ul>',NULL,'2021-01-04 06:59:21','2021-01-04 06:59:22',NULL,'https://canvas-lms.ga/courses/18/assignments/659/submissions?zip=1',NULL,NULL),(650,656,76,'Week 2 Quiz [Sample Name, changes as needed]',77,'https://canvas-lms.ga/courses/18/assignments/656',18,'<p><span style=\"background-color: #ffff99;\"><strong><em>[Note: This is a template based on best practices for quizzes. </em></strong></span><span style=\"background-color: #ffff99;\"><strong><em>Use this template as a starting point; make changes as needed to fit your course, content, and teaching style. Best practices recommends a consistent prompt structure for all your quizzes (by type) so that students know what to expect. This consistency lessens student confusion and increases their likely participation.]</em></strong></span></p>\n<p> </p>\n<h2><strong>Goal</strong></h2>\n<p><span style=\"background-color: #ffff99;\"><strong><em>[insert here an explanation of the learning obje