count will be created by onlineastrotalk in the name of astrologer and a username and password will be  generated. The same will be forwarded to the astrologer and request will be send to change the password. Astrologer will we liable to maintain privacy of password and username. Any loss due to disclosure of same will be astrologer\'s sole responsibility but in case any loss to the onlineastrotalk due to this act will be punishable.</li>\r\n	<br>\r\n	<li>The Astrologer payment part can be withdrawn at the end of every month after reduction of applicable taxes and charges.</li>\r\n</ul>');
