INSERT INTO `quizz` VALUES (1,2,'Test Your Knowledge','<p><img src=\"https://canvas-lms.ga/courses/4/files/247/preview?verifier=ShvOpiDkpVLKsKkgPrRrI9dc6ghHMwL5KwZy85ps\" alt=\"Page_Header.JPG\" width=\"2010\" height=\"214\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/4/files/247\" data-api-returntype=\"File\"></p>\n<table style=\"width: 100%; border-collapse: collapse;\">\n<tbody>\n<tr>\n<td style=\"width: 50%; text-align: center;\">\n<p><span style=\"font-size: 14pt;\">Congratulations!!  You\'ve successfully reviewed the AWS Educate program features and benefits. </span></p>\n<p><span style=\"font-size: 14pt;\"> Think you know the benefits of AWS Educate? Take this five-question quiz to find out.</span></p>\n</td>\n<td style=\"width: 50%;\"><img src=\"https://canvas-lms.ga/courses/4/files/255/preview?verifier=zv2EPSHdczwJSnMUg4HHEqbJx1t9xZghpucZzWrF\" alt=\"Thinking Graphic.JPG\" width=\"300\" height=\"223\" data-api-endpoint=\"https://canvas-lms.ga/api/v1/courses/4/files/255\" data-api-returntype=\"File\"></td>\n</tr>\n</tbody>\n</table>\n<p><span style=\"font-size: 14pt;\">Read each question carefully, and click the answer choice next to your response. Each correct or incorrect response will result in appropriate feedback immediately at the bottom of the screen.</span></p>\n<p><span style=\"font-size: 14pt;\">Good luck!</span></p>','https://canvas-lms.ga/courses/4/quizzes/2','assignment','.','.',NULL,4),(2,48,'Cells','<p>You will have multiple tries on this quiz. You must score above an 85% to move on. You can only complete this quiz once your cell chapter is complete in the review book.</p>','https://canvas-lms.ga/courses/10/quizzes/48','assignment','.','.',NULL,10),(3,46,'Energy Self Guided','<p>You have multiple tries to achieve an 85% to move on. Remember the highest grade is recorded. </p>','https://canvas-lms.ga/courses/10/quizzes/46','assignment','.','.',NULL,10),(4,45,'Genetic variation','<p>You will have two tries on each question. This is timed, 10 minutes to complete. the highest grade will be posted to the grade book. </p>','https://canvas-lms.ga/courses/10/quizzes/45','assignment','.','plasmid',NULL,10),(5,49,'Mendelian Genetics','<p>Two tries, 10 minutes. Highest grade is recorded. Good luck.</p>','https://canvas-lms.ga/courses/10/quizzes/49','assignment','.','pea pod',NULL,10),(6,47,'Student Feedback Survey','<p>Students, the survey below has been designed to collect feedback from you regarding the overall effectiveness of the courses you take at Regis Jesuit. Teachers seek to gather information on the following aspects of your experience:<br>- the degree to which the course content represents a guaranteed and viable curriculum;<br>- the effectiveness of the teacher’s instructional methods;<br>- the level of effort and engagement owned by you, the student.</p>\n<p><strong>Students, the survey results will only be seen directly by the teacher of this course.</strong> Your responses are <strong>completely anonymous</strong>. Your feedback will be used by the teacher to improve instruction and to grow as a teacher. The school administrators, including the principal, will not see any feedback or comments you provide.</p>\n<p>Please be <strong>thoughtful, honest, and reflective</strong> as you complete the survey below.</p>','https://canvas-lms.ga/courses/10/quizzes/47','survey','.','.',NULL,10),(7,43,'Lab Safety Quiz','','https://canvas-lms.ga/courses/8/quizzes/43','assignment',NULL,NULL,NULL,8),(8,50,'Digital Etiquette','<p>Select the best answer to the following questions.</p>','https://canvas-lms.ga/courses/11/quizzes/50','assignment',NULL,NULL,NULL,11),(9,51,'Take this Orientation Quiz','<p>Answer these questions about what you have learned so far in this Orientation course. </p>','https://canvas-lms.ga/courses/11/quizzes/51','practice_quiz',NULL,NULL,NULL,11),(10,14,' QuickQuiz 11','<p><br>The questions on this quiz are made to ensure that you are watching the recorded material. <br>As there ar